INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 2, N'右中耳炎', N'右侧外耳道及中耳内可见软组织影，将局部空隙填充，内见不规则点状高密度影，周围及乳突前缘骨质吸收破坏，乳突气房内见软组织密度影，左侧示乳突气化良好，密度无增高，小房间隙清晰，双侧内听道对称无扩大，左侧中耳骨质结构完整，鼓室无增大，听小骨未见破坏。', N'右侧中耳炎。', 100, 0, N'CT', N'颞骨平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 2, N'正常 阴性', N'平扫骨窗显示双侧乳突气化良好，密度无增高，小房间隙清晰，双侧内听道对称无扩大，中耳骨质结构完整，鼓室无增大，听小骨未见破坏。', N'乳突区未见明显异常。', 100, 0, N'CT', N'颞骨平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
