INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 2, N'乳突炎，胆脂瘤 阳性', N'左侧乳突气化较差，左侧乳突气房、鼓室上鼓室及鼓窦内软组织密度影充填，右侧上述结构充气良好，两侧听小骨形态良好。双侧内听道对称无扩大，耳蜗半规管存在。两侧外耳道通畅。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 2, N'左中耳炎', N'右侧外耳道及中耳内可见软组织影，左侧听小骨未见，左侧乳突呈板障型，鼓室及鼓窦骨质破坏，扩大，其内有低密度组织充填影；两侧耳蜗及半规管形态良好。 右侧中耳骨质结构完整，鼓室无增大，听小骨未见破坏。', N'左侧慢性中耳乳突炎伴胆脂瘤形成考虑，左侧听小骨破坏；部分乳突硬化性改变。', 100, 0, N'CT', N'颞骨平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 2, N'双侧中耳乳突炎', N'双侧中耳、鼓窦及乳突内可见软组织影，密度增高，以左侧明显，鼓室及鼓窦未见明显骨质破坏，听骨链尚清晰，前庭及半规管形态良好，双侧内听道对称无扩大。', N'双侧中耳乳突炎。', 100, 0, N'CT', N'颞骨平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
