INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'右侧额、颞、顶部慢性硬膜下血肿，中线结构左移', N'右侧额、颞、顶部颅板下见新月形高低混杂密度影，右侧脑半球受压，右侧侧脑室受压变窄并左移，脑实质内未见异常密度影。中线结构左移，颅骨未见明显异常。', N'&#183;右侧额、颞、顶部慢性硬膜下血肿，中线结构左移。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'基底节腔梗 阳性', N'两侧基底节区见斑点状低密度影。余脑实质未见明显异常密度。脑室系统，脑沟、脑池未见增宽。中线居中，小脑、脑干无殊。', N'两侧基底节区腔梗灶。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'右侧外囊梗塞，侧脑室旁缺血性改变 阳性', N'右侧外囊区见弧形低密度灶，边界清晰。两侧侧脑室旁片状低密度区，边界模糊。脑室系统饱满，脑沟、脑池稍增宽。中线居中，小脑、脑干无殊。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'基底节钙化 阳性', N'两侧大脑半球对称，双侧基底节区见斑块状高密度影，其余脑实质内未见异常密度影，脑沟脑室系统未见增宽扩大，中线结构居中。颅骨未见明显异常。', N'双侧基底节钙化灶，余颅内未见异常。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'正常 急诊', N'两侧大脑半球对称，脑实质内未见异常密度影。脑室系统未见扩张，脑池、脑沟形态与年龄相符。中线结构居中，颅骨未见明显异常。', N'颅脑CT颅内未见异常,必要时请复查。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'急诊阴性 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影。脑室系统未见扩张，脑池、脑沟形态与年龄相符。中线结构居中，颅骨未见明显异常。', N'颅脑CT颅内目前未见异常,必要时请复查。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'两侧苍白球钙化考虑。 阴性', N'两侧大脑半球对称，两侧基底节区见对称性小片高密度影，余脑实质内未见异常密度影，脑沟脑室系统未见增宽扩大，中线结构居中。颅骨未见明显异常。', N'两侧苍白球钙化考虑。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'脑梗塞', N'右侧基底节区见小囊状低密度灶，边界不清，脑室、脑沟形态大小与年龄相符，中线结构居中。', N'右侧基底节区腔隙性脑梗塞。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'老年脑改变', N'两侧大脑半球对称，脑实质内未见异常密度影。侧脑室增宽，脑回脑沟增深。中线结构居中，颅骨未见明显异常。', N'老年脑改变', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'枕大池增大', N'两侧大脑半球对称，脑实质内未见异常密度影。各脑室、脑沟大小形态与年龄相符。中线结构居中，颅骨未见明显异常。枕大池增大，形态不规则，考虑正常变异。', N'颅脑CT颅内未见异常。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'胸正侧位+颈椎侧位', N'颈椎生理曲度存在，各椎体骨质完整，C5椎体稍扁，C2-4椎体后缘变尖，未见明显破坏，椎间隙未见增宽或狭窄，附件无殊。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'左肋膈角胸膜改变 阳性', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。左膈模糊，肋膈角浅钝，心影及右膈无殊。肋骨未见异常骨质改变。', N'左侧胸膜改变（Left Pleural effusion）', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'颈椎退变+胸部正常 阳性', N'颈椎生理曲度存在，各椎体骨质完整，部分椎体边缘变尖硬化，椎间隙未见明显增宽或狭窄，附件无殊。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'正常 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影，脑沟脑室系统未见增宽扩大，中线结构居中。颅骨未见明显异常。', N'颅脑CT平扫颅内未见异常。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'右上肺结核', N'胸廓对称，气管居中，右上肺可见条索状致密影。心影大小形态正常，两膈面光滑，两侧肋膈角锐利。肋骨未见异常改变。', N'右上肺陈旧性结核 Old TB', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'乳头 阴性', N'胸廓两侧对称，气管居中，两下肺中带结节影，病灶边缘清，余肺野清，未见实质性病灶。心影狭长，双膈低平。肋骨未见异常骨质改变。', N'两下肺中带结节影，乳头影可能性较大，建议必要时进一步检查', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'心脏换瓣术后', N'胸正中数个手术缝环，心影内见金属瓣环、细导丝，连至右胸见临时起搏器，心影不大，右深静脉管末端平T4右缘，另一置管经右心末端位于主肺动脉至右肺动脉处，气管插管平T4水平。肺野尚清晰。两膈无殊。', N'心脏换瓣术后、置管后。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'头颅及眼眶正常', N'两侧大脑半球对称，脑内未见异常密度影，脑室系统未见增宽扩大，中线结构居中，颅骨未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'文胸环扣重叠', N'胸廓对称，气管居中。文胸环扣影重叠，所示两肺野内未见明显异常密度灶。心膈无殊。', N'心肺膈未见明显异常。The chest film is normal.', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'置管后', N'胸廓对称，气管居中。两肺未见明显异常密度灶。心膈无殊。右路PICC管末端平T7/8右缘。', N'心肺膈未见明显异常。置管后。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'主动脉迂曲', N'胸廓对称，气管居中。两肺未见明显异常密度灶。心膈无殊。主动脉迂曲。', N'心肺膈未见明显异常；主动脉迂曲。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
