INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'脑梗塞 阳性', N'右侧额叶、颞叶、基底节区及颞枕交界处可见大片低密度影，其余脑实质内未见异常密度影，双侧脑室略增宽，脑沟略增宽扩大，中线结构居中。颅骨未见明显异常。', N'右侧额叶、颞叶、基底节区及颞枕交界处多发梗塞灶。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'主动脉型心血管改变。 阳性', N'两肺纹理清晰，肺内未见明显肿块及结节。胸廓两侧对称，气管居中，心影左大，主动脉迂曲钙化。双膈无殊。', N'主动脉型心血管改变。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
