INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'主动脉迂曲 阴性', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。主动脉迂曲，心膈无殊。', N'主动脉迂曲。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
