INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'颅脑阴性 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影，脑沟脑室系统未见增宽扩大，中线结构居中。颅骨未见明显异常。', N'颅脑CT平扫颅内未见异常。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'鼻咽部纤维血管瘤栓塞术 阳性', N'患者平卧，常规消毒铺巾，5ml利多卡因局麻，穿刺左侧股动脉，经短导丝及扩张器引导，置入导管鞘，以5F-H1导管经长导丝引导，置管于右侧颈内、右侧颈外动脉、左侧颈外动脉造影，可见鼻咽部团状染色，右侧颈外动脉的上颌动脉及咽升动脉为主供血，左侧少量供血；右位主动脉弓。经过长导丝引导，分别超选至右侧上颌动脉及咽升动脉，注入150～300um大小的明胶海绵颗粒约半瓶，术毕退管至右侧颈外动脉造影，鼻咽部染色已基本未见。撤管后穿刺点压迫止血20分钟，包扎送返病房。', N'鼻咽部纤维血管瘤栓塞术。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
