INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'肺纹理增多 阳性', N'两肺纹理增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中。肋骨未见异常骨质改变。', N'两肺纹理增多 Increased Lung Markings', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
