INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'正常胸片 阴性', N'胸廓对称，气管居中，两肺纹理清晰，双肺未见明显肿块及结节。心影无殊，两膈面光整，肋膈角锐利。', N'心肺膈未见明显异常。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 3, N'胸部外伤阴性。 阴性', N'两肺纹理紊乱，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。膈上肋骨未见异常骨质改变。', N'心肺膈未见明显异常，膈上肋骨未见明显错位骨折。', 100, 0, N'CT', N'颅脑平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 4, N'正常眼眶平扫 阴性', N'眼眶薄层扫描显示两侧眼眶诸结构清楚，骨壁连续，眶内未见异常密度阴影，眶周软组织未见明显肿胀。毗邻上颌窦、筛窦、蝶窦和额窦显示层面未见明显异常。', N'眼眶CT扫描未见明显异常。', 100, 0, N'CT', N'眼眶平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 4, N'正常眼眶 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影。脑室系统未见扩张，脑池、脑沟形态与年龄相符。中线结构居中，颅骨未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 4, N'颅脑眼眶正常 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影。脑室系统未见扩张，脑池、脑沟形态与年龄相符。中线结构居中，颅骨未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 5, N'颅脑CT扫描未见明显异常。 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影。各脑室、脑池、脑沟大小形态与年龄相符。中线结构居中。增强后颅内血管走行尚自然，未见明显异常强化影。颅骨未见明显异常。', N'颅脑CT扫描未见明显异常。', 100, 0, N'CT', N'颅脑增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 5, N'正常 阴性', N'两侧大脑半球对称，脑实质内未见异常密度影。各脑室、脑池、脑沟大小形态与年龄相符。中线结构居中。增强后颅内血管走行尚自然，未见明显异常强化影。颅骨未见明显异常。', N'颅脑CT颅内未见明显异常，建议隔期复查。   
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 6, N'头颅CTA正常 阴性', N'头颅CTA显示两侧大脑前动脉、大脑中动脉、大脑后动脉及基底动脉环走行自然，管壁光滑、管腔均匀，未见明显异常血管团或瘤样扩张。', N'头颅CTA未见明显异常。', 100, 0, N'CT', N'颅骨三维成像', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 7, N'头颅CTA未见明显异常。', N'头颅CTA示两侧大脑前动脉、中动脉、后动脉及基底动脉及其主要分支未见明显扩张、狭窄及瘤样病变。', N'头颅CTA未见明显异常。', 100, 0, N'CT', N'头颅CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 7, N'头颅CTA正常 阴性', N'头颅CTA示大脑动脉环及两侧大脑前动脉、中动脉、后动脉及基底动脉及其主要分支未见明显扩张、狭窄及瘤样病变。', N'头颅CTA未见明显异常。', 100, 0, N'CT', N'头颅CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 8, N'正常 阴性', N'头颅CTV示大脑上下矢状窦、两侧横窦、乙状窦、直窦及大静脉内未见明显充盈缺损，静脉系统未见明显异常扩张。脑实质内未见明显异常密度灶。', N'头颅CTV未见明显异常。', 100, 0, N'CT', N'头颅CTV', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 9, N'正常', N'子宫腔显影良好，边缘光整。两侧输卵管呈细线样显影，走行自然，造影剂通过顺畅，弥散良好，盆腔内呈羽毛状分布，未见明显异常积聚征象。', N'子宫输卵管造影未见明显异常。', 100, 0, N'CT', N'鞍区平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 9, N'子宫输卵管造影未见明显异常。 阴性', N'往子宫内注入适量对比剂，子宫显影良好，两侧子宫角显示可；两侧输卵管显影良好，对比剂通过顺畅，弥散良好。', N'子宫输卵管造影未见明显异常。', 100, 0, N'CT', N'鞍区平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 9, N'输卵管不通，伞部积水 阳性', N'往子宫内注入适量对比剂，子宫显影良好，两侧子宫角显示可；两侧输卵管显影，伞部扩张，较高压力下未见对比剂通过，40分钟后摄片示两侧输卵管伞部对比剂积聚，形态固定，盆腔内未见对比剂弥散。', N'两侧输卵管不通，伞部积水', 100, 0, N'CT', N'鞍区平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 9, N'HSG正常 阴性', N'往子宫内注入适量对比剂，子宫显影良好，两侧子宫角显示可；两侧输卵管显影良好，对比剂通过顺畅，弥散良好。', N'子宫输卵管造影提示两侧输卵管通畅。', 100, 0, N'CT', N'鞍区平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 9, N'正常 阴性', N'鞍区未见明显占位，骨质未见明显增生及破坏。所见蝶窦、上颌窦及筛窦骨壁光滑，未见明显软组织影，鼻中隔居中。', N'鞍区未见明显异常，必要时MR检查。', 100, 0, N'CT', N'鞍区平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 10, N'正常 阴性', N'两侧眼眶诸结构清楚，骨壁连续，眶内未见异常密度阴影，眶周软组织未见明显肿胀。毗邻上颌窦、筛窦、蝶窦和额窦显示层面未见明显异常。双侧乳突气化良好，密度无增高，小房间隙清晰，双侧内听道对称无扩大，中耳骨质结构完整，鼓室无增大，听小骨未见破坏。颅底脑组织未见明显异常密度灶，中线居中。', N'颅底平扫未见明显异常。', 100, 0, N'CT', N'颅底平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'两侧下鼻甲轻度肥厚', N'两侧额窦、蝶窦、筛窦、上颌窦窦腔蓄气正常，未见明显混浊及密度增高影，窦壁骨质未见破坏。鼻中隔略偏曲。两侧下鼻甲粘膜轻度肥厚。', N'1、两侧下鼻甲轻度肥厚。　　2、鼻中隔略偏曲。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'副鼻窦－英文 阳性', N'右侧上颌窦、额窦、筛窦内可见软组织样密度影，骨壁光整，余左侧上颌窦、额窦、筛窦及蝶窦窦腔内未见明显软组织密度影，窦壁完整，眶壁未见明显的骨质破坏。鼻中隔居中。双侧下鼻甲未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'双侧上颌窦炎 阳性', N'双侧上颌窦可见软组织样密度影，骨壁光整，其余筛窦、额窦及蝶窦窦腔内未见明显软组织密度影，窦壁完整，眶壁未见明显的骨质破坏。鼻中隔稍向左侧偏移。双侧鼻甲未见异常肥厚。', N'双侧上颌窦炎 sinusitis', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'左侧上颌窦囊肿 阳性', N'副鼻窦发育良好。左侧上颌窦底部可见附壁椭圆形颞枕，边界清晰，相邻窦壁未见明显骨质吸收、破坏。右侧上颌窦、两侧筛窦、额窦、蝶窦蓄气良好，未见明显粘膜增厚、窦腔缩小，窦壁骨质吸收等改变，各鼻道通畅，鼻腔未见息肉样增生，鼻中隔下段轻微向右侧偏曲，鼻甲尚可，未见明显增厚。', N'左侧上颌窦囊肿。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'sinusitis 阳性', N'双侧上颌窦、筛窦粘膜增厚，可见软组织样密度影，骨壁光整，额窦及蝶窦窦腔内未见明显软组织密度影，窦壁完整，眶壁未见明显的骨质破坏。鼻中隔居中。双侧下鼻甲轻度肥厚。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'正常 阴性', N'双侧上颌窦，额窦，筛窦及蝶窦均未见明显窦壁增厚，窦腔内清晰，鼻中隔居中，余无殊。', N'副鼻窦CT扫描未见明显异常。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'全组副鼻窦炎 阳性', N'两侧全组副鼻窦内充盈软组织影，两侧鼻甲不厚，鼻中隔未见明显偏曲，各窦壁骨质未见明显吸收破坏。', N'全组副窦炎。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'双侧上颌窦炎 阳性', N'双侧上颌窦可见软组织样密度影，骨壁光整，其余筛窦、额窦及蝶窦窦腔内未见明显软组织密度影，窦壁完整，眶壁未见明显的骨质破坏。鼻中隔稍向左侧偏移。双侧鼻甲未见异常肥厚。', N'双侧上颌窦炎 sinusitis', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'GDC栓塞 阳性', N'术前常规准备，全身麻醉后消毒铺巾，以Seldinger法行右侧股动脉穿刺，置入导管鞘，以H-1导管行双侧颈内动脉、左侧椎动脉造影，右侧颈内动脉3-D造影并重建后，右侧颈内动脉后交通动脉段见直径约5mm的囊状突出，瘤颈约3mm。交换为引导导管，经引导导管置入微导管，微导管头到达动脉瘤腔内后置入GDC,共使用4个GDC，分别为3-D的5mm*9cm、4mm*8cm、Matrix型2.5mm*6cm和2mm*4cm，造影显示动脉瘤腔已经闭塞，载瘤动脉通畅，远端动脉显示良好。术后麻醉苏醒后回病房，术后常规处理。', N'右侧颈内动脉后交通动脉段动脉瘤GDC栓塞以及术后改变。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'动脉瘤以GDC栓塞术 阳性', N'常规术前准备，全麻后患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的H1导管分别置于两侧颈内动脉和左侧椎动脉造影以及右侧颈内动脉3-D造影，显示右侧大脑前动脉－前交通动脉分叉处局部囊状突出，动脉瘤横径约6mm，长径8mm。全身肝素化后，交换导管，以微导管插管至动脉瘤腔内，造影明确后引入6mm、5mm、4mm和3mm的GDC共4个，置入GDC后造影显示瘤腔已经完全闭塞，载瘤动脉通畅，两侧前交通动脉显示良好。术后常规复苏送ICU，留置导管鞘24小时后拔管压迫止血，观察病情稳定后将病人送返病房。', N'右侧大脑前动脉－前交通动脉瘤以及GDC栓塞术后改变。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'全组副鼻窦炎 阳性', N'两侧全组副鼻窦内充盈软组织影，两侧鼻甲不厚，鼻中隔未见明显偏曲，各窦壁骨质未见明显吸收破坏。', N'全组副窦炎。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'双侧上颌窦炎 阳性', N'双侧上颌窦可见软组织样密度影，骨壁光整，其余筛窦、额窦及蝶窦窦腔内未见明显软组织密度影，窦壁完整，眶壁未见明显的骨质破坏。鼻中隔稍向左侧偏移。双侧鼻甲未见异常肥厚。', N'双侧上颌窦炎 sinusitis', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 12, N'阴性。', N'双侧上颌窦，额窦，筛窦及蝶窦均未见明显窦壁增厚，窦腔内清晰，鼻中隔居中，余无殊。', N'副鼻窦CT扫描未见明显异常。', 100, 0, N'CT', N'副鼻窦冠状位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 13, N'正常 阴性', N'平扫显示鼻咽顶后壁无增厚，表面光滑，两侧壁软组织对称，咽隐窝及咽鼓管开口无变窄，咽旁间隙清晰。两侧上颌窦、筛窦、蝶窦充气良好，粘膜未见明显增厚。骨窗显示颅底、各组鼻窦壁骨质完整。', N'鼻咽部CT平扫未见异常。', 100, 0, N'CT', N'鼻咽部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 14, N'正常 阴性', N'双侧颧弓走行自然，骨皮质连续光整，未见明显骨折征象。上颌骨及下颌骨骨质完整，未见明显骨折线。两侧上颌窦及蝶窦窦腔显示清，未见异常密度影。眼眶内未见明显异常密度影。', N'双侧颧弓未见明显骨折征象。', 100, 0, N'CT', N'颧弓扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 14, N'双侧颧弓未见明显异常 阴性', N'两侧颧弓见骨皮质连续，骨质完整，未见明显骨折线，上颌骨及下颌骨骨质完整，未见明显骨折线。两侧上颌窦及蝶窦窦腔显示清，未见异常密度影。眼眶内未见明显异常密度影。未见明显软组织肿胀。', N'双侧颧弓未见明显异常。', 100, 0, N'CT', N'颧弓扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 14, N'正常 阴性', N'双侧颧弓走行自然，骨皮质连续光整，未见明显骨折征象。上颌骨及下颌骨骨质完整，未见明显骨折线。两侧上颌窦及蝶窦窦腔显示清，未见异常密度影。眼眶内未见明显异常密度影。', N'双侧颧弓未见明显骨折征象。', 100, 0, N'CT', N'颧弓扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 14, N'左侧颧弓骨折', N'左侧颧弓见骨质透亮影，骨皮质断裂，对位可。上颌骨及下颌骨骨质完整，未见明显骨折线。两侧上颌窦及蝶窦窦腔显示清，未见异常密度影。眼眶内未见明显异常密度影。左侧颧弓部相邻软组织肿胀。', N'左侧颧弓骨折伴局部软组织血肿，建议复查。', 100, 0, N'CT', N'颧弓扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 15, N'颞颌关节正常 阴性', N'两侧颞颌关节对位良好，关节面骨质完整，两侧上颌骨肢骨质完整，未见明显骨折征象，软组织肿胀不明显，亦无明显密度改变。', N'两侧颞颌关节未见明显异常。No abnormality is found.', 100, 0, N'CT', N'颞颌关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 16, N'全组副窦炎', N'两侧全组副鼻窦内充盈软组织影，左侧下甲肥大，中膈未见明显偏曲，筛窦内骨隔显示不清。', N'全组副窦炎，建议穿刺除外肿瘤性病变。', 100, 0, N'CT', N'副鼻窦水平位平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 17, N'下颌骨正常 阴性', N'下颌骨骨质完整连续，未见明显骨质破坏等异常，两侧颞颌关节未见异常，周围软组织无殊。部分牙根缺如，下牙槽以及牙根关系见图示。', N'1、下颌骨未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 16, N'占位 阳性', N'Ax (T1WT2WI) Sag (T1WI)　COR（T2WI）
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 17, N'英文版，牙列不齐 阳性', N'下颌骨骨质完整连续，未见明显骨质破坏等异常，两侧颞颌关节未见异常，周围软组织无殊。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 18, N'牙科刻盘。 阳性', N'牙科刻盘。', N'牙科刻盘。', 100, 0, N'CT', N'种植牙三维测量', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 20, N'L3/4、L4/5、L5/S1椎间盘未见明显异常。', N'L3/4、L4/5、L5/S1椎间盘未见膨隆及突出，硬膜囊未见受压，椎间孔未见明显狭窄，黄韧带未见明显增厚，神经根未见明显受压。L3－S1椎体边缘骨质增生影。', N'L3/4、L4/5、L5/S1椎间盘未见明显异常。', 100, 0, N'CT', N'腰椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 20, N'L4/5、L5/S1椎间盘向后方轻度膨出 阳性', N'L4/5、L5/S1椎间盘向后方轻度膨出，硬膜囊前缘轻度受压，椎间孔未见明显狭窄，黄韧带未见明显增厚。L3－S1椎体边缘未见明显骨质增生影。', N'L4/5、L5/S1椎间盘向后方轻度膨出。', 100, 0, N'CT', N'腰椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 20, N'正常 阴性', N'骨盆平扫示两侧髂骨、坐骨及耻骨骨质结构完整，两侧骶髂关节、髋关节结构正常，关节间隙未见明显增大或缩小，关节周围软组织未见明显异常改变。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 20, N'L4/L5-L5/S1椎间盘后突', N'L4/5-L5/S1椎间盘向后突出，硬膜囊前缘明显受压，椎间孔未见明显 狭窄，黄韧带未见明显增厚，神经根未见明显受压。L3－S1椎体边缘骨质增生影。定位片示腰椎生理曲度稍变直。', N'L4/L5-L5/S1椎间盘后突。', 100, 0, N'CT', N'腰椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 20, N'L5/S1膨出', N'L5/S1椎间盘向四周膨出，硬膜囊前缘受压，椎间孔未见明显狭窄，黄韧带未见明显增厚，神经根未见明显受压。L3－S1椎体边缘骨质增生影。', N'L4/L5-L5/S1椎间盘后突。   L1椎体压缩性骨折。', 100, 0, N'CT', N'腰椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 20, N'L1椎体压缩性骨折', N'L1椎体前缘及侧缘见骨皮质中断，可见骨折线，断端向后移位，椎体后缘见一骨片向后移位，进入椎管。', N'L1椎体压缩性骨折。', 100, 0, N'CT', N'腰椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'L3/L4-L5/S1椎间盘轻度膨出 阳性', N'L3/L4-L5/S1椎间盘向四周轻度膨出，硬膜囊稍受压，椎间孔稍狭窄，黄韧带未见明显增厚。L3－S1椎体边缘骨质增生影。定位片示腰椎生理曲度存在。', N'L3/L4-L5/S1椎间盘轻度膨出，腰椎退行性改变。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'L4/5椎间盘膨出，L5/S1椎间盘左后突出 阳性', N'L4/5椎间盘向周围膨出，L5/S1椎间盘左后突出，左侧神经根受压，硬膜囊受压，椎间孔稍狭窄，余椎间盘无明显膨出。L4椎体左前缘见骨赘突起，附件形态未见异常改变，软组织未见异常钙化及骨化影。', N'L4/5椎间盘膨出，L5/S1椎间盘左后突出。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'L3/L4-L5/S1椎间盘膨出', N'L3/L4-L5/S1椎间盘向四周轻度膨出，硬膜囊未见明显受压，椎间孔未见明显 狭窄，黄韧带未见明显增厚，神经根未见明显受压。L3－S1椎体边缘未见明显骨质增生影。定位片示腰椎生理曲度稍变直。', N'L3/L4-L5/S1椎间盘轻度膨出', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'正常 阴性', N'腰椎曲度及序列正常，各椎间盘未见明显膨突出，椎间隙未见狭窄，椎体边缘未见骨赘突起，附件形态未见异常改变，软组织未见异常钙化及骨化影。', N'腰椎CT平扫未见明显异常改变。No abnormality is found.', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'突出膨出', N'L4-L5椎间盘向后突出，硬膜囊受压，相应水平椎管狭窄，神经根似见受压。L5-S1轻度膨出。黄韧带未见明显增厚，所见部分椎体边缘骨质增生。', N'L4-L5椎间盘突出，L5-S1椎间盘膨出。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'椎间盘膨出 阳性', N'L4/5、L5/S1椎间盘向后膨出，相应部位硬膜囊前缘受压改变，两侧椎间孔变窄，余椎间盘未见明显突出、膨出改变，后纵韧带钙化不明显。各椎体周围见不规则骨质增生影。周围软组织无殊。', N'1、L4/5、L5/S1椎间盘向后膨出。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'椎间盘膨出 阳性', N'L4/5、L5/S1椎间盘向后膨出，相应部位硬膜囊前缘受压改变，两侧椎间孔变窄，余椎间盘未见明显突出、膨出改变，后纵韧带钙化不明显。各椎体周围见不规则骨质增生影。周围软组织无殊。', N'1、L4/5、L5/S1椎间盘向后膨出。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'MRM报告 阳性', N'椎管内注射对比剂后全脊柱MRI成像：椎管内对比剂充盈良好。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'C5/6椎间盘变性突出 阳性', N'颈椎曲度变直，各椎体前缘轻度骨质增生，C5/6椎间盘变性突出，轴位显示椎间盘向左后突出，颈髓前缘受压表现。其余椎间盘未见明显异常，颈髓信号无殊。', N'C5/6椎间盘变性突出', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'C4-7 阳性', N'颈椎曲度变直，C4-7颈椎椎体骨质增生，C4/5、C5/6、C6/7椎间盘T2WI信号减低并突出，其中C6/7椎间盘突出明显，轴位显示椎间盘向后正中突出为主，相应平面颈髓受压改变。颈髓未见明显信号改变。', N'颈椎轻度退行性改变，C4/5、C5/6、C6/7椎间盘变性突出。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'C3/4、C4/5和C5/6 阳性', N'颈椎曲度改变，C3-6节段颈椎后凸表现，各椎体形态和信号未见明显异常改变，C3/4、C4/5和C5/6椎间盘向后正中突出，相应硬膜囊前缘受压。颈髓信号无异常。', N'颈椎退行性改变，C3/4、C4/5和C5/6椎间盘突出。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'C5-7椎间盘膨出 阳性', N'颈椎曲度变直，C4-7颈椎椎体轻度骨质增生，C5/6、C6/7椎间盘T2WI信号减低并略向后膨出。其余椎体和椎间盘未见明显异常表现，颈髓和硬膜囊未见明显形态和信号改变。', N'颈椎轻度退行性改变，C5/6、C6/7椎间盘变性并轻度膨出。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 21, N'L4/5椎间盘膨出，L5/S1椎间盘左后突出 阳性', N'L4/5椎间盘向周围膨出，L5/S1椎间盘左后突出，左侧神经根受压，硬膜囊受压，椎间孔稍狭窄，余椎间盘无明显膨出。L4椎体左前缘见骨赘突起，附件形态未见异常改变，软组织未见异常钙化及骨化影。', N'L4/5椎间盘膨出，L5/S1椎间盘左后突出。', 100, 0, N'CT', N'L3－S1椎间盘平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 29, N'正常颈部增强 阴性', N'左侧鼻咽部软组织未见明显增厚，两侧咽旁间隙清晰，双侧梨状窝及会厌谷未见占位，两侧颈鞘间隙内未见明显异常结节状影，甲状腺内未见异常密度灶，双侧声襞未见增厚。余所见结构未见明显异常。', N'颈部增强CT未见明显异常改变。No abnormality is found.', 100, 0, N'CT', N'颈部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 22, N'脊碘造影 阳性', N'腰穿后椎管内注入造影剂后全脊柱薄层扫描及重建：可见颈、胸、腰段扫描示椎管内造影剂见造影剂充盈，C6/7水平左侧、C7/T1水平两侧、T1/2水平两侧、T3/4水平右侧、T4/5水平右侧、T5/6水平右侧可见神经根对比剂充盈。脊髓未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 22, N'正常 阴性', N'CT定位片示胸椎生理曲度存在，椎间隙无殊。T9、T10椎体形态、大小正常，骨质结构完整，未见明显骨折线影，椎管形态属常，椎旁软组织未见明显肿胀。', N'T9－T10CT平扫未见明显异常。', 100, 0, N'CT', N'胸椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 22, N'L3－S1椎间盘平扫未见明显异常改变。 阴性', N'腰椎曲度及序列正常，各椎体及附件形态未见异常改变，各椎间盘未见明显膨出或突出，椎管未见狭窄，软组织未见异常钙化及骨化影。', N'L3－S1椎间盘平扫未见明显异常改变。', 100, 0, N'CT', N'胸椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 22, N'胸椎退行性改变。 阳性', N'CT定位片示胸椎生理曲度存在，椎间隙无殊。所见椎体骨质增生，椎管形态属常，所见椎间盘未见明显膨出或突出，椎旁软组织未见明显肿胀。', N'胸椎退行性改变。', 100, 0, N'CT', N'胸椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L3/4、L4/5和L5/S1椎间盘变性膨出。 阳性', N'腰椎曲度变直，L3-5椎体边缘骨质增生，L3/4、L4/5和L5/S1椎间盘T2WI信号减低伴膨出，硬膜囊前缘受压表现。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L4/5和L5/S1椎间盘变性膨出。 阳性', N'腰椎生理性曲度存在，各腰椎椎体前缘轻度骨质增生，L4/5和L5/S1椎间盘T2WI信号减低并膨出，相应平面椎管狭窄，硬膜囊受压表现，其余椎间盘未见异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L4/5椎间盘变性膨出 阳性', N'腰椎生理性曲度存在，各腰椎椎体前缘轻度骨质增生，L4/5椎间盘T2WI信号减低并轻度膨出，硬膜囊未见明显受压改变，其余椎间盘未见异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L2-S1椎间盘变性膨出。 阳性', N'腰椎生理性曲度变直，各腰椎椎体边缘骨质增生，椎体信号未见明显异常。L2-S1各椎间盘T2WI信号减低伴膨出，硬膜囊前缘受压表现。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'正常腰椎MRI 阴性', N'腰椎生理性曲度存在。L1-5椎体及附件形态及信号无殊。各腰椎椎间盘信号无改变，未见椎间盘突出及膨出。硬膜囊未见受压征象。腰髓及马尾信号无异常。', N'腰椎MRI平扫未见明显异常。', 100, 0, N'CT', N'颈椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'正常胸椎、腰椎MRI 阴性', N'胸椎生理性曲度存在。胸椎椎体形态如常，未见明显骨质增生表现，椎体附件无殊。诸椎间盘未见明显膨出或突出征象，硬膜囊未见受压。胸髓信号无异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L4/5突出、L5/S1膨出 阳性', N'腰椎曲度变直，各腰椎椎体前缘轻度骨质增生，L4/5椎间盘明显突出，轴位显示椎间盘向向后正中突出；L5/S1椎间盘T2WI信号减低并膨出，相应平面椎管狭窄，硬膜囊受压表现。其余椎间盘未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L5/S1膨出 阳性', N'腰椎生理性曲度存在，各个腰椎椎体骨质增生，椎体前缘可见骨赘形成。L5/S1椎间盘变性并膨出，相应平面硬膜囊受压表现，其余椎间盘未见明显膨出或突出征象。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'L3/4、L4/5和L5/S1变性突出。 阳性', N'腰椎曲度变直，L3-5椎体边缘骨质增生，骨赘形成。L3/4、L4/5和L5/S1椎间盘T2WI信号减低伴突出，其中L5/S1比较明显，轴位显示椎间盘向右后突出，同侧侧隐窝变窄，硬膜囊前缘受压表现。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 23, N'正常 阴性', N'颈1至7椎体骨质结构完整，寰枢椎关节位置未见明显异常变化，齿突居中，椎旁软组织未见异常肿胀，椎管内未见异常密度影。定位片示颈椎曲度稍直。', N'颈椎CT平扫未见明显异常。No abnormality is found.', 100, 0, N'CT', N'颈椎平扫(每三个椎体)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 24, N'强直性脊柱炎 阳性', N'双侧骶髂关节面不光整，可见虫蚀样缺损和增生硬化，关节面下可见囊样骨质缺损，关节间隙不光整并宽窄不等。周围软组织未见明显异常改变。所见骨盆其余组成骨未见明显异常。', N'双侧骶髂关节慢性炎症表现，符合强直性脊柱炎。', 100, 0, N'CT', N'骨盆平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 24, N'L3/L4-L5/S1椎间盘膨出 阳性', N'L3/L4-L5/S1椎间盘向四周膨出，硬膜囊未见明显受压，椎间孔未见明显 狭窄，黄韧带未见明显增厚，神经根未见明显受压。L3－S1椎体未见明显骨质增生影。', N'L3/L4-L5/S1椎间盘膨出', 100, 0, N'CT', N'骨盆平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 24, N'正常 阴性', N'骨盆平扫示两侧髂骨、坐骨及耻骨骨质结构完整，两侧骶髂关节、髋关节结构正常，关节间隙未见明显增大或缩小，关节周围软组织未见明显异常改变。', N'骨盆平扫未见明显异常。', 100, 0, N'CT', N'骨盆平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 24, N'强直性脊柱炎 阳性', N'双侧骶髂关节面不光整，可见虫蚀样缺损和增生硬化，关节面下可见囊样骨质缺损，关节间隙不光整并宽窄不等。周围软组织未见明显异常改变。所见骨盆其余组成骨未见明显异常。', N'双侧骶髂关节慢性炎症表现，符合强直性脊柱炎。', 100, 0, N'CT', N'骨盆平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 24, N'L3/L4-L5/S1椎间盘膨出 阳性', N'L3/L4-L5/S1椎间盘向四周膨出，硬膜囊未见明显受压，椎间孔未见明显 狭窄，黄韧带未见明显增厚，神经根未见明显受压。L3－S1椎体未见明显骨质增生影。', N'L3/L4-L5/S1椎间盘膨出', 100, 0, N'CT', N'骨盆平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 25, N'骶髂关节炎 阳性', N'两骶髂关节面毛糙、硬化，呈虫蚀状改变，以髂侧面为著，关节间隙尚存，周围软组织无殊。', N'提示两侧骶髂关节炎。', 100, 0, N'CT', N'骶髂关节薄层扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 25, N'骶髂关节炎 阳性', N'两骶髂关节面毛糙、硬化，呈虫蚀状改变，以髂侧面为著，关节间隙尚存，周围软组织无殊。', N'提示两侧骶髂关节炎。', 100, 0, N'CT', N'骶髂关节薄层扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 25, N'骶髂关节正常 阴性', N'两侧骶髂关节组成骨未见明显骨质异常，骶髂关节间隙未见明显狭，未见明显积液。所见周围软组织未见明显异常。', N'两侧骶髂关节未见明显异常。', 100, 0, N'CT', N'骶髂关节薄层扫描', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 26, N'脊碘造影 阳性', N'脊髓造影后颈胸段扫描示C6/7水平椎管内造影剂向两侧椎间孔渗出，余段未见明显造影剂漏出或渗出征象。所示脊柱及脊髓未见明显异常。', N'如上所述，请结合临床。', 100, 0, N'CT', N'颈椎平扫(颈5-颈7)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 26, N'C4/5-C6/7椎间盘轻度膨出 阳性', N'C4/5-C6/7椎间盘向四周轻度膨出，硬膜囊稍受压，黄韧带未见明显增厚。所见椎体边缘骨质增生影。定位片示颈椎生理曲度存在。', N'C4/5-C6/7椎间盘轻度膨出，颈椎退行性改变。', 100, 0, N'CT', N'颈椎平扫(颈5-颈7)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 29, N'右甲状腺癌淋巴结转移', N'右侧甲状腺切除术后，左侧甲状腺部分残留。颈椎3－6椎体右前方的颈部软组织内可见边缘模糊的肿块影，肿块将气管向左推移，右颈部血管被推向外侧。增强扫描可见肿块呈蜂窝状强化', N'右侧甲状腺癌术后右颈部淋巴结转移。', 100, 0, N'CT', N'颈部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 27, N'脊髓脑脊液瘘 阳性', N'腰穿，腔内注射欧乃派克10ml后，嘱患者变换体位，约30分钟后行全脊柱双能量薄层扫描，多平面重建：未见C2椎体水平硬膜囊两侧软组织内高密度对比剂影，T2/3左侧、T4/5左侧及C6/7右侧、C7/T1右侧、T1/2右侧可见对比剂沿相应神经根向外走行，并见相邻近软组织内对比剂弥散，T11/12水平左侧椎间孔处可见囊性对比剂影，C5/T1水平可见对比剂沿神经根向外走行，未超过椎体边缘，软组织未见对比剂弥散，腰段未见明显异常。', N'脊碘造影提示颈、胸段脊髓脑脊液瘘，请结合临床考虑。', 100, 0, N'CT', N'双能量脊碘造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 27, N'脊髓脑脊液瘘 阳性', N'腰穿，腔内注射欧乃派克10ml后，嘱患者变换体位，约30分钟后行全脊柱双能量薄层扫描，多平面重建：未见C2椎体水平硬膜囊两侧软组织内高密度对比剂影，T2/3左侧、T4/5左侧及C6/7右侧、C7/T1右侧、T1/2右侧可见对比剂沿相应神经根向外走行，并见相邻近软组织内对比剂弥散，T11/12水平左侧椎间孔处可见囊性对比剂影，C5/T1水平可见对比剂沿神经根向外走行，未超过椎体边缘，软组织未见对比剂弥散，腰段未见明显异常。', N'脊碘造影提示颈、胸段脊髓脑脊液瘘，请结合临床考虑。', 100, 0, N'CT', N'双能量脊碘造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'颈椎未见明显异常 阴性', N'颈椎生理曲度存在，各椎体骨质完整，未见明显增生及破坏，椎间隙未见增宽或狭窄，附件无殊。', N'颈椎未见明显异常。 No abnormality was found', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'颈椎骨质增生 阳性', N'颈椎生理曲度存在，各椎体骨质完整，部分椎体边缘变尖硬化，椎间隙未见明显增宽或狭窄，附件无殊。', N'颈椎退行性改变，骨质增生。', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'严重退变 阳性', N'颈椎生理曲度存在，各椎体骨质完整，椎体边缘变尖硬化，前纵韧带钙化，C45间骨桥形成，后纵韧带钙化，椎间隙未见明显增宽或狭窄，附件无殊。', N'颈椎退行性改变。', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'颈椎退变 阳性', N'颈椎生理曲度变直，各椎体骨质完整，部分椎体边缘骨质增生，C5-6椎间隙狭窄，项韧带见条状钙化。', N'颈椎退行性改变。', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'颈椎正常 阴性', N'颈椎生理曲度存在，各椎体骨质完整，未见明显增生及破坏，椎间隙未见增宽或狭窄，附件无殊。', N'颈椎未见明显异常。 No abnormality was found', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'颈椎侧位 阳性', N'颈椎生理曲度存在，各椎体骨质完整，部分椎体边缘骨质增生，椎间隙未见增宽或狭窄，软组织无殊。', N'颈椎退行性改变。', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 30, N'喉部未见明显异常 阴性', N'两侧声带对称，声门未见变窄，声带密度未见明显异常，未见异常对比强化，声门上下区未见明显异常，颈部软组织未见明显肿大淋巴结影。', N'喉部未见明显异常。', 100, 0, N'CT', N'喉部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈椎骨质增生', N'颈椎生理曲度存在，顺列。椎体部分边缘变尖。椎间隙不窄。', N'颈椎骨质增生。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈椎病', N'颈椎曲度不自然，顺列。椎体部分边缘增生变尖。C4/5椎间隙变窄。项韧带条块钙化。', N'颈椎病。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈椎轻度骨质增生 阴性', N'颈椎生理曲度存在，各椎体骨质完整，C5、C6椎体前下缘骨质增生，椎间隙未见增宽或狭窄，软组织无殊。', N'颈椎轻度骨质增生。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈椎退行性改变 阳性', N'颈椎生理曲度变直，各椎体骨质完整，部分椎体边缘骨质增生，C4-7前方可见前纵韧带钙化影，棘突后方可见项韧带钙化影，C5/6椎间隙稍变窄，余椎间隙未见明显增宽或狭窄，附件无殊。', N'颈椎退行性改变。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈椎退行性骨关节病 阳性', N'颈椎生理曲度变直，C4-6椎体骨质增生，各椎间隙未见增宽或狭窄，附件无殊。', N'颈椎退行性骨关节病。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈椎正侧位未见明显异常 阳性', N'颈椎生理曲度存在，各椎体骨质完整，未见明显增生及破坏，椎间隙未见增宽或狭窄，附件无殊。', N'颈椎正侧位未见明显异常。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'正常', N'鼻咽部软组织未见明显增厚，两侧咽旁间隙清晰，双侧梨状窝及会厌谷未见占位，两侧颈鞘间隙内未见明显异常结节状影，甲状腺内未见异常密度灶，双侧声襞未见增厚。余所见结构未见明显异常。', N'颈部CT未见明显异常改变。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'软腭闭塞 阳性', N'两侧鼻咽部软组织未见明显增厚，两侧咽旁间隙清晰，双侧梨状窝及会厌谷未见占位，两侧颈鞘间隙内未见肿大淋巴结影，软腭水平气道闭塞。', N'如上，请结合临床。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'睡眠呼吸综合症 阳性', N'睡眠前测得气道最窄处约8MM.
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈部睡眠呼吸暂停 阳性', N'睡眠呼吸暂停综合症上气道CT扫描，鼻腔同畅，鼻咽部气道稍窄，腺样体肥大，咽顶壁增厚明显，口咽部、喉部气道通畅，睡眠前上气道最窄处为口咽部，大小约15mm&#215;8mm，睡眠后上气道最窄处仍为口咽部，大小约9mm&#215;4mm。', N'腺样体肥大，睡眠后与睡眠前比较上气道口咽部明显变窄，请结合临床考虑。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'软腭闭塞 阳性', N'两侧鼻咽部软组织未见明显增厚，两侧咽旁间隙清晰，双侧梨状窝及会厌谷未见占位，两侧颈鞘间隙内未见肿大淋巴结影，软腭水平气道闭塞。', N'如上，请结合临床。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'颈部平扫 阴性', N'两侧鼻咽部软组织未见明显增厚，两侧咽旁间隙清晰，双侧梨状窝及会厌谷未见占位，两侧颈鞘间隙内未见明显异常结节状影，甲状腺内未见异常密度灶，双侧声襞未见增厚。余所见结构未见明显异常。', N'颈部CT扫描未见明显异常改变。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'正常', N'鼻咽部软组织未见明显增厚，两侧咽旁间隙清晰，双侧梨状窝及会厌谷未见占位，两侧颈鞘间隙内未见明显异常结节状影，甲状腺内未见异常密度灶，双侧声襞未见增厚。余所见结构未见明显异常。', N'颈部CT未见明显异常改变。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'请结合临床 阳性', N'睡眠呼吸暂停综合症上气道CT扫描，口咽、鼻咽部气道通畅，口咽部气最窄，约4mm&#215;5mm。', N'上述改变，请结合临床。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 31, N'睡眠呼吸暂停综合症 阳性', N'睡眠呼吸暂停综合症上气道CT扫描，口咽、鼻咽部气道通畅，口咽部最窄处约13mm&#215;9mm。', N'上述改变，请结合临床。', 100, 0, N'CT', N'颈部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'粥样硬化 阳性', N'CTA示两侧颈内外动脉分叉处、两侧颈内动脉海绵窦段可见管壁钙化，管腔轻度狭窄，左侧椎动脉V4段可见较大钙化斑，管腔狭窄明显，右侧椎动脉细小。余各主要动脉走行自然，管壁光滑，未见明显狭窄、扩张、充盈缺损及异常迂曲的血管团。', N'1、两侧颈内外动脉分叉处 、两侧颈内动脉海绵窦段粥样硬化伴管腔轻度狭窄。 
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'阴性。', N'扫描为颈部动脉CTA。两侧颈总动脉、颈内外动脉及椎动脉走行自然，管壁光滑无钙化，未见明显异常狭窄及扩张，未见明显异常血管团。', N'颈部CTA未见明显异常。', 100, 0, N'CT', N'颈部CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'颈部CTA', N'颈部CTA示双侧颈总动脉、颈内外动脉及其主要分支未见明显扩张、狭窄及瘤样病变。双侧椎动脉显示较细，右侧椎动脉起始段明显变细、狭窄，部分动脉未见明显显示；左侧椎动脉起始部显示不清。', N'颈部CTA提示双侧椎动脉起始部狭窄可能，建议DSA检查。', 100, 0, N'CT', N'颈部CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'睡眠呼吸暂停综合症术前 阳性', N'睡眠呼吸暂停综合症术前定位，临床医生另行报告。', N'睡眠呼吸暂停综合症术前定位，临床医生另行报告。', 100, 0, N'CT', N'颈部CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常', N'两肺纹理清晰，未见明显异常密度灶。气管支气管通畅。纵隔未见明显肿块影。未见明显胸膜改变。', N'CT平扫胸部未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'正常冠脉 阴性', N'平扫各支冠脉未见明显钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'粥样硬化 阳性', N'CTA示两侧颈内外动脉分叉处、两侧颈内动脉海绵窦段可见管壁钙化，管腔轻度狭窄，左侧椎动脉V4段可见较大钙化斑，管腔狭窄明显，右侧椎动脉细小。余各主要动脉走行自然，管壁光滑，未见明显狭窄、扩张、充盈缺损及异常迂曲的血管团。', N'1、两侧颈内外动脉分叉处 、两侧颈内动脉海绵窦段粥样硬化伴管腔轻度狭窄。 
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'左颈内动脉闭塞 阳性', N'扫描为颈部动脉CTA。两侧颈总动脉、右颈内外动脉通畅。右颈动脉见两块钙化斑，其中分叉部一块钙化斑，但管腔仍通畅。左颈动脉分叉部狭窄、左颈内动脉起始部闭塞，其上方未见血管。左颈外动脉通畅，管壁上可见两个小钙化斑块。左椎动脉起始部狭窄，其远端血管通畅。右锁骨下动脉未见明确异常。主动脉弓及右无名干、左颈总动脉、左锁骨下动脉三根血管起始部未见异常。', N'颈部CTA见双侧颈动脉粥样硬化。左颈动脉分叉部狭窄、左颈内动脉闭塞、左椎动脉起始部狭窄。', 100, 0, N'CT', N'颈部CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'正常 阴性', N'扫描为颈部动脉CTA。两侧颈总动脉、颈内外动脉及椎动脉走行自然，管壁光滑无钙化，未见明显异常狭窄及扩张，未见明显异常血管团。', N'颈部CTA未见明显异常。', 100, 0, N'CT', N'颈部CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 32, N'颈部CTA', N'颈部CTA示双侧颈总动脉、颈内外动脉及其主要分支未见明显扩张、狭窄及瘤样病变。双侧椎动脉显示较细，右侧椎动脉起始段明显变细、狭窄，部分动脉未见明显显示；左侧椎动脉起始部显示不清。', N'颈部CTA提示双侧椎动脉起始部狭窄可能，建议DSA检查。', 100, 0, N'CT', N'颈部CTA', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'左肺癌', N'左下肺门部可见1.5X1.5CM大小低密度灶，强化不明显，左下肺动脉明显狭窄，管腔受侵犯不光滑，左肺后基底段可见片状高密度灶，纵隔内可见弧形低密度影，心包傍可见液性低密度灶，右侧胸腔下可见液性低密度灶，余无殊。', N'左侧肺门部肿块，首先考虑左肺癌两肺部炎症性病变心包， 纵隔及右侧胸腔内积液', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常肺 阴性', N'两肺未见实质性病变，两肺纹理清晰，气管和支气管通畅。两侧胸廓对称，纵隔和心影居中，纵隔内未见明显肿大淋巴结。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'胸部CT正常 阴性', N'胸廓对称，气管及支气管通畅，两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿块影。心脏大血管形态密度如常。', N'胸部CT平扫未见明显异常。Chest CT is normal.', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'支气管扩张', N'两肺纹理增粗、紊乱，两肺散在肺大泡阴影。两肺下叶可见扩张的柱状支气管影、右下较左侧更明显，周围散在条索状陈旧性病灶及小片状炎性病变。纵隔内可见数个小淋巴结影', N'慢支肺气肿、支气管扩张伴继发感染。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'右肺上叶不张伴肺门增大', N'右上肺可见不规则形高密度影，境界欠清晰，似由数个不规则团块组合形成，其内缘见条带状密度增高影。肿块周围肺纹理增多增粗，排列紊乱，边缘模糊，部分融合成片。侧胸壁胸膜略增厚余肺野清晰，未见明显实质性病灶。纵隔内气管右侧可见肿大淋巴结影。', N'1.右肺上叶不张伴肺门增大，建议纤支镜检查。2.右上肺炎伴胸膜增厚。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'两肺纹理增多，请结合临床。 阳性', N'两肺纹理增多，两肺野内未见明显占位病变，两侧气管通畅，纵隔内未见明显肿大淋巴结影，两侧胸膜不厚。', N'两肺纹理增多，请结合临床。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'右上肺渗出及增殖性病变', N'右上肺尖后段见有淡薄小片状影,边界模糊，部分病灶略有增殖，余肺野未见明显异常，肺血管纹理清晰，纵隔淋巴结未见明显肿大，气管支气管显示通畅，胸膜显示无殊。', N'右上肺渗出及增殖性病变，结核首先考虑。Tuberculosis.', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常', N'两肺纹理走行自然，未见明显异常密度灶。气管支气管通畅。纵隔未见明显肿块影。未见明显胸膜改变。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'胸部平扫未见确切异常。 阴性', N'两肺纹理清晰，两肺野内未见明显占位病变，两侧气管通畅，纵隔内未见明显肿大淋巴结影，两侧胸膜不厚。', N'胸部平扫未见确切异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常', N'两肺纹理清晰，肺内未见明显异常密度灶。气管支气管通畅。纵隔内未见明显肿块影。未见明显胸膜改变。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常', N'两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿块影。两侧胸腔未见明显积液。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'慢支 阳性', N'两肺纹理增粗、紊乱，部分纹理增粗，支气管壁增厚，未见明显实质性病灶，纵隔内未见明显肿块影。附见部分肝、胆、胰、脾无明显异常改变。', N'两肺慢支改变，请结合临床。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'慢支 阳性', N'两肺纹理增粗、紊乱，左下肺多个薄壁空洞影，两下肺广泛片状密度增高影，边界模糊，双侧胸腔新月形积液，右下肺片状高密度影，段以上支气管通畅，纵隔未见明显软组织块影。', N'1、慢支、肺气肿征象，左下肺大泡，两肺感染。2、双侧胸腔积液，右下肺部分膨胀不全。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常 阴性', N'两肺内未见明显异常密度灶。气管支气管通畅，纵隔未见明显肿块。未见明显胸膜改变。', N'胸部CT平扫未见明显异常改变。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常 阴性', N'两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿大淋巴结。附见部分肝、胆、胰、脾无明显异常改变。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'胸部平扫 阴性', N'两肺纹理清晰，未见明显实质性病灶，纵隔内未见明显肿块结节影。胸膜未见明显增厚。胸廓骨性结构完整。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'肺气肿，肺癌 阳性', N'两肺纹理增多，两肺透亮度增加，见散在囊状透亮区。左上肺舌段近胸膜可见团片状高密度影，边界清楚而不光整，可见短毛刺，余邻近胸膜粘连。余两肺纹理走行尚自然，未见明显实质性病灶，纵隔内见肿大淋巴结影。两侧胸腔未见明显积液。', N'1、两肺气肿。慢支？请结合病史。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'胸部正常。 阴性', N'两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿块影。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'胸部平扫 阴性', N'两肺纹理清晰，未见明显实质性病灶，纵隔内未见明显肿块结节影。胸膜未见明显增厚。胸廓骨性结构完整。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'aa 阴性', N'两肺纹理走行自然，两肺野内未见明显实质性病灶，气管分支通畅，纵隔居中，内未见明显肿大淋巴结。附见部分肝、脾无明显异常改变。胸廓骨质未见明显异常。', N'胸部CT平扫未见明显异常改变。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'两肺门、纵隔及两腋下多发肿大淋巴结，首先考虑淋巴瘤', N'胸部CT增强扫描示两肺门、纵隔及两腋下见多个大小不等结节影，部分有融合趋势，上腔静脉受压，两肺野未见明显异常密度灶，血管纹理清晰，气管通畅，肋骨未见明显骨质破坏。', N'两肺门、纵隔及两腋下多发肿大淋巴结，首先考虑淋巴瘤，不除外结节病、转移瘤，请穿刺活检。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'炎症 阳性', N'右下肺后基底段近胸膜可见斑片状模糊影，余两肺纹理走行尚自然，未见明显实质性病灶，纵隔内见肿大淋巴结影。两侧胸腔未见明显积液。', N'右下肺少许炎症伴纵隔肿大淋巴结，请结合临床。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'食管癌 阳性', N'食管下段明显管壁增厚，增强后可见强化，长约9.5cm，周围结构未见明显侵犯，所见两肺野未见明显异常密度灶，气管通畅，纵隔内见肿大淋巴结影。肋骨未见明显骨质破坏。', N'食管下段癌伴纵隔淋巴结转移首先考虑。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'阴性。', N'两肺纹理清晰，两肺未见实质性病变，气管和支气管通畅。两侧胸廓对称，纵隔和气管居中，纵隔内未见明显肿大淋巴结。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 34, N'正常', N'两肺内未见明显异常密度灶。气管支气管通畅，纵隔未见明显肿块。双侧胸腔未见液性密度影。', N'胸部CT平扫未见明显异常。', 100, 0, N'CT', N'胸部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
