INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 36, N'肺静脉及左心房', N'两侧肺静脉及左心房显影清晰，左侧上下肺静脉入口大小分别约为0.7cm，1.7cm；右侧上下肺静脉入口大小分别约为1.6cm，1.9cm。左心房上下径约5.6cm，左右横径大小约6.9cm。', N'两侧肺静脉及左心房所见未见明显异常。', 100, 0, N'CT', N'心脏三维重建', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 36, N'正常冠脉 阴性', N'平扫各支冠脉未见明显钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 37, N'前列腺癌 阳性', N'前列腺左侧外围叶中可见异常信号肿块影，形状不规则，主体大小约15mm&#215;13mm&#215;16mm，平扫T1WI呈等信号，T2WI呈相对低信号，DWI呈明显高信号，注射造影剂后可见早期明显强化。强化后显示肿块局部前列腺包膜有强化，周围血管稍丰富，明显肿大淋巴结未见，精囊未见明确受侵现象。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 37, N'无栓塞 阴性', N'双肺各叶动脉显示清晰，充盈良好，未见明显充盈缺损，远端分支走行自然。两侧肺野清晰，未见明显异常，纵隔内隆突下见不规则的软组织影，可见小斑片状钙化，两侧肺门未见肿大淋巴结。', N'1、两侧肺动脉未见明显栓塞征象。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 38, N'正常胸部 阴性', N'两肺纹理清晰，两肺野未见明显异常密度灶，气管通畅，纵隔内未见明显肿大淋巴结影。胸膜未见明显增厚，胸廓骨性结构完整。', N'胸部CT未见明显异常   Chest CT is normal', 100, 0, N'CT', N'胸部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 38, N'右侧大量胸腔积液伴右下肺部分性不张。', N'胸部CT平扫示右侧胸腔见大量水样密度影，部分包裹形成，右下肺部分性压迫性不张，余两肺野未见明显异常密度灶，气管通畅，纵隔内未见明显肿块影。肋骨未见明显骨质破坏。', N'右侧大量胸腔积液伴右下肺部分性不张。', 100, 0, N'CT', N'胸部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 38, N'结节性病变 阳性', N'两肺内弥漫结节性病变伴两肺门及纵隔淋巴结肿大，符合结节病表现，请对照老片。', N'两肺背侧见弥漫大小不等粟粒样、结节状密度增高影，以左肺下叶背段为甚，部分病灶相互融合，两侧支气管通畅，纵隔及两肺门多发淋巴结肿大。', 100, 0, N'CT', N'胸部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
