INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部和盆腔正常 阴性', N'肝实质平扫和增强密度均匀，未见异常密度影；胆囊形态和大小无殊，囊内密度均匀，肝内外胆管未见扩张。胰腺、脾脏和双肾未见异常。腹腔内肠管分布如常，未见肠壁增厚、肠腔狭窄或扩张等征象，未见明确肿块和肿大淋巴结。盆腔结构无殊。', N'上腹部及盆腔CT扫描未见明显异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
