INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'右冠开口于左窦 阳性', N'平扫各支冠脉未见明显钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'右冠开口于左冠窦 阳性', N'平扫左冠前降支小钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'弥漫病变 阳性', N'平扫左冠主干、前降支、旋支及右冠各段可见多发钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'冠脉阳性 阳性', N'平扫左冠主干、前降支近段及右冠中段可见多个钙化，钙化积分：54.4。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'Normal 阴性', N'平扫各支冠脉未见明显钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 41, N'正常 阴性', N'平扫各支冠脉未见明显钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胰头癌 阳性', N'平扫显示右肝实质密度减低，肝内隐约可见数个小结节状低密度灶，增强扫描动脉期强化不明显，静脉期边界较清晰，其余部分肝实质灌注欠均匀。肝表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶。胰头增大，钩突部见一低密度软组织肿块，平扫边界不清，动脉期显示不均匀的强化，静脉期边界相对较清，大小约54mm*33mm，包绕肠系膜上动脉及主要分支近端，肠系膜上静脉主干未见显示，胰管轻度扩张，胰腺体尾部未见明显萎缩。胰头周围数个淋巴结影，环形强化，脾不大，质均匀。', N'1、胰头钩突部肿块，侵犯肠系膜上动、静脉，提示恶性肿瘤，肝内多发小结节，不能除外转移。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胆囊炎 阳性', N'肝脏轮廓光整，大小正常，肝叶比例协调，肝内外胆管未见扩张，肝内未见明显异常强化病灶。胆囊稍增大，境界欠清，胆囊壁增厚，毛糙，增强后强化明显，内外壁增强呈夹心面包样，胆囊内未见高密度结石影。胰腺、脾脏密度均匀，增强未见明显异常改变。后腹膜结构清晰，未见明确淋巴结肿大。', N'胆囊改变考虑黄色肉芽肿性胆囊炎可能。Cholecystitis', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'慢性胰腺炎考虑，请结合临床。 阳性', N'平扫肝内未见明显异常密度灶，表面光滑，肝叶比例协调，肝裂不宽,增强后未见明显异常强化，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺体积缩小，较疏松，胰管轻度扩张，胰管走行处可见多发点状、斑片状高密度影，周围组织间隙尚清晰，脾不大，质均匀。所见右肾内可见小圆形低密度灶，未见强化，腹膜后未见肿大淋巴结。', N'胰腺上述改变，考虑慢性胰腺炎，请结合临床考虑。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝肾囊肿', N'肝内有多个大小不一的类圆形低密度影，未见增强，肝缘表面光滑，肝比例协调，肝裂不宽，肝内外胆管未见明显扩张。胆囊不大，壁正常。右肾见类圆形低密度影，未见增强，左肾无殊胰腺大小形态无异，脾不大，后腹膜未见淋巴结肿大。', N'肝囊肿、右肾囊肿考虑。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝囊肿', N'肝内有多个大小不一的类圆形低密度影，平扫未见增强，肝缘表面光滑，肝比例协调，肝裂不宽，肝内外胆管未见明显扩张。胆囊不大，壁正常。胰腺大小形态无异，脾不大，后腹膜未见淋巴结肿大。', N'肝囊肿考虑。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'正常上腹部 阴性', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。', N'肝、胆、胰、脾CT扫描未见异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'正常 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀、未见胆管扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。腹腔未见明显积液。', N'上腹部CT平扫及增强扫描未见明确异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肾上腺结节灶，转移？ 阳性', N'两侧肾上腺可见结节状改变，边界清晰，以左侧明显。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胃癌', N'上腹部CT平扫及增强扫描，肝实质密度均匀、未见胆管扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。为充盈，胃窦近幽门区见胃壁增厚，增强后明显强化，周围及后腹膜主动脉旁未见淋巴结肿大。附见两肺下部小片状影。腹部肠管无殊。腹腔未见明显积液。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝多发转移 阳性', N'肝内多发大小不等的低密度灶，类圆形，边界较清，增强动脉期周围肝实质呈环形强化，静脉期边界更清晰，肝表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张，肝内血管纹理清晰。胆囊不大，内见高密度影及分层，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。两肺底未见明显异常。', N'1、肝内多发占位，考虑转移性肿瘤。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝局灶性结节增生', N'肝左叶外侧段见一等密度影，边界不清，中央见不规则低密度影，增强后动脉期明显强化，中央不强化，门脉期及延迟5分呈持续性强化，中央延迟呈相对高密度，余肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'肝左叶外侧段占位，首先考虑局灶性结节增生（FNH），请随访或MR进一步检查。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胆囊颈结石 阳性', N'肝脏轮廓光整，肝叶比例协调，肝实质内未见明显异常密度灶，增强后未见明显异常强化灶，肝内外胆管不扩张，未见明显阳性结石。胆囊稍增大，胆囊壁未见增厚，胆囊颈部可见25mm&#215;26mm环形高密度结石影。胰腺、脾脏密度均匀，增强扫描胰腺、脾脏均匀强化。未见明显脾肿大改变。后腹膜结构清晰，未见明确淋巴结肿大。另见两下肺条索影与胸膜粘连。', N'1、胆囊颈部结石；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'腹部未见明确异常。 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀，左右肝脏比例协调，包膜光整，注射造影剂后肝实质未见明显异常对比增强。肝内外胆管未见扩张，胆囊形态和大小位未见异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胰腺炎，胆囊结石 阳性', N'肝脏表面光滑，肝叶比例协调，肝裂不宽，肝内外胆管无扩张。胆囊区见多发类圆形致密影，囊壁稍增厚，可见强化。胆总管无殊，胰腺形态饱满，胰周围间隙密度增高混浊，双侧肾前筋膜增厚，增强后胰腺实质强化尚均匀，脾不大，质均匀。两肾、肾上腺无殊。腹膜后未见肿大淋巴结。腹腔未见明显积液。', N'1：急性胰腺炎。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'阴性 英文 阴性', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。      
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'急性胰腺炎，胆囊炎，胸腔积液 阳性', N'胰腺外形稍肿胀，周围脂肪间隙模糊，可见较多液性渗出影，胰腺实质未见明显异常密度影，增强后强化均匀，胰管未见扩张，胆囊增大，胆囊壁增厚，强化明显，胆囊内密度未见明显高密度影，肝、脾未见明显异常，左侧肾前筋膜增厚，降结肠旁沟内见液性密度影，后腹膜腔未见明显肿大淋巴结影。两侧胸腔见弧形水样密度影，局部肺组织膨胀不全，左侧明显。', N'1、急性胰腺炎考虑。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肺上腹纤维灶肝囊肿 阳性', N'右中下肺及左上肺舌段条索影，余两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿块影。两侧胸腔未见明显积液。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'右肝巨大占位，首先考虑肝癌；肝硬化，脾肿大', N'平扫示肝脏体积不大，表面欠光整，右肝内见一约10.3*11.3CM低密度影，其前方见一直径约为3.1CM，增强扫描动脉期示不均匀强化，周边强化明显，边界清，静脉期病灶仍强化，呈相对更低密度。肝内外胆管无扩张。胆囊不大，壁不厚，胆囊内未见异常密度影，胰腺大小形态未见异常。 脾增大，质均匀。腹膜后未见明显肿大淋巴结。增强后胰、脾未见异常强化灶。', N'1.右肝巨大占位，首先考虑肝癌；　　　　　　　　　　　　　　　　　　2.肝硬化，脾增大。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部CT平扫未见明确异常。 阴性', N'上腹部CT平扫，肝实质密度均匀，左右肝脏比例协调，包膜光整，肝内外胆管未见扩张，胆囊形态和大小未见异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝血管瘤，小囊肿 阳性', N'肝叶比例协调，肝裂不宽,肝右后叶见一类圆形低密度影，增强后动脉期周边结节样强化，静脉期可见造影剂向内填充，大小约6.3*4.5cm，肝脏近膈顶可见一小圆形低密度影，未见明显强化，约8mm，余肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。两肾及肾上腺无殊。腹膜后未见肿大淋巴结。腹腔未见明显积液。', N'肝右叶血管瘤考虑。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胆囊结石', N'平扫显示右肝内见两个直径约0.8CM大小囊液性密度灶，肝表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内见一约1.6&#215;2&#215;2CM大小高密度影，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。', N'1.胆囊结石；  2.右肝多发囊肿。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'上腹部平扫 阴性', N'所见腹部肠管分布及形态未见明显异常改变，肠管未见明显狭窄，肠壁未见明显增厚，肠系膜脂肪间隙清晰，未见明显肿块影，后腹膜未见明显肿大淋巴结影。双侧髂内血管走行正常，无增粗及移位。膀胱充盈欠佳，壁均匀，周围脂肪间隙清。右侧盆腔可见小静脉石。', N'上腹部及盆腔CT平扫未见明显异常，请随访。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'下腹部正常 阴性', N'下腹部肠管分布及形态未见明显异常改变，肠管未见明显狭窄，肠壁未见明显增厚，肠系膜脂肪间隙清晰，未见明显肿块影，后腹膜未见明显肿大淋巴结影。', N'下腹部CT扫描未见异常。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'正常 阴性', N'下腹部肠管分布及形态未见明显异常改变，肠管未见明显狭窄，肠壁未见明显增厚，肠系膜脂肪间隙清晰，未见明显肿块影，后腹膜未见明显肿大淋巴结影。双侧髂内血管走行正常，无增粗及移位。膀胱充盈，壁均匀，周围脂肪间隙清。', N'下腹部CT扫描未见异常', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胆囊炎，胆石症。上腹盆腔女', N'胆囊境界欠清，胆囊壁增厚，毛糙，增强后强化明显，胆囊内可见环形高密度结石。肝内外胆管不扩张，未见明显阳性结石。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'右肝后叶占位', N'平扫示肝脏体积缩小，表面呈结节状，高低不平，肝内未见异常密度灶，增强扫描动脉期示右肝后叶可见一类圆形强化灶，其内密度不均匀，边界清，大小约2.7*2.8CM,静脉期该病灶更加强化，延迟期该病灶被填充呈略低密度。肝内外胆管无扩张。胆囊不大，壁不厚，胆囊内可见点状条状高密度影，胰腺大小形态未见异常。 脾增大，质均匀。腹膜后未见明显肿大淋巴结。增强后胰、脾未见异常强化灶。', N'1.右肝后叶占位性病变，建议进一步检查2.肝硬化，脾增大 cirrhosis of liver3.胆囊结石 calculus', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胰腺炎，大量腹水，胆囊炎，两侧胸腔积液', N'胰腺体积增大，实质密度不均匀降低，增强后胰实质见片状更低密度，胰周脂肪间隙模糊，胰管显影，胆囊增大，胆囊壁稍增厚，胆囊内密度未见明显高密度影，肝、脾未见明显异常，腹膜腔见较多量水样密度影，后腹膜腔未见明显肿大淋巴结影。两侧胸腔见中等量积液征。', N'胰腺炎，大量腹水，胆囊炎，两侧胸腔积液。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部增强 阴性', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶。胰腺大小、形态未见异常。脾不大，质均匀。双肾形态、密度未见异常。腹膜后未见肿大淋巴结。', N'上腹部CT增强未见明显异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胰体尾癌', N'肝脏各叶比例正常，肝裂无增宽，门脉及分支增粗，肝门处门脉宽约1.3cm。胆囊形态密度未见异常。胰体肿大，密度尚均匀，动脉期轻度强化，静脉期回复低密度，脾静脉明显增粗并向后上移位，壁稍毛糙。脾脏肿大，下缘可见圆形类脾脏实质密度，未见异常密度影。双肾上腺未见明显异常。右肾实质内小圆形囊状影，无强化。腹膜后未见明显增大淋巴结。下腔静脉内双期均可见见充盈缺损。', N'1 胰体尾增大，肿瘤可能性大；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝囊肿', N'平扫显示表面光滑，肝叶比例协调，肝裂不宽,肝见一囊状水样密度影，无强化，边界清，余肝内未见异常密度灶， 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。', N'肝囊肿。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝硬化，脾肿大，静脉曲张 阳性', N'肝脏体积缩小，肝脏表面不规则，呈结节状改变，肝叶比例失调，肝裂增宽，肝实质质地欠均匀。肝内外胆管无扩张。胆囊增大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾增大，增强后质地欠均。两肾及两肾上腺无殊，腹膜后未见肿大淋巴结。腹腔未见明显积液。食道胃底脾门周围见迂曲侧支血管。', N'1、肝硬化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'卧位前后位。 阴性', N'胸廓两侧对称，气管居中，两肺未见明显活动性病灶。卧位心影，纵隔无殊。两侧横膈与肋膈角清楚。', N'卧位前后位摄片未见明显异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部和盆腔正常 阴性', N'肝实质平扫和增强密度均匀，未见异常密度影；胆囊形态和大小无殊，囊内密度均匀，肝内外胆管未见扩张。胰腺、脾脏和双肾未见异常。腹腔内肠管分布如常，未见肠壁增厚、肠腔狭窄或扩张等征象，未见明确肿块和肿大淋巴结。盆腔结构无殊。', N'上腹部及盆腔CT扫描未见明显异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部CT平扫未见明确异常。 阴性', N'上腹部CT平扫，肝实质密度均匀，左右肝脏比例协调，包膜光整，肝内外胆管未见扩张，胆囊形态和大小未见异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'正常 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀、未见胆管扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。腹腔未见明显积液。', N'上腹部CT平扫及增强扫描未见明确异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'腹部未见明确异常。 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀，左右肝脏比例协调，包膜光整，注射造影剂后肝实质未见明显异常对比增强。肝内外胆管未见扩张，胆囊形态和大小位未见异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胰腺炎，胆囊结石 阳性', N'肝脏表面光滑，肝叶比例协调，肝裂不宽，肝内外胆管无扩张。胆囊区见多发类圆形致密影，囊壁稍增厚，可见强化。胆总管无殊，胰腺形态饱满，胰周围间隙密度增高混浊，双侧肾前筋膜增厚，增强后胰腺实质强化尚均匀，脾不大，质均匀。两肾、肾上腺无殊。腹膜后未见肿大淋巴结。腹腔未见明显积液。', N'1：急性胰腺炎。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝肾囊肿', N'肝内有多个大小不一的类圆形低密度影，未见增强，肝缘表面光滑，肝比例协调，肝裂不宽，肝内外胆管未见明显扩张。胆囊不大，壁正常。右肾见类圆形低密度影，未见增强，左肾无殊胰腺大小形态无异，脾不大，后腹膜未见淋巴结肿大。', N'肝囊肿、右肾囊肿考虑。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝血管瘤，小囊肿 阳性', N'肝叶比例协调，肝裂不宽,肝右后叶见一类圆形低密度影，增强后动脉期周边结节样强化，静脉期可见造影剂向内填充，大小约6.3*4.5cm，肝脏近膈顶可见一小圆形低密度影，未见明显强化，约8mm，余肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。两肾及肾上腺无殊。腹膜后未见肿大淋巴结。腹腔未见明显积液。', N'肝右叶血管瘤考虑。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胆囊炎，胆石症。上腹盆腔女', N'胆囊境界欠清，胆囊壁增厚，毛糙，增强后强化明显，胆囊内可见环形高密度结石。肝内外胆管不扩张，未见明显阳性结石。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部增强 阴性', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶。胰腺大小、形态未见异常。脾不大，质均匀。双肾形态、密度未见异常。腹膜后未见肿大淋巴结。', N'上腹部CT增强未见明显异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'阴性。', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。', N'上腹部CT扫描未见异常。', 100, 0, N'CT', N'上腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'心肺膈未见明显异常 阴性', N'胸廓两侧对称，气管居中，两肺未见明显活动性病灶。心膈无殊。肋骨未见异常骨质改变。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 45, N'两肾未见明显异常 阴性', N'两肾大小、形态、位置如常，实质密度未见明显异常，未见异常对比强化。所见肝、胰、脾大小形态及密度未见明显异常。后腹膜未见明显肿大淋巴结。', N'两肾未见明显异常。  Kidneys CT is normal', 100, 0, N'CT', N'下腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 45, N'两肾囊肿', N'右肾上极及左肾下极分别见大小约5&#215;4.5CM 、 3.6&#215;3CM圆形水样密度影，边缘光滑，境界清晰，增强后未见造影剂充填，边界更清。肝胰大小形态未见明显异常。脾脏质均匀，形态饱满，达七个肋间隙。后腹膜未见明显肿大淋巴结。', N'两肾囊肿。  Cysts  in  kidneys', 100, 0, N'CT', N'下腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肝硬化，脾肿大，静脉曲张 阳性', N'肝脏体积缩小，肝脏表面不规则，呈结节状改变，肝叶比例失调，肝裂增宽，肝实质质地欠均匀。肝内外胆管无扩张。胆囊增大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾增大，增强后质地欠均。两肾及两肾上腺无殊，腹膜后未见肿大淋巴结。腹腔未见明显积液。食道胃底脾门周围见迂曲侧支血管。', N'1、肝硬化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胃癌', N'上腹部CT平扫及增强扫描，肝实质密度均匀、未见胆管扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。为充盈，胃窦近幽门区见胃壁增厚，增强后明显强化，周围及后腹膜主动脉旁未见淋巴结肿大。附见两肺下部小片状影。腹部肠管无殊。腹腔未见明显积液。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'肺上腹纤维灶肝囊肿 阳性', N'右中下肺及左上肺舌段条索影，余两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿块影。两侧胸腔未见明显积液。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'胆囊颈结石 阳性', N'肝脏轮廓光整，肝叶比例协调，肝实质内未见明显异常密度灶，增强后未见明显异常强化灶，肝内外胆管不扩张，未见明显阳性结石。胆囊稍增大，胆囊壁未见增厚，胆囊颈部可见25mm&#215;26mm环形高密度结石影。胰腺、脾脏密度均匀，增强扫描胰腺、脾脏均匀强化。未见明显脾肿大改变。后腹膜结构清晰，未见明确淋巴结肿大。另见两下肺条索影与胸膜粘连。', N'1、胆囊颈部结石；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部+盆腔（女性）', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 44, N'上腹部+盆腔（男性）', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 45, N'下腹部盆腔CT扫描未见异常 阴性', N'下腹部肠管分布及形态未见明显异常改变，肠管未见明显狭窄，肠壁未见明显增厚，肠系膜脂肪间隙清晰，未见明显肿块影，后腹膜未见明显肿大淋巴结影。盆腔内各结构如常。膀胱充盈，壁均匀，周围脂肪间隙清。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 45, N'中下腹扫描未见异常 阴性', N'平扫显示所见肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺、双肾大小形态未见异常。脾不大，质均匀。盆腔内未见异常软组织肿块，腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾、双肾未见异常强化灶。', N'中下腹扫描未见异常 No abnormality is found', 100, 0, N'CT', N'下腹部平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 45, N'下腹部盆腔CT扫描未见异常 阴性', N'下腹部肠管分布及形态未见明显异常改变，肠管未见明显狭窄，肠壁未见明显增厚，肠系膜脂肪间隙清晰，未见明显肿块影，后腹膜未见明显肿大淋巴结影。盆腔内各结构如常。膀胱充盈，壁均匀，周围脂肪间隙清。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 46, N'附件占位', N'盆腔各结构清晰，膀胱充盈良好，子宫形态大小正常，左侧附件区见囊实性包块，大小约4cm，增强后强化不均匀，直肠子宫间隙未见明显积液。周围软组织内未见异常病变。', N'左侧附件占位。', 100, 0, N'CT', N'盆腔平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 46, N'女性全腹阴性。', N'肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。增强后肝、胆、胰、脾未见异常强化灶。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 46, N'男性全腹阴性。', N'肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。增强后肝、胆、胰、脾未见异常强化灶。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 46, N'盆腔平扫 正常 阴性', N'盆腔各结构清晰，膀胱充盈良好，子宫形态大小正常，直肠子宫间隙未见明显积液。周围软组织内未见异常病变。', N'盆腔平扫未见明显异常。No abnormality is found.', 100, 0, N'CT', N'盆腔平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 46, N'附件占位', N'盆腔各结构清晰，膀胱充盈良好，子宫形态大小正常，左侧附件区见囊实性包块，大小约4cm，增强后强化不均匀，直肠子宫间隙未见明显积液。周围软组织内未见异常病变。', N'左侧附件占位。', 100, 0, N'CT', N'盆腔平扫＋增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 47, N'虚拟结肠CT成像', N'常规准备后注入结肠内适量气体，全腹部CT平扫并重建后显示：结肠各段未见明显腔内充盈缺损，结肠未见明显狭窄和扩张征象,肠壁未见明显增厚征象。', N'虚拟结肠CT成像未见明显异常。', 100, 0, N'CT', N'结肠仿真内窥镜', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 47, N'虚拟结肠CT', N'常规准备后注入结肠内适量气体，全腹部CT平扫并重建后显示：降结肠近脾曲见一约1cm的局限性向腔内隆起，呈半圆形，余结肠各段未见明显异常，结肠未见明显狭窄和扩张征象。', N'虚拟结肠CT成像提示降结肠息肉可能。A polyp of the colon is possible.', 100, 0, N'CT', N'结肠仿真内窥镜', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'下腹部正常 阴性', N'下腹部肠管分布及形态未见明显异常改变，肠管未见明显狭窄，肠壁未见明显增厚，肠系膜脂肪间隙清晰，未见明显肿块影，后腹膜未见明显肿大淋巴结影。', N'下腹部CT扫描未见异常。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'左肩关节 正常 阴性', N'左肩关节各骨大小形态如常，骨质密度均匀，关节间隙不窄，关节面光滑。软组织未见确切异常改变。', N'左肩关节骨质未见异常。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'输尿管结石 阳性', N'双肾形态大小无殊，肾实质未见明显异常密度影。肾盂肾盏及双侧输尿管未见明显扩张积水，右输尿管膀胱壁内段见点状阳性结石。膀胱充盈可，壁不厚。余下腹盆腔结构未见明显异常。', N'右输尿管膀胱壁内段小结石。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'外伤阴性 阴性', N'左肩关节各组成骨骨皮质连续，未见明显错位性骨折征象。未见明显关节脱位，周围软组织未见明显异常。', N'左肩关节未见明显错位性骨折或脱位。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'右输尿管结石 阳性', N'双肾大小位置正常，密度均匀，未见明显异常密度灶,右侧肾盂轻度扩张积水，右输尿管上段约平L3/4椎间隙水平可见斑片状致密影，左侧输尿管未见明显扩张积水及阳性结石。余所见肝胆胰脾未见异常。膀胱充盈欠佳，内未见明显阳性结石。', N'右肾盂积水，右输尿管结石合并上段输尿管扩张。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'右输尿管结石 阳性', N'双肾大小位置正常，密度均匀，未见明显异常密度灶,右侧肾盂轻度扩张积水，右输尿管上段约平L3/4椎间隙水平可见斑片状致密影，左侧输尿管未见明显扩张积水及阳性结石。余所见肝胆胰脾未见异常。膀胱充盈欠佳，内未见明显阳性结石。', N'右肾盂积水，右输尿管结石合并上段输尿管扩张。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'正常 阴性', N'盆腔内肠管分布及形态未见明显异常改变。双侧髂内血管走行正常，无增粗及移位。膀胱充盈，壁均匀，周围脂肪间隙清。双侧精囊腺形态可，膀胱精囊角清。前列腺大小在正常范围，盆腔内见多个小静脉石影。增强扫描未见明显异常强化灶。双侧骶髂关节间隙稍窄，关节面骨质硬化。', N'中下腹扫描未见异常；     双侧骶髂关节骨质退行性改变。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 48, N'右输尿管结石 阳性', N'双肾大小位置正常，密度均匀，未见明显异常密度灶,右侧肾盂轻度扩张积水，右输尿管上段约平L3/4椎间隙水平可见斑片状致密影，左侧输尿管未见明显扩张积水及阳性结石。余所见肝胆胰脾未见异常。膀胱充盈欠佳，内未见明显阳性结石。', N'右肾盂积水，右输尿管结石合并上段输尿管扩张。', 100, 0, N'CT', N'下腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'上腹部CT未见明显异常。 阴性', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'上腹部CT未见明显异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'normal 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀、形态未见异常改变，肝内外胆管未见扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。', N'上腹部CT平扫及增强扫描未见明确异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'胃小弯占位 阳性', N'胃小弯侧局部胃壁增厚，长约2.4cm，厚约1.3cm，肝实质内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常，胰管未见扩张。脾不大，质均匀。腹部肠管走行分布正常，肠管未见狭窄及扩张，肠壁未见明显增厚及水肿。膀胱充盈可，内未见明显异常密度影，壁不厚。子宫大小、形态及密度未见明显异常。直肠未见异常，子宫直肠间隙未见异常，腹膜后及盆腔内未见肿大淋巴结。', N'胃小弯侧占位，较前片（2010-04-13）比较略有增大。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'泌尿系阴性。', N'两肾形态大小如常，未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，余所见结构无殊。', N'上腹部、盆腔平扫未见明显异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'阴性 阴性', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀；脾脏下方见小结节样副脾影。双肾形态及密度未见明显异常，肾盂肾盏未见扩张积水或阳性结石。腹膜后未见肿大淋巴结。', N'上腹部CT平扫未见明显异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
