INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'上腹部CT未见明显异常。 阴性', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'上腹部CT未见明显异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'正常 阴性', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'上腹部CT平扫未见明显异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'胃小弯占位 阳性', N'胃小弯侧局部胃壁增厚，长约2.4cm，厚约1.3cm，肝实质内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常，胰管未见扩张。脾不大，质均匀。腹部肠管走行分布正常，肠管未见狭窄及扩张，肠壁未见明显增厚及水肿。膀胱充盈可，内未见明显异常密度影，壁不厚。子宫大小、形态及密度未见明显异常。直肠未见异常，子宫直肠间隙未见异常，腹膜后及盆腔内未见肿大淋巴结。', N'胃小弯侧占位，较前片（2010-04-13）比较略有增大。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'胰腺炎，胆囊结石，胆囊炎，左肾上极囊肿', N'平扫显示胰腺体积明显增大，胰实质密度稍不均匀，胰周脂肪间隙模糊，左肾前筋膜增厚。胆囊不大，壁增厚，内见小结节状高密度影，肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。脾不大，质均匀。腹膜后未见肿大淋巴结。左肾上极见一囊状水样密度影，边界清。', N'胰腺炎，胆囊结石，胆囊炎，左肾上极囊肿，必要时增强检查。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 49, N'normal 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀、形态未见异常改变，肝内外胆管未见扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。', N'上腹部CT平扫及增强扫描未见明确异常。', 100, 0, N'CT', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'肩锁关节退变 阳性', N'右肩关节诸骨皮质连续，诸骨未见骨质破坏改变，肩锁关节边缘骨质增生变尖，关节在位，关节间隙如常。', N'右肩锁关节退变。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'急诊阴性 阴性', N'右肩关节诸骨皮质连续，未见明显错位性骨折征象，关节间隙如常。', N'右肩关节未见明显错位性骨折或脱位。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'正常 阴性', N'右肩关节诸骨皮质连续，骨质未见明显骨折征象，关节间隙如常，周围软组织未见明显异常密度影。', N'右肩关节未见明显骨折及脱位征象。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'小肠不全梗阻 阴性', N'左下腹部分小肠肠管扩张，若干积气液平，脐水平腹壁下方见肠管转折走行，远段萎陷，局部肠壁稍见强化，未见明显软组织状增厚，周围肠系膜结构清晰，未见明显肿块。脐下方正中腹壁肌层薄弱，略小弧形膨隆，局部少量肠管轻度疝出，体表尚平整。未见腹水积液，后腹膜未见明显肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'下腹部CT增强扫描未见明显异常。 阴性', N'肝右叶密度减低，两肾、胰腺、脾实质密度均匀、未见异常。后腹膜未见肿大淋巴结。扫描所见下腹部肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，增强后未见明显异常强化影。盆腔结构未见异常。后腹膜未见明显肿大淋巴结。', N'下腹部CT增强扫描未见明显异常。附见：脂肪肝。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'下腹部CT增强扫描未见明显异常。 阴性', N'肝右叶密度减低，两肾、胰腺、脾实质密度均匀、未见异常。后腹膜未见肿大淋巴结。扫描所见下腹部肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，增强后未见明显异常强化影。盆腔结构未见异常。后腹膜未见明显肿大淋巴结。', N'下腹部CT增强扫描未见明显异常。附见：脂肪肝。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'下腹部CT增强扫描未见明显异常。 阴性', N'肝右叶密度减低，两肾、胰腺、脾实质密度均匀、未见异常。后腹膜未见肿大淋巴结。扫描所见下腹部肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，增强后未见明显异常强化影。盆腔结构未见异常。后腹膜未见明显肿大淋巴结。', N'下腹部CT增强扫描未见明显异常。附见：脂肪肝。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'下腹部肠管 阴性', N'扫描所见下腹部肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，增强后未见明显异常强化影。后腹膜未见明显肿大淋巴结。', N'下腹部扫描未见明显异常。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'小肠不全梗阻 阴性', N'左下腹部分小肠肠管扩张，若干积气液平，脐水平腹壁下方见肠管转折走行，远段萎陷，局部肠壁稍见强化，未见明显软组织状增厚，周围肠系膜结构清晰，未见明显肿块。脐下方正中腹壁肌层薄弱，略小弧形膨隆，局部少量肠管轻度疝出，体表尚平整。未见腹水积液，后腹膜未见明显肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'右肾结石', N'所见肝实质内未见明显异常强化灶，肝叶比例正常，肝内胆管未见扩张。肝门部结构清晰，胆囊不大，壁不厚。所见脾脏未见异常强化。胰腺形态及密度未见异常。双侧肾上腺形态可，右肾盂内见点状高密度影，双肾内未见明显异常强化灶。腹膜后未见增大淋巴结影。', N'右肾结石首先考虑，建议必要时进一步检查。Stone.', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 50, N'下腹部CT正常', N'两肾、胰腺、部分肝、脾实质密度均匀、未见异常。后腹膜未见肿大淋巴结。肠管连续、未见异常。盆腔结构未见异常，子宫大小无殊、外形光滑、附见未见异常。', N'中下腹壁CT扫描未见异常。', 100, 0, N'CT', N'下腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'女性全腹正常。', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'正常（男性）', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽。肝内外胆管无扩张。胆囊不大，壁不厚，未见高密度灶。胰腺大小形态密度未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'正常（女性）', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽。肝内外胆管无扩张。胆囊不大，壁不厚，未见高密度灶。胰腺大小形态密度未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'腹部英文', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'CT', N'肝右叶后下段占位，血管瘤考虑，肝癌不能排除，建议MR检查。', N'平扫显示肝脏不大，肝右叶下段可见一类圆形低密度影，大小约26&#215;21mm，边界尚可，增强后内部可见强化，壁呈环形。肝脏表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'上腹部阴性 阴性', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。', N'上腹部CT平扫及增强扫描腹部未见明确异常。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'肝硬化 阳性', N'平扫显示肝脏体积缩小，比例失调，左右肝叶内见线条状高密度影，其余肝脏密度稍增高。胆囊不大，壁增厚，腔内见一类圆形直径为8mm的高密度影。脾脏缺如，腹腔内可见多条明显增粗的血管影，肠系膜上静脉前方于原脾静脉区见一高密度灶，CT值为1390HU。见一直径为12mm的类圆形结节，密度稍低，增强扫描有轻度延迟强化。下腔静脉肝内段明显变窄，门静脉迂曲变细。所示胃窦部壁增厚。腹膜后未见明显肿大淋巴结。', N'1.肝脏改变，伴多条侧支循环形成，考虑血吸虫性肝硬化，请结合临床病史。2.脾脏缺如，请结合病史。3.胰腺头颈交界处前部结节，建议MRI检查。4.下腔静脉肝内段狭窄。5.肠系膜上静脉前方高密度影，金属夹？钙化灶？请结合临床。6.慢性胆囊炎，胆囊结石。7.胃窦壁稍增厚，建议胃镜检查。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'正常 阴性', N'肝表面光滑，肝叶比例协调，肝裂不宽,肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'上腹部增强CT未见明显异常。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'上腹部阴性 阴性', N'上腹部CT平扫及增强扫描，肝实质密度均匀、未见胆管扩张。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。附见两肺下部小片状影。', N'上腹部CT平扫及增强扫描腹部未见明确异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'正常（男性）', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽。肝内外胆管无扩张。胆囊不大，壁不厚，未见高密度灶。胰腺大小形态密度未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'肝硬化 阳性', N'肝脏体积缩小，肝脏表面不规则，呈结节状改变，肝叶比例失调，肝裂增宽，肝实质质地欠均匀，可见结节状影；肝内散在多发小结节样低密度影，增强后未见明显强化；右肝下极见一结节状钙化灶。肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾增大，增强后质地欠均。腹膜后未见肿大淋巴结。胃窦区后壁胃壁稍增厚。', N'1、肝硬化，肝脏多发小结节影，建议随访。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'肝脏多发血管瘤伴多发小囊肿。 阳性', N'平扫肝内见多个类圆形低密度灶，增强扫描部分病灶无明显强化，部分病灶动脉期呈结节状强化，静脉期进一步填充，肝内胆管未见明显扩张。胆囊不大，壁均匀，内未见确切异常密度影。胰腺大小形态未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'肝脏多发血管瘤伴多发小囊肿。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'上腹部增强正常 阴性', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。增强后肝胆脾胰未见明显异常强化灶。腹膜后未见肿大淋巴结。', N'上腹部增强CT未见明显异常。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'正常（女性）', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽。肝内外胆管无扩张。胆囊不大，壁不厚，未见高密度灶。胰腺大小形态密度未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'急性胰腺炎 阳性', N'肝脏表面光滑，肝叶比例协调，肝裂不宽,肝实质密度偏低，肝内外胆管无扩张。胆囊区密度增高，并见分层现象，胆总管下端密度欠均匀，胰腺形态饱满，胰周围间隙密度增高混浊，见液性密度影积聚，并延及右侧结肠旁沟，双侧肾前筋膜增厚，增强后胰腺实质强化尚均匀，脾不大，质均匀。腹膜后未见肿大淋巴结，盆腔结构未见明显异常。', N'1：急性胰腺炎（水肿型）考虑，腹腔内渗出液。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'胰腺 阴性', N'1、胰腺头部较丰满略呈分叶状，胰腺灌注成像显示胰腺密度一致，考虑胰腺慢性炎症可能大。建议定期（二个月）复查，以除外早期病变。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'胆囊炎、胆石症。 阳性', N'胆囊境界欠清，胆囊壁增厚，毛糙，增强后强化明显，胆囊内可见两枚圆形高密度结石。肝内外胆管不扩张，未见明显阳性结石。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'HCC 阳性', N'肝脏体积缩小，肝脏表面不规则，呈结节状改变，肝叶比例失调，肝裂增宽，右肝后叶可见一84&#215;87mm左右不规则分叶状软组织肿块影，增强后强化明显，呈快进快出表现，病灶中心并可见坏死；其余肝内并可见多发小结节样病灶，增强后动脉期明显强化；门脉主干及门脉右支内见充盈缺损；肝内外胆管无扩张。胆囊不大，壁稍厚，内未见高密度灶，胆囊窝见少量液性密度影。胰腺大小形态未见异常。脾增大，质地均匀。食道下端胃底见多发杂乱迂曲血管影。肝下极见少量液性密度影；腹膜后未见肿大淋巴结。', N'1、肝脏多发病灶，原发性肝癌伴肝内多发转移考虑，门脉癌栓形成。HCC with metastasis in liver and portal vain
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'胆囊结石，胆囊炎 阳性', N'肝表面光滑，肝叶比例协调，肝裂不宽,肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁略厚，内见多个点状高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'胆囊结石，胆囊炎考虑。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'全腹女性正常 阴性', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'上下腹CT增强（肠梗阻） 阳性', N'平扫显示肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。增强后肝、胆、胰、脾未见异常强化灶。中腹部见数个长短不等的气液平，肠管扩张，肠道内积气，左中下腹可见团块状影，肠壁增厚，上下范围约12个层面可见，内密度不均，可见同心园样改变及血管影，其上肠腔扩张积液明显，最扩张处肠管直径达5cm，周围肠系膜结构清晰，增强后未见明显异常强化影。腹膜后未见肿大淋巴结。', N'1、不全性肠梗阻考虑，左中下腹团块状影，上下范围约12个层面可见，内密度不均，可见同心园样改变及血管影，肠套叠考虑，不排除肿瘤性病变存在，请结合临床。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'上腹部和盆腔增强扫描未见明显异常 阴性', N'肝内未见异常密度影，肝表面光滑，肝叶比例如常, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常，胰管未显示。脾脏大小正常范围，实质密度均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'肝血管瘤 阳性', N'肝脏表面光滑，肝叶比例协调，肝裂不宽,平扫肝右后叶见大小约21mm*41mm低密度灶，边界尚清，增强扫描动脉期病灶周边呈结节状强化，静脉期向中心填充，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见明显肿大淋巴结。', N'肝右后叶血管瘤考虑。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 51, N'TACE术后 阳性', N'TACE术后平扫显示肝脏体积缩小，比例失调，表面凹凸不平，左右肝叶内见散在分布的碘油沉积影，动脉期扫描右肝后叶表面可见一结节有较明显强化，静脉期有退出。部分平扫时呈低密度小结节，增强后无强化。右肝后叶一形态不规则囊性灶增强无强化。门静脉主干及左右分支内可见充盈缺损，胆囊较大，壁略厚，腔内见稍高密度影沉积，脾脏肿大，腹腔内可见多条明显增粗的血管影，腹腔内见大量积液。腹膜后未见明显肿大淋巴结。', N'1.肝癌TACE术后改变，右肝后叶肝表面一病灶仍有活性。大部分病变碘油沉积效果较好。2.肝硬化、脾脏肿大，门静脉癌栓形成。3.大量腹水。', 100, 0, N'CT', N'上腹部增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 52, N'正常 阴性', N'双肾大小位置正常，密度均匀，增强后皮髓质强化正常，未见明显 异常密度灶。后腹膜未见明显肿大淋巴结影。余所见肝胆胰脾未见异常。', N'双肾CT未见明显异常', 100, 0, N'CT', N'双肾增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'直肠癌术后', N'直肠癌术后，手术区结构欠清，前缘与子宫分界不清，盆腔内肠管分布及形态未见明显异常改变。双侧髂内血管走行正常，无增粗及移位。膀胱充盈可，壁均匀，周围脂肪间隙清。子宫大小形态可，密度均匀。后腹膜未见明显肿大淋巴结影。盆腔未见明显积液。', N'直肠癌术后改变。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'前列腺增生钙化', N'盆腔增强示前列腺增大，上缘超出耻骨联合，内见不均匀钙化，增强后不均匀强化，周围脂肪间隙清晰，上缘向膀胱内突出，膀胱充盈欠佳，内未见明显异常密度，直肠未见明显异常。精囊三角未见扩大。盆腔内未见明显增大淋巴结影。盆腔未见明显积液。', N'前列腺增生伴钙化，请结合临床，建议必要时MRI检查排除占位可能。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'平扫结石积水男', N'左肾盂可见多个斑点状致密影，左肾盂扩张，左侧输尿管上段可见斑块状致密影，其上端扩张，右肾、右输尿管无殊。所见肝、胆、胰、脾形态密度无异常。腹膜后未见肿大淋巴结。膀胱充盈，壁均匀，周围脂肪间隙清，前列腺形态密度正常。盆腔内未见积液。', N'左肾结石，右输尿管上段结石伴左输尿管上段、左肾积水。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'泌尿系阴性', N'两肾形态大小如常，肾实质未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，余无殊。', N'上腹部及盆腔扫描未见明显异常。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'肾输尿管结石积水 阳性', N'右肾可见多个点状致密影，左肾见点状致密影，右输尿管中上段见条状致密影。右侧肾盏肾盂扩张，右侧输尿管上段扩张，所见肝胆胰脾无殊。腹膜后未见肿大淋巴结。膀胱充盈，壁均匀，周围脂肪间隙清，前列腺形态密度正常。盆腔内未见积液。', N'两肾结石，右输尿管中上段结石伴右输尿管上段、右肾积水。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'平扫结石积水男', N'左肾盂可见多个斑点状致密影，左肾盂扩张，左侧输尿管上段可见斑块状致密影，其上端扩张，右肾、右输尿管无殊。所见肝、胆、胰、脾形态密度无异常。腹膜后未见肿大淋巴结。膀胱充盈，壁均匀，周围脂肪间隙清，前列腺形态密度正常。盆腔内未见积液。', N'左肾结石，右输尿管上段结石伴左输尿管上段、左肾积水。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'全腹男性正常 阴性', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'男性，盆腔增强阴性', N'扫描所见肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，膀胱充盈，壁均匀，腔内未见阳性结石影。前列腺大小形态可，增强后未见明显异常强化影。盆腔内未见明显肿大淋巴结。', N'盆腔扫描未见明显异常。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'直肠癌术后', N'直肠癌术后，手术区结构欠清，前缘与子宫分界不清，盆腔内肠管分布及形态未见明显异常改变。双侧髂内血管走行正常，无增粗及移位。膀胱充盈可，壁均匀，周围脂肪间隙清。子宫大小形态可，密度均匀。后腹膜未见明显肿大淋巴结影。盆腔未见明显积液。', N'直肠癌术后改变。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'前列腺增生钙化', N'盆腔增强示前列腺增大，上缘超出耻骨联合，内见不均匀钙化，增强后不均匀强化，周围脂肪间隙清晰，上缘向膀胱内突出，膀胱充盈欠佳，内未见明显异常密度，直肠未见明显异常。精囊三角未见扩大。盆腔内未见明显增大淋巴结影。盆腔未见明显积液。', N'前列腺增生伴钙化，请结合临床，建议必要时MRI检查排除占位可能。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'女性  直肠癌 阳性', N'盆腔内肠管分布及形态未见明显异常改变。双侧髂内血管走行正常，无增粗及移位。膀胱充盈欠佳，壁均匀，周围脂肪间隙清。直肠壁不规则增厚，周围脂肪间隙欠清晰，前方与子宫间局部分界不清，子宫大小形态可，密度均匀，左侧附件区可见一直径2cm大小圆形低密度影，边界清楚，其内密度较低。后腹膜未见明显肿大淋巴结影。', N'1.壁局部增厚，建议进一步检查
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'盆腔增强阴性，男性', N'扫描所见肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，膀胱充盈，壁均匀，周围脂肪间隙清。前列腺大小形态可，增强后未见明显异常强化影。后腹膜未见明显肿大淋巴结。', N'下腹部扫描未见明显异常。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'女性，盆腔增强', N'扫描所见肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，膀胱充盈，壁均匀，腔内未见阳性结石影。子宫大小形态可，增强后未见明显异常强化影，两侧附件无殊。盆腔内未见明显肿大淋巴结。', N'盆腔扫描未见明显异常。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'髂静脉 阳性', N'经左下肢浅表静脉留置针注入稀释造影剂，右股静脉、髂外静脉、髂总静脉显影，腹主动脉迂曲，右髂总动脉压迫左侧髂静脉，压迫处左侧髂静脉前后径约4mm，左髂总动脉压迫左侧髂静脉，压迫处左侧髂静脉前后径约3mm，远心处髂静脉前后径约为10mm，左侧髂内静脉迂曲，侧支循环形成，经骶前汇入右髂静脉。', N'左右髂总动脉压迫左侧髂静脉致盆腔静脉曲张，侧枝循环形成。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'女性，盆腔增强 阴性', N'扫描所见肠管走行分布无殊，肠壁未见明显增厚水肿等异常，周围肠系膜结构清晰，膀胱充盈，壁均匀，腔内未见阳性结石影。子宫大小形态可，增强后未见明显异常强化影，两侧附件无殊。盆腔内未见明显肿大淋巴结。', N'盆腔扫描未见明显异常。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'全腹男性正常 阴性', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 53, N'前列腺增生 阳性', N'盆腔增强示前列腺增大，上缘超出耻骨联合3cm，内未见明显钙化，平扫密度均匀，增强后呈明显不均匀强化，周围脂肪间隙清晰，上缘稍向膀胱内突出，膀胱内未见明显异常密度，直肠未见明显异常。精囊三角未见扩大。盆腔内未见明显增大淋巴结影。', N'前列腺增生首先考虑，建议MRI检查排除占位可能。', 100, 0, N'CT', N'盆腔增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常', N'各小肠段排列正常，未见明显狭窄及扩张，肠壁未见明显增厚，增强后未见明显异常强化灶。', N'小肠仿真内镜未见明显异常。', 100, 0, N'CT', N'小肠仿真内镜', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'小肠仿真内镜正常 阴性', N'各小肠段排列正常，未见明显狭窄及扩张，肠壁未见明显增厚，系膜结构清晰，增强后未见明显异常强化灶，系膜内未见明显肿大淋巴结。', N'1.小肠未见明显异常征象。', 100, 0, N'CT', N'小肠仿真内镜', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常 阴性', N'各小肠段排列正常，未见明显狭窄及扩张，肠壁未见明显增厚，增强后未见明显异常强化灶。系膜淋巴结及肠系膜上下动脉及静脉未见明显异常狭窄及阻塞。  
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常1 阴性', N'肝Ⅴ段及Ⅷ段可见小囊状影，增强后未见明显强化。胆囊不大，内未见明显异常密度。脾脏及胰腺未见异常强化。各小肠段排列正常，未见明显狭窄及扩张，右上腹部小肠聚集，但肠壁未见明显增厚，增强后未见明显异常强化灶。肠系膜血管未见异常影。后腹膜未见淋巴结肿大。双肾未见明显异常。', N'1.小肠仿真内镜未见明显异常征象。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常1 阴性', N'肝Ⅴ段及Ⅷ段可见小囊状影，增强后未见明显强化。胆囊不大，内未见明显异常密度。脾脏及胰腺未见异常强化。各小肠段排列正常，未见明显狭窄及扩张，右上腹部小肠聚集，但肠壁未见明显增厚，增强后未见明显异常强化灶。肠系膜血管未见异常影。后腹膜未见淋巴结肿大。双肾未见明显异常。', N'1.小肠仿真内镜未见明显异常征象。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常 阴性', N'各小肠段排列正常，未见明显狭窄及扩张，右上腹部小肠管粘膜似乎稍粗，但肠壁未见明显增厚，增强后未见明显异常强化灶。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'小肠仿真内镜正常 阴性', N'各小肠段排列正常，未见明显狭窄及扩张，肠壁未见明显增厚，系膜结构清晰，增强后未见明显异常强化灶，系膜内未见明显肿大淋巴结。', N'1.小肠未见明显异常征象。', 100, 0, N'CT', N'小肠仿真内镜', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常', N'各小肠段排列正常，未见明显狭窄及扩张，肠壁未见明显增厚，增强后未见明显异常强化灶。', N'小肠仿真内镜未见明显异常。', 100, 0, N'CT', N'小肠仿真内镜', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'男性小肠内镜 阴性', N'各小肠段排列正常，肠壁未见明显增厚，未见明显狭窄及扩张，增强后未见明显异常强化灶。腹膜后未见明显肿大淋巴结影。膀胱充盈，壁均匀，腔内未见阳性结石影。前列腺大小形态可，增强后未见明显异常强化影。盆腔内未见明显肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 54, N'正常 阴性', N'各小肠段排列正常，未见明显狭窄及扩张，肠壁未见明显增厚，增强后未见明显异常强化灶。系膜淋巴结及肠系膜上下动脉及静脉未见明显异常狭窄及阻塞。  
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'CTU未见明显异常 阴性', N'两肾形态大小如常，肾实质未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'正常 阴性', N'两肾形态大小如常，未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，注射对比剂并延迟后两侧肾盂、肾盏显影，输尿管内对比剂充盈，未见充盈缺损，膀胱内未见充盈缺损。', N'CTU未见明显异常。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'肾输尿管结石积水 阳性', N'右肾可见多个点状致密影，左肾见点状致密影，右输尿管中上段见条状致密影。右侧肾盏肾盂扩张，右侧输尿管上段扩张，所见肝胆胰脾无殊。腹膜后未见肿大淋巴结。膀胱充盈，壁均匀，周围脂肪间隙清，前列腺形态密度正常。盆腔内未见积液。', N'两肾结石，右输尿管中上段结石伴右输尿管上段、右肾积水。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'下腹盆腔平扫结石积水 阳性', N'两肾盏可见多个点状致密影，左侧为著，右侧肾盏肾盂扩张，右侧输尿管全程扩张，右输尿管膀胱入口处见点状致密影。所见肝实质内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常，胰管未见扩张。脾不大，质均匀。腹膜后未见肿大淋巴结。膀胱充盈，壁均匀，周围脂肪间隙清，前列腺形态密度正常。盆腔内未见积液。', N'两肾结石，右输尿管膀胱入口处结石伴右输尿管右肾积水。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'左肾积水 阳性', N'左肾外形增大，左侧肾盏肾盂扩张，左肾下组肾盏内可见斑块状高密度影，左侧输尿管全程扩张，行程内未见明显异常高密度影，右肾大小形态密度正常。增强后显示左肾盏肾盂、左输尿管扩张，左肾实质变薄，未见异常强化灶，右肾强化正常，延迟10分钟后显示右侧肾盏肾盂及右输尿管内造影剂充盈，左侧部分肾盏内可见造影剂泌出，左输尿管内造影剂填充不明显，膀胱充盈良好，膀胱壁薄均匀。CTU显示左侧肾盏肾盂扩张，左输尿管显示不清，右侧集合系统可见显影。附见肝胆胰脾未见异常密度灶。子宫内见节育环影。', N'1.左侧肾结石并左侧肾积水。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'CTU 正常英文', N'两肾形态大小如常，未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，注射对比剂并延迟后两侧肾盂、肾盏显影，输尿管内对比剂充盈，未见充盈缺损，膀胱内未见充盈缺损。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'CTU未见明显异常 阴性', N'两肾形态大小如常，肾实质未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'下腹盆腔平扫结石积水 阳性', N'两肾盏可见多个点状致密影，左侧为著，右侧肾盏肾盂扩张，右侧输尿管全程扩张，右输尿管膀胱入口处见点状致密影。所见肝实质内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常，胰管未见扩张。脾不大，质均匀。腹膜后未见肿大淋巴结。膀胱充盈，壁均匀，周围脂肪间隙清，前列腺形态密度正常。盆腔内未见积液。', N'两肾结石，右输尿管膀胱入口处结石伴右输尿管右肾积水。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'正常 阴性', N'两肾形态大小如常，未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，注射对比剂并延迟后两侧肾盂、肾盏显影，输尿管内对比剂充盈，未见充盈缺损，膀胱内未见充盈缺损。', N'CTU未见明显异常。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 55, N'正常 阴性', N'两肾形态大小如常，未见明显异常密度灶，两侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，注射对比剂并延迟后两侧肾盂、肾盏显影，输尿管内对比剂充盈，未见充盈缺损，膀胱内未见充盈缺损。前列腺轻度增生。', N'CTU未见明显异常，前列腺轻度增生。', 100, 0, N'CT', N'CTU', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 56, N'肾上腺 阴性', N'双侧肾上腺未见明显增粗，增强无明显强化。内、外枝外形正常，未见明显异常密度影。两侧肾动脉走行自然，管腔无狭窄。', N'1、双侧肾上腺未见明显异常；
