INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 57, N'左髂血管受压 阳性', N'经左侧下肢静脉注入适量稀释造影剂200ml并扫描重建。左侧髂静脉从腹主动脉和右侧髂总动脉后方行走受压，致左侧髂总静脉受压变窄，骶前可见大量侧枝显示，经对侧髂静脉回流。', N'腹主动脉和右侧髂总动脉压迫左侧髂静脉，致相应左总髂静脉回流受阻，侧枝循环形成。', 100, 0, N'CT', N'盆腔左侧髂静脉直接CTV', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 57, N'髂静脉受压 阳性', N'经左侧下肢静脉注入适量稀释造影剂200ml并扫描重建。左侧髂静脉从腹主动脉和右侧髂总动脉后方行走受压，致左侧髂静脉受压变窄；可见侧枝显示。', N'腹主动脉和右侧髂总动脉压迫左侧髂静脉，致相应左侧髂静脉受压变窄。', 100, 0, N'CT', N'盆腔左侧髂静脉直接CTV', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 57, N'髂静脉', N'经左侧下肢静脉注入适量稀释造影剂200ml并扫描重建。左侧髂静脉从右侧髂总动脉和左侧髂总动脉后方走行，邻近动静脉关系较密切，在左侧髂内动脉处似见轻度受压，管腔相对较小，无明显狭窄。', N'左侧髂静脉无明显狭窄。', 100, 0, N'CT', N'盆腔左侧髂静脉直接CTV', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 58, N'女性正常盆腔 阴性', N'膀胱充盈良好，壁均匀，内部未见明显充盈缺损。子宫大小形态未见明显异常。盆腔内未见明显积液影。', N'盆腔扫描未见明显异常。', 100, 0, N'CT', N'盆腔平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
