INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 60, N'左输尿管上段结石 阳性', N'两肾形态大小如常，未见明显异常密度灶，左输尿管上段结节状高密度影，约4*3mm，以上输尿管及肾盂轻度扩张积液，右侧肾盂、输尿管未见明显扩张积水，膀胱充盈良好，未见明显阳性结石影，前列腺钙化灶。', N'左输尿管上段结石，伴左侧输尿管及肾盂轻度扩张积液，前列腺钙化灶。', 100, 0, N'CT', N'双肾平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 61, N'阴性 阴性', N'主动脉全程走行自然，管壁光滑，未见明显钙化或软斑块形成。管腔内造影剂填充均匀，未见夹层或动脉瘤样扩张改变。', N'主动脉全程未见明显异常。', 100, 0, N'CT', N'主动脉全程增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
