INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 65, N'骨折后 阳性', N'右尺骨茎突皮质不连续，可见骨折透亮线，断端对位对线可，石膏固定中，余双腕诸组成骨未见明显错位骨折，诸关节在位，关节间隙无殊。', N'右尺骨茎突骨折后。', 100, 0, N'CT', N'双腕关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 66, N'阴性。', N'左侧前臂桡动脉与头静脉吻合,流入动脉及吻合口通畅，流出静脉近吻合口处未见明显狭窄。', N'如上所述，请结合临床。', 100, 0, N'CT', N'左手增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 66, N'左手 阴性', N'左侧前臂桡动脉与头静脉吻合,流入动脉及吻合口通畅，流出静脉近吻合口处未见明显狭窄。', N'如上所述，请结合临床。', 100, 0, N'CT', N'左手增强', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 67, N'右肩 阴性', N'右肩关节组成骨骨质未见明显异常，排列无殊，周围软组织未见明显异常。', N'右肩关节未见明显异常。', 100, 0, N'CT', N'右肩关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'骨折', N'右胫骨外侧平台可见皮质中断及透亮骨折线，断端位置好。右胫骨髁间隆起亦见骨折征象，碎骨可见分离。股骨下段及髌骨未见异常征象。', N'1 右胫骨平台外侧骨折，位置好。2 右胫骨髁间隆起骨折伴碎骨片分离。Fracture.', 100, 0, N'CT', N'膝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'两侧膝关节 阴性', N'两侧膝关节诸组成骨未见明显骨折线，关节囊内未见异常积液，软组织未见明显肿胀。所示股骨下段及髌骨未见异常征象。', N'两侧膝关节未见明显异常。', 100, 0, N'CT', N'膝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'良性骨肿瘤，胫骨结节骨软骨炎 阳性', N'右膝胫骨上段后侧近皮质可见骨质破坏，内见囊状透亮影，周边硬化，骨皮质光滑，未见骨膜反应，右膝髌韧带胫骨结节附着处增粗，内见斑点状钙化，余右膝诸骨未见明显骨质异常，关节腔未见明显积液，关节间隙无狭窄。周围软组织未见明显肿胀。', N'1、右胫骨上段后侧病变，考虑良性肿瘤可能大，建议随访。必要时进一步检查。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'正常 阴性', N'右侧膝关节诸组成骨未见明显骨折线，关节囊内少量积液，软组织轻度肿胀。所示股骨下段及髌骨未见异常征象。', N'右侧膝关节诸骨未见明显骨折，关节囊少量积液，局部软组织稍肿胀。', 100, 0, N'CT', N'膝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'左手未见明显错位性骨折。 阴性', N'左手各掌指骨骨质完整，未见明显错位性骨折，各关节对合良好，关节间隙未见狭窄，周围软组织未见明显肿胀。', N'左手未见明显错位性骨折。', 100, 0, N'CT', N'膝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'正常 阴性', N'左手各腕骨、各掌指骨骨质完整，未见明显骨质疏松、增生及破坏，各关节对合良好，关节面光整，关节间隙未见狭窄，周围软组织未见明显肿胀。', N'左手正斜位X片未见明显异常。', 100, 0, N'CT', N'膝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'良性骨肿瘤，胫骨结节骨软骨炎 阳性', N'右膝胫骨上段后侧近皮质可见骨质破坏，内见囊状透亮影，周边硬化，骨皮质光滑，未见骨膜反应，右膝髌韧带胫骨结节附着处增粗，内见斑点状钙化，余右膝诸骨未见明显骨质异常，关节腔未见明显积液，关节间隙无狭窄。周围软组织未见明显肿胀。', N'1、右胫骨上段后侧病变，考虑良性肿瘤可能大，建议随访。必要时进一步检查。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 69, N'左手中指中节指骨骨折 阳性', N'左手中指中节指骨头端局部骨皮质断裂，可见斜形透亮线影，断端对位对线佳，周围软组织未见明显肿胀，余掌指骨未见明显骨折及脱位征象，诸关节对合良好。', N'左手中指中节指骨骨折。', 100, 0, N'CT', N'膝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 70, N'正常 阴性', N'双侧髋关节组成骨正常，骨质密度未见明显破坏，关节面光整，周围软组织内未见明显异常占位灶。', N'髋关节平扫未见明显异常。', 100, 0, N'CT', N'髋关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 71, N'正常 阴性', N'双足诸组成骨未见明显骨折线，关节囊内未见异常积液，软组织无明显肿胀。所示胫腓骨下段未见异常征象。', N'双足CT未见明显异常。', 100, 0, N'CT', N'双足平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 73, N'阴性 阴性', N'双踝关节诸组成骨未见明显骨折线，关节囊内未见异常积液所示胫腓骨下段未见异常征象。', N'双踝关节CT未见明显骨折。', 100, 0, N'CT', N'双踝关节平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 75, N'胸部穿刺活检', N'患者取常规仰卧位，行病灶处CT扫描，确定穿刺点，局部消毒铺巾，2％利多卡因局麻后，采用18G穿刺切割针于左肺近胸壁病灶处取得相应组织数条，术中见局部少量气胸，病人无明显不适，观察病情稳定，遂安返病房。', N'左肺肿块CT引导下穿刺活检术。Biopsy of left lung.', 100, 0, N'CT', N'胸部穿刺活检', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 72, N'基本正常 阴性', N'扫描自两侧髂总动脉处起始，显示两侧髂内动脉多发小斑点状致密钙化，两侧髂外动脉向下延伸至股动脉，分出7股深动脉，再向下走行，至胫前、胫后及腓总动脉，动脉全程走行自然，粗细均匀，管壁光滑，管腔无狭窄或异常扩张。盆腔内各结构清晰，右侧附件区可见类圆形囊性灶，边界清，大小约18mm&#215;17mm。余各脏器未见明显异常。', N'两侧髂内动脉多发小钙化灶，余未见明显异常。', 100, 0, N'CT', N'下肢血管三维重建', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 75, N'胸部穿刺活检', N'患者取常规仰卧位，行病灶处CT扫描，确定穿刺点，局部消毒铺巾，2％利多卡因局麻后，采用18G穿刺切割针于左下肺近侧胸壁病灶处取得相应组织数条，术中未见明显气胸，病人无明显不适，观察病情稳定，遂安返病房。', N'左肺肿块CT引导下穿刺活检术。', 100, 0, N'CT', N'胸部穿刺活检', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 76, N'腹部囊肿穿刺引流术', N'取左侧抬高30度仰卧位，行上腹部CT扫描，显示左上腹腔内囊肿，大小为4.7&#215;8.4&#215;13cm，边缘光滑，外缘紧贴侧腹壁。选择合适层面后制定穿刺计划，局部消毒、铺巾、2％利多卡因局麻，采用18G穿刺针按照穿刺计划制定的穿刺点和穿刺方向、深度进行穿刺，进入囊腔后从穿刺针中引流出清亮液体约100ml，CT扫描显示该囊肿已明显缩小，然后经穿刺针注射95％无水酒精5ml，患者有一时的左上腹酸痛，自行缓解，再次CT扫描显示左上腹未见明显异常。', N'左上腹腹腔囊肿CT导引穿刺引流术后。', 100, 0, N'CT', N'腹部穿刺活检', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 76, N'腹部穿刺活检', N'患者取常规仰卧位，行病灶处CT扫描，确定穿刺点，局部消毒铺巾，2％利多卡因局麻后，采用18G穿刺切割针于肝右叶前侧病灶处取得相应组织数条，术中未见明显异常，病人无明显不适，观察病情稳定，遂安返病房。', N'左肺肿块CT引导下穿刺活检术。Biopsy of left lung.', 100, 0, N'CT', N'腹部穿刺活检', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 76, N'下腹部肿块穿刺活检', N'手术过程：患者取仰卧位，先行下腹部CT扫描，显示下腹盆腔内近前腹壁见有扁平不规则低密度肿块，与肠道分界不清，此外右侧盆腔内靠近盆腔壁也见有一椭圆形低密度肿块，大小为3.7*7.8cm，边界尚清，周边见有斑点状钙化。确定穿刺层面后行局部消毒、铺巾、局麻后按照穿刺计划采用18G穿刺针行左下腹肿块穿刺活检，共穿刺5次，所获材料送病理。', N'1、下腹部及盆腔内不规则低密度肿块；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 77, N'内固定，股骨头坏死，骨关节炎 阳性', N'左髋臼及股骨头形态改变，左髋臼及股骨头密度不均匀增高，关节面不光整，关节间隙狭窄。左髋关节对合可。股骨颈内固定在位，未见明显骨折线。', N'左侧股骨颈内固定术后，左股骨头坏死考虑，左髋骨关节炎。', 100, 0, N'CT', N'后腹膜穿刺活检', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 77, N'后腹膜 阳性', N'患者取俯卧位，行病灶处CT扫描，确定穿刺点，局部消毒铺巾，2％利多卡因局麻后，采用18G及20G穿刺切割针于左侧L2水平进针，共穿刺3次，取得相应组织数条，术中未见明显异常，病人无明显不适，观察病情稳定，遂安返病房。', N'后腹膜肿块CT引导下穿刺活检术。Biopsy of left lung.', 100, 0, N'CT', N'后腹膜穿刺活检', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 78, N'左膝退变 阳性', N'左侧胫骨髁间隆起变尖，关节间隙尚可，左股骨下端及左胫骨近端边缘见骨质增生影，髌骨边缘略变尖。周围软组织无殊。', N'左膝关节退行性改变。', 100, 0, N'CT', N'穿刺引流', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 78, N'穿刺引流。 阳性', N'CT扫描定位后，以18G穿刺针穿刺肝脏内脓肿，抽取脓液送细菌培养。CT扫描明确位置后，置入导丝，扩张针道，置入12F的引流管，CT显示引流管位置正确。', N'右肝脓肿CT引导穿刺引流。', 100, 0, N'CT', N'穿刺引流', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 79, N'右膝关节退行性改变。 阳性', N'右侧股骨远端、胫骨近端及髌骨边缘见骨质增生影，髁间隆起变尖，关节间隙无明显变窄，周围软组织无殊。', N'右膝关节退行性改变。', 100, 0, N'CT', N'消融治疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 79, N'右膝 正常 阴性', N'右膝关节各骨大小形态如常，骨质密度均匀，髌骨未见异常，关节间隙不窄，关节面光整。', N'右膝关节骨质未见确切异常。', 100, 0, N'CT', N'消融治疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 79, N'右膝 退变 阳性', N'右膝关节骨质密度减低，皮质变薄。胫骨内外髁见骨质增生，髁间隆起变尖，内侧关节间隙稍变窄。余骨未见明显异常。', N'右膝关节退行性改变伴骨质疏松。', 100, 0, N'CT', N'消融治疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 79, N'正常 阴性', N'右膝关节骨质完整，未见明显增生及破坏，关节间隙正常，周围软组织未见明显肿胀。', N'右膝关节未见明显异常。 No abnormality was found', 100, 0, N'CT', N'消融治疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 79, N'CT导引经皮左肾上极错构瘤冷冻消融治疗。', N'左侧肾上极偏内侧混杂密度占位性病变，大小为4.1&#215;3.4cm，向肾外突出，其内大部为脂肪密度，与肾实质分界清。附见胆囊结石。
