INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'肺结节', N'胸廓两侧对称，气管居中，两肺纹紊乱，左下肺中内带结节影，病灶边缘模糊，周边可见片状淡薄影。余肺未见实质性病灶。心影狭长，双膈低平。肋骨未见异常骨质改变。', N'1.左下肺中内带结节影，炎症首考，建议CT检查排除其它病变
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'左中下肺感染,左下胸膜改变', N'两肺纹理增多，左中下肺可见小片状模糊影。余肺（－），心影大小形态正常，两膈面光滑，左侧肋膈角变钝，右侧肋膈角锐利。', N'1.左中下肺感染，建议治疗后复查
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'右侧胸膜改变', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。右侧胸膜条形增厚，心膈无殊。肋骨未见异常骨质改变。', N'右侧胸膜改变', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
