INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'左室增大', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。心影增大，心胸比例约0.6,左心缘外下方扩大。双膈无殊。肋骨未见异常骨质改变。', N'提示：左心室增大(Enlargement of left ventricle)', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'心脏术后 阴性', N'心脏术后：两肺纹理增多、紊乱，肺内未见明显实质性病灶，心影增大，内见人工瓣膜影，胸廓两侧对称，气管插管下缘位于T4上緣水平，纵隔内见金属圈影及金属缝线影。深静脉置管末端位于T7水平。', N'心脏术后改变。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'胸腔积液', N'右肺中下野密度增高，正位片上可见一液平，右膈面及肋膈角未显示；左侧肋膈角模糊，膈面欠光整。纵隔未见明显移位，形态大小正常，肋骨未见异常骨质改变。', N'胸腔积液 Pleural effusion', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'肺气肿', N'两肺纹理自肺门向外稀疏、变细，两肺野透亮度增高，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心影变小，两膈位置较低，膈面光整，两侧肋膈角锐利。', N'两肺肺气肿考虑，建议结合临床。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'慢支、肺气肿 阳性', N'胸廓对称，气管居中，两肺纹理增多紊乱，肺野透光度增高，余未见明显实质性病灶，膈肌低平，心影狭长，两膈无殊。', N'符合慢性支气管炎、肺气肿影像表现。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'两肺纹稍增多', N'两肺纹理稍增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。', N'两肺纹理稍增多。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'肋骨外伤 阳性', N'两肺纹理紊乱，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。膈上肋骨未见异常骨质改变。', N'心肺膈未见明显异常，膈上肋骨未见明显错位骨折，请2周后复查。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'左胸膜改变', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。左肋膈角稍模糊，心膈无殊。肋骨未见异常骨质改变。', N'左侧胸膜改变（Pleural change）', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'左下肺小片状模糊影，建议CT检查', N'胸廓两侧对称，气管居中，左下肺小片状模糊影，余肺野清晰，未见实质性病灶。心膈无殊。肋骨未见异常骨质改变。', N'左下肺小片状模糊影，建议CT检查 CT is seggusted', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'乳头影', N'胸廓两侧对称，气管居中，两下肺中带结节影，病灶边缘清，余肺野清，未见实质性病灶。心影狭长，双膈低平。肋骨未见异常骨质改变。', N'两下肺中带结节影，乳头影可能性较大，建议必要时进一步检查', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'肺纹理增多＋主动脉迂曲 阳性', N'两肺纹理稍增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。主动脉迂曲。', N'肺纹理增多，主动脉迂曲。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'主动脉迂曲＋颈椎退变 阳性', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。主动脉迂曲，心膈无殊。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'两下肺纹理增多', N'
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'右膈局限性抬高', N'两肺纹理增多、紊乱，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，右膈局限性抬高。肋骨未见异常骨质改变。', N'两肺纹理增多。右膈局限性抬高，建议进一步检查 Increased Lung Markings', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'主动脉', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。主动脉迂曲、钙化，心膈无殊。肋骨未见异常骨质改变。脊柱侧弯。', N'主动脉迂曲,钙化。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'肺纹理增多 阳性', N'两肺纹理稍增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。肋骨未见异常骨质改变。', N'两肺纹理稍增多 Increased Lung Markings', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'CXR正常，颈椎正常 阴性', N'颈椎生理曲度存在，各椎体骨质完整，未见明显增生及破坏，椎间隙未见增宽或狭窄，附件无殊。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'增多迂曲', N'两肺纹理增多、紊乱，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，主动脉迂曲。肋骨未见异常骨质改变。', N'两肺纹理增多，主动脉迂曲 Increased Lung Markings', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'右上陈旧性结核', N'胸廓对称，气管居中，右上肺可见条索状致密影。心影大小形态正常，两膈面光滑，两侧肋膈角锐利。肋骨未见异常改变。', N'右上肺陈旧性结核 Old TB', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'右上肺钙化灶。', N'胸廓两侧对称，气管居中，右上肺钙化灶，其余两肺未见明显活动性病灶。心膈无殊。膈上肋骨未见明确骨质异常。', N'右上肺钙化灶。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'PICC管置入后', N'
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'右下肺纹理增多', N'右下肺纹理增多紊乱，余肺野清晰，未见实质性病灶。胸廓两侧对称，气管居中，心膈无殊。肋骨未见异常骨质改变。', N'右下肺纹理增多 Increased Lung Markings', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'气胸 阳性', N'胸廓对称，气管居中。两肺纹理增多，右肺外带见异常透亮带，内无肺纹理，并可见压缩肺边缘，余肺未见明显活动性病灶。心膈无殊。', N'右侧气胸，肺压缩约20％。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'两肺感染伴左侧少量胸腔积液', N'胸廓两侧对称，气管居中，两肺纹理增多、增粗，边界模糊，左肺下野可见片状密度增高影，边缘模糊，左侧肋膈角变钝，心影无殊。肋骨未见异常骨质改变。', N'两肺感染伴左侧少量胸腔积液。', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'两侧胸膜改变', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。两肋膈角稍模糊，心膈无殊。肋骨未见异常骨质改变。', N'两侧胸膜改变（Pleural change）', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'液气胸', N'右肺外带见长条形无肺纹的含气透亮带，内侧可见被压缩的肺组织，右肋膈角区显示液平。纵隔未见明显移位，形态大小正常，左膈光整，肋膈角锐利。', N'右侧液气胸。Right hydropneumothorax.', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'主动脉迂曲', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。主动脉迂曲，心膈无殊。肋骨未见异常骨质改变。', N'主动脉迂曲 Curvature of aorta', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'两上肺陈旧性结核', N'肺尖可见帽状密度增高影,紧贴肺尖及侧胸壁,两肺纹理增多，两上肺可见斑片状致密影。心影大小形态正常，两膈面光滑，两侧肋膈角欠清。', N'肺纹理增多  Increased lung markings 肺尖胸膜增厚 pleural thickening 两上肺陈旧性结核 Old TB', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 94, N'肺纹理多，肺门影浓，建议CT', N'两肺纹理增多，肺门影增浓，两下肺可见条索状影，两肺野未见明显实质性病灶。主动脉弓迂曲，心影大小形态正常，左侧肋膈角稍钝，右侧肋膈角锐利。两膈面尚光滑。', N'两肺纹理增多，肺门影增浓，建议CT检查。CT is suggested.', 100, 0, N'DR', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 95, N'主动脉迂曲', N'胸廓两侧对称，气管居中，两肺野清晰，未见实质性病灶。主动脉迂曲，心膈无殊。肋骨未见异常骨质改变。', N'主动脉迂曲。', 100, 0, N'DR', N'胸右侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 95, N'胸右侧位正常 阴性', N'胸右侧位示，所见肺野尚清晰，未见明显活动性病灶。心膈无殊。所见肋骨未见异常骨质改变。', N'胸右侧位片未见明显异常，必要时进一步CT检查。', 100, 0, N'DR', N'胸右侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 95, N'胸右侧位正常', N'胸右侧位示，所见肺野尚清晰，未见明显活动性病灶。心膈无殊。所见肋骨未见异常骨质改变。', N'胸右侧位片未见明显异常，必要时进一步CT检查。', 100, 0, N'DR', N'胸右侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 96, N'RHD', N'正位：双肺透亮度稍降低，两肺纹增多增粗，双肺未见明显实质灶，心影增大，心胸比例约0.6，肺动脉段突出，主动脉结缩小，右心缘下段向右侧凸出，心右缘呈双房影，双膈无殊。右前斜：心前间隙缩窄，心前下间隙闭塞。食道左房压迹增深。左前斜:左主支气管受压抬高，主动脉窗缩小。', N'肺淤血，左房、右室增大，结合临床考虑风心（二狭）。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 96, N'ASD', N'正位：两肺纹增多增粗，双肺未见明显实质灶，两肺A干增粗，心影增大，心胸比例约0.6，两心缘向双侧扩大，肺动脉段突出，双膈无殊。右前斜：心前间隙缩窄，心前下间隙闭塞。食道左房压迹未见增深。左前斜:心后缘向后下方扩大，心前上间隙变窄。', N'肺充血，右房、右室、左室增大，结合临床考虑ASD', 100, 0, N'DR', N'心脏三位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 96, N'正常 阴性', N'正位：双肺透亮度正常，两肺纹理清晰，双肺未见明显实质灶，心影无殊，心胸比例约0.5，肺动脉段未见突出，主动脉结未见明显异常，两心缘无殊，双膈膈面光整。右前斜：心前间隙无缩窄，心前下间隙未见改变。食道左房压迹无殊。左前斜:左主支气管未见明显受压抬高，主动脉窗未见明显异常。', N'心脏三位未见明显异常', 100, 0, N'DR', N'心脏三位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 96, N'左室增大 阳性', N'正位：双肺透亮度正常，两肺纹理清晰，双肺未见明显实质灶，心影无殊，心胸比例约0.5，肺动脉段未见突出，主动脉结未见明显异常，两心缘无殊，双膈膈面光整。右前斜：心前间隙无缩窄，心前下间隙稍狭窄。食道左房压迹无殊。左前斜:左主支气管未见明显受压抬高，主动脉窗未见明显异常。左室段稍后移与脊椎重叠。', N'左室可疑增大，建议进一步检查。', 100, 0, N'DR', N'心脏三位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 97, N'单纯主动脉迂曲。 阳性', N'胸左侧位示，所见肺野尚清晰，未见明显活动性病灶。心影不大，主动脉迂曲，肋膈角尚清。', N'主动脉迂曲。', 100, 0, N'DR', N'胸左侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 97, N'主动脉迂曲，胸膜改变。 阳性', N'胸左侧位示，所见肺野尚清晰，未见明显活动性病灶。心影不大，主动脉迂曲，肋膈角略钝。', N'主动脉迂曲，胸膜改变。', 100, 0, N'DR', N'胸左侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 97, N'正常 阴性', N'左侧位显示心前、心后间隙清晰，未见明显异常密度影，心影不大，两膈光整，前后肋膈角锐利。', N'胸左侧位未见明显异常。', 100, 0, N'DR', N'胸左侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
