INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 103, N'正常胸椎MRI 阴性', N'胸椎生理曲度存在，各胸椎椎体形态如常，椎体信号未见明显异常改变，椎体附件无殊。诸椎间盘未见明显膨出或突出征象，硬膜囊未见受压。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 104, N'鼻骨骨折', N'鼻骨中段骨质断裂，远端移位不明显，局部软组织肿胀。', N'鼻骨骨折。', 100, 0, N'DR', N'鼻骨左侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 104, N'正常 阴性', N'鼻骨骨质连续，未见明显骨折征象。鼻背部软组织肿胀不明显。', N'鼻骨未见明显骨折征象 No abnormality is found', 100, 0, N'DR', N'鼻骨左侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 105, N'正常 阴性', N'下颌骨外形规则，未见明显骨折征象，周围软组织未见明显肿胀。', N'下颌骨未见明显错位性骨折。', 100, 0, N'DR', N'下颌骨正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 105, N'颌下腺结石', N'左侧下颌骨体部内见结节状稍高密度影，边界尚清。下颌骨前部见两个低密度影，余无殊。', N'下颌骨体部内见结节状稍高密度影，考虑颌下腺结石可能，建议必要时CT检查。', 100, 0, N'DR', N'下颌骨正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 106, N'正常 阴性', N'双侧乳突呈混合形，双侧乳突蜂房，鼓窦结构显示清晰，所见骨质未见明显吸收、破坏。', N'双侧乳突未见明显异常。', 100, 0, N'DR', N'右顴弓切线位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 107, N'双侧颞颌关节未见明显异常。 阴性', N'闭口位：双侧颞颌关节对合良好，形态规则，关节间隙未见明显狭窄。
