INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 109, N'正常 阴性', N'两侧眼眶对称，眶壁骨质完整，未见明显骨质中断征象，两侧眶上裂投影于眶内，对称完整。', N'眼眶正侧位未见明显异常X线征象，必要时进一步检查。', 100, 0, N'DR', N'眼眶正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 110, N'正常 阴性', N'双侧上颌窦副鼻窦结构完整，密度正常，未见明显的液平征象。余骨未见明显骨质异常改变。', N'华氏位未见明显异常改变。', 100, 0, N'DR', N'华氏位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
