INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'颈椎病', N'颈椎曲度不自然，顺列。椎体部分边缘增生变尖。C4/5椎间隙变窄。项韧带条块钙化。', N'颈椎病。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'颈椎骨质增生', N'颈椎生理曲度存在，顺列。椎体部分边缘变尖。椎间隙不窄。', N'颈椎骨质增生。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
