INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'颈椎退变', N'颈椎生理曲度消失，各椎体骨质完整，部分椎体边缘骨质增生，椎间隙未见增宽或狭窄，附件无殊。', N'颈椎退行性改变', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
