INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'钩突退变', N'颈椎生理曲度变直，C5－7椎体边缘见明显骨质增生，骨赘形成。C5/6椎间隙轻度狭窄。C6/7钩椎关节间隙狭窄。附件小关节硬化。项韧带钙化影。', N'颈椎退行性改变。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'退行性改变', N'颈椎生理曲度存在，各椎体骨质完整，部分椎体边缘锐利，C4－7小关节呈双边影，椎间隙未见增宽或狭窄，附件无殊。', N'颈椎骨质退行性改变。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'颈椎退变 阳性', N'颈椎生理曲度存在，各椎体骨质完整，部分椎体边缘骨质增生，椎间隙未见增宽或狭窄，小关节硬化，软组织无殊。', N'颈椎退行性改变。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'颈椎病', N'颈椎生理曲度存，各椎体骨质完整，部分椎体边缘骨质增生，C6/7椎间隙变窄，其水平前纵韧带钙化，其余椎间隙未见增宽或狭窄，附件无殊。', N'考虑颈椎病，建议进一步检查。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 112, N'颈椎退变', N'颈椎生理曲度变直，顺列。椎体部分边缘增生变尖。椎间隙未见明显狭窄。项韧带小斑条钙化。', N'颈椎退变。', 100, 0, N'DR', N'颈椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 113, N'正常 阴性', N'胸椎生理曲度存在，椎体骨质完整，未见明显增生及破坏，椎间隙及附件无殊。', N'胸椎未见明显异常。No abnormality was found', 100, 0, N'DR', N'胸椎正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
