INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'正常腰椎 阴性', N'腰椎生理曲度存在，排列规则，各椎体骨质完整，未见明显骨质增生、破坏，各椎间隙及附件无殊。周围软组织未见肿胀。', N'腰椎平片未见明显异常。', 100, 0, N'DR', N'腰椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'L1压缩性骨折', N'腰椎生理曲度存在，L1椎体呈楔形压缩改变，余各椎体未见明外伤性改变，椎间隙未见狭窄及增宽，附件无殊。', N'L1压缩性骨折。', 100, 0, N'DR', N'腰椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'退变', N'L1-5顺列，生理曲度变直，部分椎体上下缘唇样骨质增生，椎间隙未见增宽或变窄。附件无殊。', N'腰椎退行性改变。', 100, 0, N'DR', N'腰椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'正常', N'腰椎生理曲度存在，顺列。椎体形态如常，密度无殊。椎间隙未见增宽狭窄。', N'平片所示腰椎未见明显异常。', 100, 0, N'DR', N'腰椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'腰椎退变', N'腰椎生理曲度存在，顺列。椎体前缘侧缘为主骨质增生，部分骨赘形成。椎间隙不窄。', N'腰椎退变。', 100, 0, N'DR', N'腰椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'术后', N'L4-5后路金属内固定在位，间隙内数个小短条金属密度影及小团高密度影。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 121, N'腰椎退行性改变。', N'腰椎生理曲度存在，部分椎体上下缘骨质增生，椎间隙未见增宽或变窄。附件无殊。', N'腰椎退行性改变。', 100, 0, N'DR', N'腰椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 122, N'腰椎骨折术后改变', N'L1-5顺列，曲度存在。L1椎体契形变，相应部位内固定器在位，L4椎体前缘唇样骨质增生。余椎体及附件无殊，椎间隙如常。', N'L1椎体骨折术后改变 Post operative changing 腰椎退行变 Hyperosteogeny', 100, 0, N'DR', N'腰椎正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 123, N'正常 阴性', N'骶尾椎生理曲度存在，各骶椎椎体未见明显骨质断裂错位征象。狭窄。', N'骶尾椎未见明显骨折', 100, 0, N'DR', N'骶尾椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 123, N'正常', N'骶尾椎生理曲度存在，各椎体未见明显骨质增生及骨质破坏，椎间隙无狭窄。', N'骶尾椎未见明显异常。No abnormality is found', 100, 0, N'DR', N'骶尾椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 123, N'正常 阴性', N'骶尾椎各骨未见明显骨质破坏或增生，骨盆各骨未见明显异常，关节间隙正常。', N'骶尾椎未见明显异常。', 100, 0, N'DR', N'骶尾椎正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 123, N'目前未见明显错位性骨折，建议必要时CT检查', N'骶尾部局部曲度增大，尾骨前突，骨质未见明显骨折征象，软组织肿胀不明显。', N'骶尾椎目前未见明显错位性骨折，建议必要时行骨盆CT检查。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 124, N'腰椎内固定术后改变', N'腰椎内固定术后，于L4/5水平可见金属内固定影，位置固定，未见明显滑脱征象。', N'腰椎内固定术后改变。', 100, 0, N'DR', N'腰椎侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 124, N'退行变 阳性', N'腰椎生理曲度存在，部分椎体上下缘唇样骨质增生，椎间隙未见增宽或变窄。附件无殊。', N'腰椎退行性改变。Degeneration.', 100, 0, N'DR', N'腰椎侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 125, N'骶尾椎正常', N'骶尾椎曲度及序列未见明显异常，骨质结构完整，附件未见明确异常。', N'骶尾椎骨质未见明显异常。', 100, 0, N'DR', N'骶尾椎侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 127, N'左肩关节正位 阴性', N'左侧肱骨上段、肩胛骨、锁骨所见部分骨质连续，未见骨质增生、破坏；关节结构完整，关节间隙未见狭窄及扩大；周围软组织未见肿胀。', N'左肩关节未见异常。', 100, 0, N'DR', N'左肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 127, N'左肩关节 正常 阴性', N'左肩关节各骨大小形态如常，骨质密度均匀，关节间隙不窄，关节面光滑。软组织未见确切异常改变。', N'左肩关节骨质未见异常。', 100, 0, N'DR', N'左肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 127, N'左肩关节正常 阴性', N'左肩关节各组成骨排列正常，关节面骨质未见异常，关节间隙未见增宽和变窄，周围软组织未见明显异常。', N'左肩关节未见明显异常。', 100, 0, N'DR', N'左肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 128, N'肩锁关节退变 阳性', N'右肩关节诸骨皮质连续，诸骨未见骨质破坏改变，肩锁关节边缘骨质增生变尖，关节在位，关节间隙如常。', N'右肩锁关节退变。', 100, 0, N'DR', N'右肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 128, N'肩关节英文', N'双侧肩关节骨质密度减低，但骨皮质连续，未见明显骨的质破坏征象，肩关节在位，关节面光整，关节间隙如常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 128, N'正常右肩', N'右肩关节诸骨皮质连续，骨质未见明显增生破坏改变，关节间隙如常。余无殊。', N'右肩关节未见异常（Right shoulder is normal）', 100, 0, N'DR', N'右肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 128, N'正常 阴性', N'右肩关节诸骨皮质连续，骨质未见明显骨折征象，关节间隙如常，周围软组织未见明显异常密度影。', N'右肩关节未见明显骨折及脱位征象。', 100, 0, N'DR', N'右肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 128, N'右肩关节未见异常。', N'右肩关节诸骨皮质连续，骨质未见明显增生破坏改变，关节间隙如常。余无殊。', N'右肩关节未见异常。', 100, 0, N'DR', N'右肩关节正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 129, N'主动脉迂曲', N'两肺纹理稍增多，主动脉稍迂曲增宽，肺内未见明显异常渗出及肿块影。心影不大，双侧膈角锐利。', N'主动脉迂曲。Unfolding of the aortic arch.', 100, 0, N'DR', N'卧位胸前后位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 129, N'两肺纹理增多。', N'两肺纹理增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。', N'两肺纹理增多。', 100, 0, N'DR', N'卧位胸前后位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 129, N'左侧胸腔积液 阳性', N'
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 129, N'心肺膈未见明显异常 阴性', N'胸廓两侧对称，气管居中，两肺未见明显活动性病灶。心膈无殊。肋骨未见异常骨质改变。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 129, N'卧位前后位。 阴性', N'胸廓两侧对称，气管居中，两肺未见明显活动性病灶。卧位心影，纵隔无殊。两侧横膈与肋膈角清楚。', N'卧位前后位摄片未见明显异常。', 100, 0, N'DR', N'卧位胸前后位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 129, N'正常表现 阴性', N'
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 130, N'肋骨正常 阴性', N'所示肋骨形态如常，骨皮质连续光整，未见明显错位性骨折。', N'所示肋骨未见明显异常。', 100, 0, N'DR', N'肋骨正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 130, N'肋骨正常 阴性', N'所示肋骨形态如常，骨皮质连续光整，未见明显错位性骨折。', N'所示肋骨未见明显异常。', 100, 0, N'DR', N'肋骨正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 130, N'膈上肋骨未见错位性骨折 阴性', N'膈上肋骨骨皮质完整，未见明显错位性骨折。', N'膈上肋骨未见明显错位性骨折。', 100, 0, N'DR', N'肋骨正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'正常（男性）', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽。肝内外胆管无扩张。胆囊不大，壁不厚，未见高密度灶。胰腺大小形态密度未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'正常（女性）', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽。肝内外胆管无扩张。胆囊不大，壁不厚，未见高密度灶。胰腺大小形态密度未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'肝血管瘤 阳性', N'肝脏表面光滑，肝叶比例协调，肝裂不宽,平扫肝右后叶见大小约21mm*41mm低密度灶，边界尚清，增强扫描动脉期病灶周边呈结节状强化，静脉期向中心填充，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见明显肿大淋巴结。', N'肝右后叶血管瘤考虑。', 100, 0, N'DR', N'前弓位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'正常 阴性', N'肝表面光滑，肝叶比例协调，肝裂不宽,肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'上腹部增强CT未见明显异常。', 100, 0, N'DR', N'前弓位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'肝脏多发血管瘤伴多发小囊肿。 阳性', N'平扫肝内见多个类圆形低密度灶，增强扫描部分病灶无明显强化，部分病灶动脉期呈结节状强化，静脉期进一步填充，肝内胆管未见明显扩张。胆囊不大，壁均匀，内未见确切异常密度影。胰腺大小形态未见明显异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'肝脏多发血管瘤伴多发小囊肿。', 100, 0, N'DR', N'前弓位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'胆囊结石，胆囊炎 阳性', N'肝表面光滑，肝叶比例协调，肝裂不宽,肝内未见异常密度灶，肝内外胆管无扩张。胆囊不大，壁略厚，内见多个点状高密度灶，胰腺大小形态未见异常。脾不大，质均匀。腹膜后未见肿大淋巴结。', N'胆囊结石，胆囊炎考虑。', 100, 0, N'DR', N'前弓位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'上腹部增强正常 阴性', N'肝内未见异常密度灶，表面光滑，肝叶比例协调，肝裂不宽, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常。脾不大，质均匀。增强后肝胆脾胰未见明显异常强化灶。腹膜后未见肿大淋巴结。', N'上腹部增强CT未见明显异常。', 100, 0, N'DR', N'前弓位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'上腹部和盆腔增强扫描未见明显异常 阴性', N'肝内未见异常密度影，肝表面光滑，肝叶比例如常, 肝内外胆管无扩张。胆囊不大，壁不厚，内未见高密度灶，胰腺大小形态未见异常，胰管未显示。脾脏大小正常范围，实质密度均匀。腹膜后未见肿大淋巴结。增强后肝、胆、胰、脾未见异常强化灶。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'全腹女性正常 阴性', N'肝实质密度均匀、未见胆管扩张。胆囊不大，壁不厚，内未见明显异常密度。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
