INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 131, N'上腹部+正常盆腔', N'上腹部CT平扫及增强扫描，肝内多发大小不等类圆形低密度影，界清无强化，右肝VII段包膜下见一类圆形低密度影，增强后逐渐向病灶内部填充，未见胆管扩张。胆囊无殊。胰腺外形正常、胰管不扩张。脾大小正常、密度均匀。右肾见小圆形低密度影，界清无强化，左肾和肾上腺未见异常。后腹膜主动脉旁未见淋巴结肿大。
