INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 136, N'如上所述，请结合临床。 阴性', N'右前臂桡动脉与头静脉吻合,流入动脉及吻合口通畅，流出静脉未见明显狭窄。', N'如上所述，请结合临床。', 100, 0, N'DR', N'立位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 136, N'上臂人造血管 阳性', N'左前臂人工移植血管袢CTA示：流入动脉通畅，未见明显瘤样扩张及管腔狭窄，人工血管袢及引流静脉多处节段狭窄，管腔内充盈缺损，引流静脉肘部节段囊状扩张。', N'人工血管袢及引流静脉多处节段狭窄伴血栓形成，引流静脉局部囊状扩张。', 100, 0, N'DR', N'立位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'尿路术后', N'左尿路D-J管留置，符合左肾、输尿管及膀胱区走行，肠积气内容物重叠，未见明显阳性结石影。', N'左尿路术后。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'未见尿路结石。', N'腹部肠道少量积气，双侧肾区、输尿管走行区及膀胱区未见明显阳性结石影，盆腔内未见明显静脉石影。', N'腹部未见明显异常。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'肝癌TACE术后。 阳性', N'患者取仰卧位，常规消毒、铺巾、2%利多卡因局麻后，采用改良seldinger法，使用18G穿刺针经右股动脉穿刺，置入5F导管鞘，使用5F Yashiro导管超选至肝右动脉，共静脉注入枢丹8mg，MMC 10mg＋THP 50mg＋碘化油15ml混合乳剂，并间隔灌注水化艾恒150mg。术中顺利，患者尚可耐受。术后拔出导管及导管鞘，穿刺部位压迫止血20分钟，无出血及血肿，加压包扎后送返病房。', N'肝癌TACE术后。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'未见阳性结石', N'腹部肠道少量积气，双侧肾区、输尿管走行区及膀胱区未见明显阳性结石影，盆腔内未见明显静脉石影。', N'腹部未见明显异常。建议超声检查。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'尿路区置管影', N'双肾区、双输尿管及膀胱区域未见明显阳性结石影，右尿路区可见置管影。', N'对照9.2片，原右输尿管下端结石影已不见，留置管。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'左侧尿路结石', N'左侧肾区及盆腔内可见数个圆形高密度影，其中较大的位于肾区内，约为11mm&#215;9mm，边界清，右侧肾区未见明显阳性结石影。盆腔内尚可见多个静脉石影。', N'左肾及两侧输尿管下段结石。建议IVP检查。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'正常 阴性', N'腹部平片示，两侧肾脏外形尚清，肾区及两侧输尿管、膀胱区域未见明显阳性结石影。腰椎各椎体未见明显骨质增生，骨盆各骨骨质完整，各关节结构完整，盆腔内未见明显静脉石。', N'卧位腹部平片未见明显异常。No abnormality is found', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'左输尿管切开取石术后', N'左输尿管切开取石术后，左侧输尿管走行区可见D-J管影，两侧肾区、输尿管及膀胱区未见明显阳性结石影。', N'左输尿管切开取石术后改变。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 137, N'右输尿管切开取石术后改变', N'右输尿管切开取石术后，右侧输尿管走行区可见D-J管影，两侧肾区、输尿管及膀胱区未见明显阳性结石影。', N'右输尿管切开取石术后改变。', 100, 0, N'DR', N'卧位腹部平片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'右输尿管结石 阳性', N'KUB：腹部准备尚可，两侧肾影清晰，L3右侧横突上方见一枚大小约0.9cm&#215;0.6cm类圆形致密影，双肾区、左侧输尿管、膀胱区域未见明显阳性结石影；IVP：双肾5分钟即可显影，15分钟显影清晰，综合5、15、30分钟所见，右侧肾盂肾盏明显积水扩张，杯口变钝，左侧肾盂、肾盏未见明显扩张积水，杯口形态良好。左侧输尿管通畅，右侧输尿管未见明显显影，膀胱显影良好。盆腔内未见明显静脉石影。', N'右侧输尿管上段结石伴右侧肾盂肾盏积水扩张。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'左输尿管结石 阳性', N'KUB：腹部准备尚可，两侧肾影清晰，左输尿管走行区域L3横突水平见一枚大小约1.0cm&#215;0.6cm类圆形致密影，双肾区、右侧输尿管、膀胱区域未见明显阳性结石影；IVP：双肾5分钟即可显影，15分钟显影清晰，综合5、15、30分钟所见，左侧肾盂肾盏明显积水扩张，呈棉花团状，右侧肾盂、肾盏未见明显扩张积水，杯口形态良好。右侧输尿管通畅，左侧输尿管未见明显显影，膀胱显影良好。盆腔内未见明显静脉石影。', N'左侧输尿管上段结石伴左侧肾盂肾盏积水扩张。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'右输尿管结石 阳性', N'KUB：腹部准备尚可，两侧肾影清晰，L3右侧横突上方见一枚大小约0.9cm&#215;0.6cm类圆形致密影，双肾区、左侧输尿管、膀胱区域未见明显阳性结石影；IVP：双肾5分钟即可显影，15分钟显影清晰，综合5、15、30分钟所见，右侧肾盂肾盏明显积水扩张，杯口变钝，左侧肾盂、肾盏未见明显扩张积水，杯口形态良好。左侧输尿管通畅，右侧输尿管未见明显显影，膀胱显影良好。盆腔内未见明显静脉石影。', N'右侧输尿管上段结石伴右侧肾盂肾盏积水扩张。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'右输尿管结石 阳性', N'KUB：腹部准备尚可，两侧肾影清晰，双肾区、膀胱区域未见明显结石影，右输尿管下端见一10mm纵行高密度影。IVP：右肾5分钟即可显影，15分钟显影清晰，综合5、15、30、45分钟所见，右侧肾盂、肾盏扩张，小盏杯口饱满，左侧肾盂及输尿管未见明显异常，膀胱显影良好。盆腔内未见明显静脉石影。', N'右输尿管下端结石伴轻度肾积水考虑。 Stone', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'正常书写 阴性', N'KUB：腹部准备尚可，两侧肾影清晰，双肾区、输尿管、膀胱区域未见明显阳性结石影；IVP：双肾5分钟即可显影，15分钟显影清晰，综合5、15、30分钟所见，双侧肾盂、肾盏未见明显扩张积水，左肾、输尿管显影较淡，杯口形态良好，双侧输尿管通畅，膀胱显影良好。盆腔内未见明显静脉石影。', N'KUB＋IVP未见明显异常。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'左输尿管结石', N'KUB：腹部准备尚可，两侧肾影清晰，双肾区、膀胱区域未见明显结石影，第3腰椎左侧见一6mm高密度影。IVP：右肾5分钟即可显影，15分钟显影清晰，综合5、15、30、45分钟所见，右侧肾盂、肾盏未见明显异常，双侧杯口存在，左肾显影延迟，左侧输尿管上段稍扩张，左肾、输尿管显影可，左侧输尿管上段局限性狭窄，膀胱显影良好。盆腔内未见明显静脉石影。', N'左输尿管上段结石考虑。 Stone', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'右输尿管上段结石 阳性', N'KUB：腹部准备尚可，两侧肾影清晰，双肾区、膀胱区域未见明显结石影，右输尿管上段见一16mm&#215;15mm点状高密度影。IVP：综合5、15、30、45分钟所见，右侧肾盂、肾盏扩张，小盏杯口饱满，右输尿管未见显示，左侧肾盂及输尿管未见明显异常，膀胱显影良好。盆腔内未见明显静脉石影。', N'右输尿管上段结石伴肾积水考虑。 Stone', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'正常 阴性', N'KUB：腹部准备可，两侧肾影清晰，双肾区、输尿管、膀胱区域未见明显阳性结石影，盆腔内未见静脉石影；IVP：双肾5分钟显影，15分钟显影清晰，综合5、15、30分钟所见，双侧肾盂、肾盏未见明显扩张积水征象，杯口形态良好，双侧输尿管通畅，膀胱显影良好。', N'KUB＋IVP未见明显异常。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'KUB+IVP', N'KUB：腹部准备尚可，两侧肾影清晰，盆腔右侧可见一高密度影，大小约3X9mm，其余双肾区、输尿管、膀胱区域未见明显阳性结石影；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'肾积水', N'KUB：腹部准备尚可，两侧肾影清晰，右肾内及右侧输尿管下段均可见一高密度影，余肾区、输尿管、膀胱区域未见明显阳性结石影；IVP：双肾5分钟即可显影，15分钟显影清晰，综合5、15、30、45分钟所见，右侧肾盂、肾盏明显扩张积水，右侧输尿管上段可见明显扩张影，左肾、输尿管显影较淡，左侧输尿管尚通畅，膀胱显影良好。盆腔内未见明显静脉石影。', N'右肾及右侧输尿管下段结石。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'左输尿管结石 阳性', N'KUB：腹部准备尚可，两侧肾影清晰，左输尿管走行区域L3横突水平见一枚大小约1.0cm&#215;0.6cm类圆形致密影，双肾区、右侧输尿管、膀胱区域未见明显阳性结石影；IVP：双肾5分钟即可显影，15分钟显影清晰，综合5、15、30分钟所见，左侧肾盂肾盏明显积水扩张，呈棉花团状，右侧肾盂、肾盏未见明显扩张积水，杯口形态良好。右侧输尿管通畅，左侧输尿管未见明显显影，膀胱显影良好。盆腔内未见明显静脉石影。', N'左侧输尿管上段结石伴左侧肾盂肾盏积水扩张。', 100, 0, N'DR', N'KUB+IVP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 138, N'KUB+IVP NORMAL ENGLISH 阴性', N'KUB：腹部准备可，两侧肾影清晰，双肾区、输尿管、膀胱区域未见明显阳性结石影，盆腔内未见静脉石影；IVP：双肾7分钟显影，15分钟显影清晰，综合5、15、25分钟所见，双侧肾盂、肾盏未见明显扩张积水征象，杯口形态良好，双侧输尿管通畅，膀胱显影良好。', N'KUB＋IVP未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'ERCP正常 阴性', N'所示肝内外胆管未见明显异常。', N'胆总管、肝总管、左右肝内胆管显示，胆管管壁光洁，走行尚可，未见明显扩张，未见狭窄，未见明显充盈缺损，胆总管下端有造影剂进入十二指肠。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'右肝内胆管结石 阳性', N'经内镜注入稀释泛影葡胺，左肝内胆管及胆总管扩张明显，内未见明显充盈缺损，管壁光洁，走行尚可。右肝内胆管稍扩张，可见分支中断，胆囊未见显示，可见对比剂少量进入十二指肠。', N'胆总管下段结石。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'ERCP结石', N'经内镜注入稀释泛影葡胺，可见胆总管下段一充盈缺损，余肝总管、左右肝内胆管显影良好，上段胆总管及肝内胆管轻度扩张，并可见少量对比剂溢出到腹腔内，胆管管壁光洁，走行尚可。可见对比剂少量进入十二指肠，T管显影。', N'胆总管下段结石。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'ERCP正常 阴性', N'所示肝内外胆管未见明显异常。', N'胆总管、肝总管、左右肝内胆管显示，胆管管壁光洁，走行尚可，未见明显扩张，未见狭窄，未见明显充盈缺损，胆总管下端有造影剂进入十二指肠。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'右肝内胆管结石 阳性', N'经内镜注入稀释泛影葡胺，左肝内胆管及胆总管扩张明显，内未见明显充盈缺损，管壁光洁，走行尚可。右肝内胆管稍扩张，可见分支中断，胆囊未见显示，可见对比剂少量进入十二指肠。', N'右肝内胆管分支中断，结石不除外；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'ERCP胆总管结石', N'胆总管上段结石。', N'经内镜注入稀释泛影葡胺，可见胆总管上段一充盈缺损，余肝总管、左右肝内胆管显影良好，左段肝管及肝内胆管轻度扩张，胆管管壁光洁，走行尚可。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'胆总管充盈缺损 阳性', N'ERCP示胆总管、肝总管、左右肝内胆管显示，左侧肝内胆管轻度扩张，右侧胆管管壁光洁，走行尚可，未见明显扩张，未见狭窄，未见明显充盈缺损，胆总管内见一类圆形充盈缺损，十二指肠内对比剂显示不清。', N'如上所述，请结合术中所见。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 139, N'ERCP正常 阴性', N'胆总管、肝总管、左右肝内胆管显示，胆管管壁光洁，走行尚可，未见明显扩张，未见狭窄，未见明显充盈缺损，胆总管下端有造影剂进入十二指肠。', N'所示肝内外胆管未见明显异常。', 100, 0, N'DR', N'ERCP', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 140, N'正常骶髂关节 阴性', N'两侧骶髂关节组成骨未见明显骨质破坏，关节间隙未见明显狭窄或增宽。', N'两侧骶髂关节未见明显异常。', 100, 0, N'DR', N'骶髂关节', 1, N'b01245d2cf9442a1afc94796abdf9a26');
