INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 143, N'左手中指中节指骨骨折 阳性', N'左手中指中节指骨头端局部骨皮质断裂，可见斜形透亮线影，断端对位对线佳，周围软组织未见明显肿胀，余掌指骨未见明显骨折及脱位征象，诸关节对合良好。', N'左手中指中节指骨骨折。', 100, 0, N'DR', N'左手正斜位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 143, N'正常 阴性', N'左手各掌指骨未见明显骨折线影。诸关节相对位置无殊。中指末端软组织局部不规则。', N'左手掌指骨未见明显骨折脱位。No fracture can be found.', 100, 0, N'DR', N'左手正斜位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 143, N'正常 阴性', N'左手各腕骨、各掌指骨骨质完整，未见明显骨质疏松、增生及破坏，各关节对合良好，关节面光整，关节间隙未见狭窄，周围软组织未见明显肿胀。', N'左手正斜位X片未见明显异常。', 100, 0, N'DR', N'左手正斜位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
