INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 156, N'左侧股骨正常 阴性', N'左侧股骨骨质结构完整，密度正常，未见骨质破坏、骨质增生、骨质疏松等骨质异常，。左侧髋关节对位良好，关节面光整，关节间隙未见增宽或变窄。相邻软组织未见异常。', N'左侧股骨未见明显异常。No abnormality is found.', 100, 0, N'DR', N'左股骨正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 156, N'骨折', N'左股骨干中段皮质断裂翘起，可见小片状骨质游离，对位尚可。软组织肿胀明显。', N'左股骨干中段骨折。', 100, 0, N'DR', N'左股骨正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
