INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 157, N'足舟骨副骨 阴性', N'右侧足舟骨内侧见透亮线及小骨块，边缘较光整、欠锐利，余右足骨质结构完整，未见中断破坏等改变，各关节骨性关节面光整，关节间隙无殊。周围软组织未见明显异常。', N'右侧足舟骨内侧小骨块考虑副骨变异，请结合临床除外骨折。
