INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 170, N'右膝 正常 阴性', N'右膝关节各骨大小形态如常，骨质密度均匀，髌骨未见异常，关节间隙不窄，关节面光整。', N'右膝关节骨质未见确切异常。', 100, 0, N'DR', N'右膝正侧位(站立)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 170, N'右膝 退变 阳性', N'右膝关节骨质密度减低，皮质变薄。胫骨内外髁见骨质增生，髁间隆起变尖，内侧关节间隙稍变窄。余骨未见明显异常。', N'右膝关节退行性改变伴骨质疏松。', 100, 0, N'DR', N'右膝正侧位(站立)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 170, N'右膝关节退行性改变。 阳性', N'右侧股骨远端、胫骨近端及髌骨边缘见骨质增生影，髁间隆起变尖，关节间隙无明显变窄，周围软组织无殊。', N'右膝关节退行性改变。', 100, 0, N'DR', N'右膝正侧位(站立)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 170, N'退变 阳性', N'右膝关节骨质密度减低，皮质变薄。胫骨内外髁见骨质增生，髁间隆起变尖，内侧关节间隙稍变窄。余骨未见明显异常。', N'右膝关节退行性改变伴骨质疏松。', 100, 0, N'DR', N'右膝正侧位(站立)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 170, N'正常 阴性', N'右膝关节骨质完整，未见明显增生及破坏，关节间隙正常，周围软组织未见明显肿胀。', N'右膝关节未见明显异常。 No abnormality was found', 100, 0, N'DR', N'右膝正侧位(站立)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 171, N'骨折术后 阳性', N'左股骨中上段骨折内固定术后改变：骨折处见及内固定钢板及钢钉影，内固定钢板及钢钉未见折断或松动征象，骨折处见及少许骨痂影，骨折线尚清晰。', N'左股骨中上段骨折内固定术后改变', 100, 0, N'DR', N'右股骨颈侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 172, N'右跟骨轴位片 阴性', N'右跟骨骨质完整，密度均匀，未见明显增生及破坏，周围软组织未见明显肿胀。', N'右跟骨骨质未见明显异常。No abnormality was found', 100, 0, N'DR', N'右跟骨轴侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 173, N'右足正常。 阴性', N'右足构成骨未见明显骨折征象，所见关节结构正常，软组织未见明显肿胀。', N'右足平片未见明显异常。', 100, 0, N'DR', N'右足正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 173, N'右足正常。 阴性', N'右足构成骨未见明显骨折征象，所见关节结构正常，软组织未见明显肿胀。', N'右足平片未见明显异常。', 100, 0, N'DR', N'右足正侧位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 174, N'左膝退变 阳性', N'左侧胫骨髁间隆起变尖，关节间隙尚可，左股骨下端及左胫骨近端边缘见骨质增生影，髌骨边缘略变尖。周围软组织无殊。', N'左膝关节退行性改变。', 100, 0, N'DR', N'左膝正侧位(站立)', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'正常 阴性', N'胸廓两侧对称，两肺未见实质性病变，两侧横隔尚清楚，卧位心影，纵隔无殊。', N'床边卧位胸片未见明显异常。', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'两肺透亮度减低 阳性', N'床边胸片显示，两肺透亮度减低，纹理增多，心影明显增宽，两侧肋膈角和横膈尚清楚。', N'两肺透亮度减低，纹理增多，提示渗出病变，请结合临床。', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'卧位末班 阳性', N'胸廓对称，气管居中，可见气管插管影及胃管影。两肺野透亮度减低，肺纹理增多增粗。卧位心影，双膈面及肋隔角模糊。胸部多根管线影重叠。', N'两肺广泛渗出伴胸腔积液考虑，右肺为著，较前片（2009-11-9）进展。请随访！', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'两肺纹理稍增多', N'两肺纹理稍增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中，心膈无殊。肋骨未见异常骨质改变。', N'两肺纹理稍增多 Increased Lung Markings', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'胸腔积液', N'两侧胸廓对称，气管居中，两肺弥漫性斑片状模糊影，透亮度降低。两膈、肋膈角未显示，膈上肋骨未见明显异常改变。', N'两侧胸腔积液改变。', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'正常 阴性', N'胸廓对称，气管居中。双肺未见明显活动性病灶。纵隔居中，卧位心影，双膈无殊。', N'两肺未见明显异常', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'两肺透亮度减低 阳性', N'床边胸片显示，两肺透亮度减低，纹理增多，心影明显增宽，两侧肋膈角和横膈尚清楚。', N'两肺透亮度减低，纹理增多，提示渗出病变，请结合临床。', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'胸部术后所见 阳性', N'两肺纹理稍增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中、其内置管，见圈状金属丝影。心外形稍大。上腔静脉内置管。', N'胸部术后所见', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 176, N'卧位末班 阳性', N'胸廓对称，气管居中，可见气管插管影及胃管影。两肺野透亮度减低，肺纹理增多增粗。卧位心影，双膈面及肋隔角模糊。胸部多根管线影重叠。', N'两肺广泛渗出伴胸腔积液考虑，右肺为著，较前片（2009-11-9）进展。请随访！', 100, 0, N'DR', N'床边卧位胸片', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'混合型 阳性', N'双侧乳腺呈混合型，其内见团片状密度增高影，边缘模糊，两侧乳腺密度不均匀，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'两侧乳腺小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'局部不对称', N'双侧乳腺多量腺体型，右乳外侧腺体密度较高，边缘不清，未见明显肿块边缘，其余两侧乳腺对称，双侧未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'右乳外侧腺体局部密度较高，局部两侧不对称，考虑局部小叶增生存在，建议半年后复查。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'正常 阴性', N'双侧乳腺呈腺体型，腺体密度均匀，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'双乳未见明显异常。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'正常 阴性', N'双侧乳腺呈混合型，未见明显肿块影及钙化影，乳头及周围皮肤光整，未见明显凹陷，双侧腋窝未见明显肿大淋巴结。', N'双侧乳腺未见明显异常。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'小叶增生、未见淋巴结', N'双侧乳腺呈混合型，其内见团片状密度增高影，边缘模糊，两侧乳腺密度不均匀，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'&#183;两侧乳腺小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'乳腺小叶增生及多发良性结节 阳性', N'两侧乳腺呈混合型，其内见团片状密度增高影，边缘模糊，腺体密度不均匀，双乳多发小结节样影，边缘光整。右乳外上象限多发细小钙化灶，左乳内上象限较粗大钙化灶，乳头周围皮肤未见明显凹陷。双侧腋下淋巴结显影。', N'两侧乳腺小叶增生，双乳多发小结节样影，右乳外上象限多发细小钙化灶，左乳内上象限良性钙化灶，双侧腋下淋巴结显影。请结合临床及其它检查。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'混合型两侧乳腺小叶增生。 阳性', N'双侧乳腺呈混合型，其内见团片状密度增高影，边缘模糊，两侧乳腺密度不均匀，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'两侧乳腺小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'致密乳腺 阳性', N'双侧乳腺呈致密型，腺体丰富，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。右腋下见淋巴结部分显影。', N'两侧乳腺小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'囊性增生 阳性', N'双侧乳腺呈多量腺体型，腺体结构欠规则，未见明显肿块和结节灶，未见沙粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'两侧乳腺小叶增生（BI-RADS II级）。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'退化型 阳性', N'双侧乳腺退化型，腺体被脂肪组织替代，乳头下方可见少量增生的腺体，双乳未见明显肿块及沙粒状钙化，未见乳头凹陷及乳腺皮肤增厚等现象。', N'双乳少量腺体小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'乳腺小叶增生 阳性', N'双侧乳腺腺体较丰富，呈弥漫性不均匀的密度增高影，边缘模糊，两侧乳腺未见明显肿块影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'混合型 阳性', N'双侧乳腺呈混合型，其内见团片状密度增高影，边缘模糊，两侧乳腺密度不均匀，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'两侧乳腺小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'混合型增生，有淋巴结 阳性', N'双侧乳腺呈混合型，其内见团片状密度增高影，边缘模糊，两侧乳腺密度不均匀，未见明显肿块影或砂粒样钙化影，乳头周围皮肤未见明显凹陷。右侧腋下见淋巴结显影。', N'两侧乳腺小叶增生，右侧腋下见淋巴结显影，请随访。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'小叶增生', N'双侧为致密性乳腺，两侧乳腺结构对称，未见明显肿块及结构扭曲，左侧乳腺内下象限可见点状密度较高的钙化影，为良性钙化，右侧乳腺未见钙化影，乳头周围皮肤未见明显凹陷。两侧腋下未见淋巴结显影。', N'1、两侧乳腺小叶增生。（BI-RADS II级）', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 178, N'小叶增生 阳性', N'双侧乳腺呈多量腺体型，腺体呈团片状不均匀分布，未见明显肿块影或砂粒样钙化影，乳头无凹陷，皮肤未见明显凹陷或增厚。两侧腋下未见淋巴结显影。', N'两侧乳腺小叶增生。', 100, 0, N'DR', N'双侧乳腺', 1, N'b01245d2cf9442a1afc94796abdf9a26');
