INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 217, N'正常成人女性心脏平扫 阴性', N'左右房室内径正常范围（左房前后径34－40mm，左右径&lt;50mm;左室舒张末期横径50－55mm；右室内径30－35mm）。左室各节段厚度正常（舒张末期室间隔12－14mm，余左室各节段10－12mm）。左室整体收缩功能正常。各瓣膜未见异常血流信号。升主动脉内径未见增宽（正常范围14-40mm)。
