INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'两肺纹理增多，请结合临床。 阳性', N'两肺纹理增多，两肺野内未见明显占位病变，两侧气管通畅，纵隔内未见明显肿大淋巴结影，两侧胸膜不厚。', N'两肺纹理增多，请结合临床。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'胸部平扫未见确切异常。 阴性', N'两肺纹理清晰，两肺野内未见明显占位病变，两侧气管通畅，纵隔内未见明显肿大淋巴结影，两侧胸膜不厚。', N'胸部平扫未见确切异常。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'腰椎正常 阴性', N'腰椎生理曲度存在，排列规则，各椎体骨质完整，未见明显骨质增生、破坏，各椎间隙及附件无殊。周围软组织未见肿胀。', N'腰椎平片未见明显异常。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'正常', N'两肺纹理走行尚自然，未见明显实质性病灶，纵隔内未见明显肿块影。两侧胸腔未见明显积液。', N'胸部CT平扫未见明显异常。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'aa 阴性', N'两肺纹理走行自然，两肺野内未见明显实质性病灶，气管分支通畅，纵隔居中，内未见明显肿大淋巴结。附见部分肝、脾无明显异常改变。胸廓骨质未见明显异常。', N'胸部CT平扫未见明显异常改变。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'正常肺 阴性', N'两肺未见实质性病变，两肺纹理清晰，气管和支气管通畅。两侧胸廓对称，纵隔和心影居中，纵隔内未见明显肿大淋巴结。', N'胸部CT平扫未见明显异常。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'腰椎退变 阳性', N'L1-5顺列，生理曲度变直，部分椎体上下缘唇样骨质增生，椎间隙未见增宽或变窄。附件无殊。', N'腰椎退行性改变。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'炎症 阳性', N'右下肺后基底段近胸膜可见斑片状模糊影，余两肺纹理走行尚自然，未见明显实质性病灶，纵隔内见肿大淋巴结影。两侧胸腔未见明显积液。', N'右下肺少许炎症伴纵隔肿大淋巴结，请结合临床。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'食管癌 阳性', N'食管下段明显管壁增厚，增强后可见强化，长约9.5cm，周围结构未见明显侵犯，所见两肺野未见明显异常密度灶，气管通畅，纵隔内见肿大淋巴结影。肋骨未见明显骨质破坏。', N'食管下段癌伴纵隔淋巴结转移首先考虑。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'肺气肿，肺癌 阳性', N'两肺纹理增多，两肺透亮度增加，见散在囊状透亮区。左上肺舌段近胸膜可见团片状高密度影，边界清楚而不光整，可见短毛刺，余邻近胸膜粘连。余两肺纹理走行尚自然，未见明显实质性病灶，纵隔内见肿大淋巴结影。两侧胸腔未见明显积液。', N'1、两肺气肿。慢支？请结合病史。
