INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 220, N'小结节 阳性', N'右肺尖胸膜下见钙化小结节，右肺上叶前、后段交界处见小斑片影，余两肺内未见明显活动性病灶。气道通畅，纵隔内未见明显肿大淋巴结。胸膜未见明显增厚。胸廓骨性结构完整。', N'右肺尖胸膜下良性钙化小结节，右肺上叶小斑片灶，请随访。', 100, 0, N'MR', N'上腹部平扫', 1, N'b01245d2cf9442a1afc94796abdf9a26');
