INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 272, N'深静脉瓣膜功能不全', N'在左踝水平扎止血带后，经左足背静脉注入稀释对比剂，逐段摄片见：左小腿部多量浅静脉显影，扭曲增粗，大隐静脉显影，深静脉走行自然边缘光整，管腔增粗呈直桶状，未见竹节样静脉瓣形态，左股髂静脉显示可，未见侧支开放。', N'左下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'RF', N'左下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
