INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 272, N'左下肢静脉曲张 阳性', N'在左踝关节水平扎止血带后，经左足背静脉注入稀释碘帕醇约100ml，逐段摄片观察，见左下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，左股静脉髂静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'左下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'RF', N'左下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
