INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 272, N'深静脉血栓形成', N'在左侧踝关节水平扎止血带后，经足背静脉注入稀释欧乃派克及少量肝素钠约100ml，逐段摄片观察，见左下肢浅静脉显示，扭曲扩张，大隐静脉及胫后静脉显影，而胫前静脉及腘静脉均未显示，周围见大量的侧支血管，左股静脉上段部分显影，而髂静脉未显影，盆腔可见大量的迂曲侧支血管。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 272, N'左下肢静脉曲张 阳性', N'在左踝关节水平扎止血带后，经左足背静脉注入稀释碘帕醇约50ml，逐段摄片观察，见左下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，左股静脉髂静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'左下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'RF', N'左下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 272, N'左下肢静脉造影', N'在左踝关节水平扎止血带后，经左足背静脉注入稀释欧乃派克约100ml，逐段摄片观察，见左下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，左股静脉髂静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'左下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'RF', N'左下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 273, N'中下段静脉曲张', N'食管各段钡剂通过顺利，胸腹段食管粘膜皱襞明显增宽、迂曲，可见不规则串珠状样充盈缺损，管壁边缘呈锯齿状，局部粘膜未见明显破坏中断，管壁柔软，蠕动尚可。', N'食道中下段静脉曲张。esophageal varicosis', 100, 0, N'RF', N'食道造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 273, N'正常食道', N'口服钡剂后，见食管各段钡剂通过顺利，食管管腔柔软，粘膜线完整连续，蠕动良好，未见腔内充盈缺损，未见粘膜破坏，无管腔狭窄及异常扩张。双侧会厌豀对称。', N'食道造影未见明显异常。', 100, 0, N'RF', N'食道造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 273, N'增生型食道癌', N'食管中段管壁扩张、僵硬，欠蠕动，可见充盈缺损，钡剂绕流，长度约45mm，其上段未见明显扩张。余段钡剂通过顺利，粘膜线完整连续，未见明显破坏征象。胃张力中等，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。', N'考虑中段增生型食道Ca', 100, 0, N'RF', N'食道造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 273, N'口咽部 阴性', N'两侧会厌溪及梨状窝对称，口咽部未见明显占位，钡剂通过顺畅。食管各段钡剂通过顺利，食管管壁柔软，蠕动良好，粘膜线完整连续，未见明显破坏征象。贲门开放自然。胃张力中等，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。', N'胃肠造影未见明显异常。', 100, 0, N'RF', N'食道造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 274, N'动眼神经受压。 阳性', N'扫描序列：AX(T2W3D TOF MRA  3D Fiesta-C)
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 274, N'结肠正常造影', N'经肌注注入654－2后，肛管插入顺利，灌入钡剂至结肠脾曲后注入适量气体。让患者改变体位，逐段摄片观察各肠曲，未见明显异常狭窄或扩张，结肠袋型显示清晰，轮廓光整，肠腔内未见明显充盈缺损，回肠末端未见明显异常。阑尾显影良好，粗细均匀。', N'结肠气钡灌肠双重对比造影检查未见明显器质性病变。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'食道癌esophageal carcinoma 阳性', N'约主动脉弓下方50mm食管中段管壁僵硬，欠蠕动，呈环形狭窄，可见向腔内突起充盈缺损，表面不规则，粘膜破坏，长度约45mm，其上段未见明显扩张。余段钡剂通过顺利，粘膜线完整连续，未见明显破坏征象。胃张力中等，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。', N'食道中段癌。Esophageal carcinoma.', 100, 0, N'RF', N'上胃肠造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'胃窦癌 阳性', N'食管各段钡剂通过顺利，食管管壁柔软，蠕动良好，粘膜线完整连续，未见明显破坏征象。胃张力中等，胃窦小弯侧可见大小约30mm&#215;22mm软组织块影，其内见小钡斑沉着，周围可见环提，肿块周围粘膜中断破坏，胃窦部蠕动缓慢，幽门管开放迟缓。十二指肠球部充盈良好，降部可见小囊袋样突起，内可见粘膜进入。', N'胃窦小弯侧占位，胃窦癌考虑。
