INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'食道裂孔疝', N'口服钡剂后，见食管各段钡剂通过顺利，食管管腔柔软，粘膜线完整连续，蠕动良好，未见腔内充盈缺损，未见粘膜破坏，无管腔狭窄及异常扩张，双侧会厌豀对称。取仰卧头低足高位，嘱患者做深呼吸，膈上出现长约46mm的疝囊，其内可见胃粘膜皱襞。胃呈瀑布型，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，近幽门处可见一直径8mm类圆形囊状突出影，周围粘膜完整，未见明显破坏征象，降部及水平部粘膜无殊。', N'1、食道裂孔疝；
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'正常 阴性', N'食管钡剂通过顺利，管壁柔软蠕动良好，粘膜连续，未见明显破坏。贲门开放自然。胃张力中等，胃大小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软蠕动存在，幽门开放排空无殊。十二指肠球部形态良好，十二指肠圈无殊。', N'上胃肠钡餐造影未见明显异常。', 100, 0, N'RF', N'上胃肠造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'正常 阴性', N'食管各段钡剂通过顺利，食管管壁柔软，蠕动良好，粘膜线完整连续，未见明显破坏征象，贲门开放自然。胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。', N'上胃肠造影未见明显器质性病变。', 100, 0, N'RF', N'上胃肠造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
