INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'正常1', N'食管各段钡剂通过顺利，食管管壁柔软，蠕动良好，粘膜线完整连续，未见明显破坏征象，贲门开放自然。胃张力中等，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。', N'上胃肠造影未见明显器质性病变。normal', 100, 0, N'RF', N'上胃肠造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 275, N'食道裂孔疝', N'胸腹部透视未见明显异常。 
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 276, N'正常', N'肝内外胆管显影良好，管壁光洁，走行自然，未见狭窄、扩张或明显充盈缺损影，胆总管下端通畅，对比剂进入十二指肠顺利，无溢出到腹腔内。', N'T管造影未见明显异常。', 100, 0, N'RF', N'T字管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 276, N'T管正常 阴性', N'经T管注入对比剂，可见胆总管、肝总管、左右肝内胆管显影良好，无对比剂溢出到腹腔内，未见狭窄及充盈缺损。胆总管下端通畅，可见对比剂进入十二指肠。', N'Ｔ管造影胆道系统未见明显异常。', 100, 0, N'RF', N'T字管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 276, N'T管脱出', N'经T管注入稀释泛影葡胺，可见引流管显影，造影剂经窦道流出皮肤表面，肝内外胆管未见显示，未见造影剂进入腹腔。', N'上述表现，考虑T管脱出。', 100, 0, N'RF', N'T字管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 276, N'胆管炎 阳性', N'经T管注入稀释泛影葡胺，可见胆总管、肝总管、左右肝内胆管显影良好，左右肝内胆管管径粗细不均，部分扩张，走行僵直，呈枯枝样改变，胆总管扩张，管径约13mm，胆道内未见明显狭窄及充盈缺损，胆总管下端通畅，可见对比剂进入十二指肠，无对比剂溢出到腹腔内。', N'胆总管及部分左右肝内胆管扩张伴胆管炎。', 100, 0, N'RF', N'T字管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 276, N'正常T管', N'经T管注入稀释泛影葡胺，可见胆总管、肝总管、左右肝内胆管显影良好，无对比剂溢出到腹腔内，胆管管壁光洁，走行自然，未见狭窄及充盈缺损。胆总管下端通畅，可见对比剂进入十二指肠。', N'Ｔ管造影胆道系统未见明显异常。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'HSG正常 阴性', N'往子宫内注入适量对比剂，子宫显影良好，两侧子宫角显示可；两侧输卵管显影良好，对比剂通过顺畅，弥散良好。', N'子宫输卵管造影提示两侧输卵管通畅。', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'正常', N'往子宫内注入稀释欧乃派克，子宫显影良好，两侧子宫角显示可；两侧输卵管呈细线样显影，造影剂通过顺畅，呈羽毛样分布，弥散良好。', N'子宫输卵管造影未见明显异常。No abnormality was found.', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'正常 阴性', N'往子宫内注入适量优维显，子宫显影良好，两侧子宫角显示可；两侧输卵管呈细线样显影，造影剂通过顺畅，呈羽毛样分布，弥散良好。', N'子宫输卵管造影未见明显异常。', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'子宫输卵管造影未见明显异常。 阴性', N'往子宫内注入适量对比剂，子宫显影良好，两侧子宫角显示可；两侧输卵管显影良好，对比剂通过顺畅，弥散良好。', N'子宫输卵管造影未见明显异常。', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'积水', N'往子宫内注入稀释欧乃派克，子宫显影良好，两侧子宫角显示尚可；两侧输卵管近中段呈细线样，伞部扩张明显，在较高压力下，少量造影剂通过。10分钟后摄片，两侧输卵管伞部造影剂积聚，形态固定，盆腔内未见造影剂弥散。', N'两侧输卵管伞部积水。', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'正常', N'子宫腔显影良好，边缘光整。两侧输卵管呈细线样显影，走行自然，造影剂通过顺畅，弥散良好，盆腔内呈羽毛状分布，未见明显异常积聚征象。', N'子宫输卵管造影未见明显异常。', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 277, N'输卵管不通', N'往子宫内注入稀释欧乃派克，子宫显影良好，两侧子宫角显示尚可；两侧输卵管远端及伞部扩张明显，在较高压力下，少量造影剂通过。10分钟后摄片，两侧输卵管伞部造影剂积聚，形态固定，盆腔内未见造影剂弥散。', N'两侧输卵管积水、不通。', 100, 0, N'RF', N'子宫输卵管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 278, N'右下肢静脉曲张. 阳性', N'在右踝关节水平扎止血带后，经右足背静脉注入稀释碘帕醇约50ml，逐段摄片观察，见右下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，右股静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'右下肢静脉曲张.', 100, 0, N'RF', N'右下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 278, N'右下肢静脉曲张 阳性', N'在右踝关节水平扎止血带后，经右足背静脉注入稀释碘帕醇约100ml，逐段摄片观察，见右下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，右股静脉髂静脉显影尚可，未见明显异常，见侧支循环形成。', N'右下肢静脉曲张,深静脉瓣膜功能不全。', 100, 0, N'RF', N'右下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
