INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 278, N'双侧', N'在两侧踝关节水平上方分别扎止血带后，经足背静脉注入稀释欧乃派克约100ml，逐段摄片观察，见右下肢深浅静脉显示，浅静脉广泛扭曲扩张，以左腿尤为严重，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，两侧股静脉、髂静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'双下肢静脉曲张，深静脉瓣膜功能不全。   varicose vein', 100, 0, N'RF', N'右下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 278, N'右下肢静脉曲张 阳性', N'在右踝关节水平扎止血带后，经右足背静脉注入稀释碘帕醇约50ml，逐段摄片观察，见右下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，右股静脉髂静脉显影尚可，未见明显异常，见侧支循环形成。', N'右下肢静脉曲张。', 100, 0, N'RF', N'右下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 278, N'双下肢静脉曲张 阳性', N'在两侧踝关节水平上方分别扎止血带后，经足背静脉注入稀释碘帕醇约100ml，逐段摄片观察，见双下肢深浅静脉显示，浅静脉广泛扭曲扩张，深静脉走行自然，管腔呈直桶状，两侧股静脉、髂静脉显影尚可，未见明显异常，见侧支循环形成。', N'双下肢静脉曲张。', 100, 0, N'RF', N'右下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 278, N'右下肢静脉 阳性', N'在右踝关节水平扎止血带后，经右足背静脉注入稀释碘帕醇约50ml，逐段摄片观察，见右下肢深浅静脉显示，浅静脉扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，右股静脉髂静脉显影尚可，未见明显异常，见侧支循环形成。', N'右下肢静脉曲张,深静脉瓣膜功能不全。', 100, 0, N'RF', N'右下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'排便 阳性', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'框架', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。肛直角：静坐相为138.07度，提肛相为140.29度，力排相140.45度。测量力排相直肠前壁向前方突出约9mm。肛上距静坐、提肛、力排相分别为17mm、6mm、22mm。未见直肠粘膜脱垂或套叠征象。', N'肛直角于静坐、提肛、力排相基本相似，直肠壁轻度前突，', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'直肠粘膜脱垂 阳性', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'会阴下降，直肠前突', N'常规准备后，经肛门注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片，力排相肛上距约5.5cm，直肠前缘弧形突出约3-3.5cm，各时相肛直角尚可，未见明显粘膜脱垂征象，未见搁架征。', N'会阴下降，直肠前突。', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'粘膜脱垂', N'1、直肠粘膜轻度脱垂可能。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'RC&amp;IRI', N'直肠轻度前突伴直肠内套叠  RC &amp; IRI', N'取侧卧位，经肛门灌注硫酸钡500ml，分别摄取静坐、提肛、力排时的直肠侧位相，测肛直角：提肛相为110.78度，静坐相为128.96度，力排相114.29度。肛上距&lt;30mm。力排时直肠轻度向前突出，直肠前部距离肛管上缘约14mm。可见直肠内套叠征象，未见搁架征。', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'RC', N'肛直角于静坐、提肛、力排各相时变化正常。肛上距&lt;30mm。力排时直肠轻度向前突出，直肠前部距离肛管上缘约15mm。未见粘膜脱垂征象，未见搁架征。', N'直肠轻度前突  RC', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'排粪造影', N'肛直角：提肛相为80度，静坐相为93度，力排相119度。肛上距&lt;30mm。力排时直肠轻度向前突出，直肠前部距离肛管上缘约15mm。未见粘膜脱垂征象，未见搁架征。', N'直肠轻度前突 RC', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'RC1', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。测量力排相直肠前壁向前方突出约34mm。肛上距静坐、提肛、力排相分别为51mm、36mm、72mm。未见直肠粘膜脱垂或套叠征象。', N'直肠前壁前突。RC', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 282, N'正常', N'透视见导管上端位于L1上缘水平，经导管下端注入造影剂，见右侧肾盂肾盏显影，肾盏杯口形态存在，肾盂未见扩张，撤出导管，见输尿管逐段显影，无扩张，蠕动波存在，未见充盈缺损或异常扩张，膀胱显影，形态正常。', N'肾盂逆行造影未见明显异常。No abnormality is found.', 100, 0, N'RF', N'逆行肾盂造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'直肠粘膜脱垂 阳性', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'排便 阳性', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 279, N'框架', N'常规准备后，肛门插管顺利，注入钡剂适量后，患者取坐位，分别摄静息、提肛、力排相片。肛直角：静坐相为138.07度，提肛相为140.29度，力排相140.45度。测量力排相直肠前壁向前方突出约9mm。肛上距静坐、提肛、力排相分别为17mm、6mm、22mm。未见直肠粘膜脱垂或套叠征象。', N'肛直角于静坐、提肛、力排相基本相似，直肠壁轻度前突，', 100, 0, N'RF', N'排便造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 280, N'口服小肠造影正常', N'食管各段钡剂通过顺利，食管管壁柔软，蠕动良好，粘膜线完整连续，未见明显破坏征象。胃张力中等，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。空回肠排列正常，粘膜规整，未见明显狭窄或充盈缺损。回肠末端显示良好。', N'口服小肠造影未见明显异常。', 100, 0, N'RF', N'口服小肠造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 281, N'正常', N'常规准备，于透视下插管至十二指肠蔡氏韧带，并向其内灌注稀释硫酸钡混悬液约500ml。于透视下观察，见空肠回肠各段逐步显影，蠕动良好，未见明显龛影、梗阻或肠腔扩张、狭窄等表现，待造影剂达回盲部时停止灌钡，向肠腔内注入适量气体再行观察并摄片示空回肠及回盲部黏膜显示光滑，轮廓如常,未见明显粘膜破坏,回盲部结构清晰。阑尾未见明显显影。', N'小肠插管造影未见明显器质性病变。 No abnormality is found.', 100, 0, N'RF', N'小肠插管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 283, N'全胃肠造影未见明显异常 阴性', N'食管各段钡剂通过顺利，食管管壁柔软，蠕动良好，粘膜线完整连续，未见明显破坏征象。胃张力中等，胃大、小弯轮廓光整，粘膜皱襞规则，未见明显龛影和充盈缺损，胃壁柔软，蠕动良好，幽门开放自然，胃排空良好。十二指肠球部充盈良好，降部及水平部粘膜无殊。空回肠排列正常，粘膜规整，未见明显狭窄或充盈缺损。回肠末端显示良好。', N'全胃肠造影未见明显异常。', 100, 0, N'RF', N'全胃肠造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 284, N'双下肢静脉曲张，深静脉瓣膜功能不全。 阳性', N'在两侧踝关节水平上方分别扎止血带后，经足背静脉注入稀释对比剂约100ml，逐段摄片观察，见双下肢深浅静脉显示，浅静脉广泛扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，两侧股静脉、髂静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'双下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'RF', N'双下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 284, N'双下肢静脉曲张，深静脉瓣膜功能不全。 阳性', N'在两侧踝关节水平上方分别扎止血带后，经足背静脉注入稀释对比剂约100ml，逐段摄片观察，见双下肢深浅静脉显示，浅静脉广泛扭曲扩张，深静脉走行自然，管腔呈直桶状，静脉瓣丧失正常形态，两侧股静脉、髂静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'双下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'RF', N'双下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 284, N'双下肢静脉曲张 阳性', N'在两侧踝关节水平上方分别扎止血带后，经足背静脉注入稀释碘帕醇约100ml，逐段摄片观察，见两下肢深浅静脉显示，浅静脉广泛扭曲扩张，深静脉走行自然，管腔呈直桶状，两侧股静脉显影尚可，未见明显异常，未见异常侧支循环形成。', N'双下肢静脉曲张.', 100, 0, N'RF', N'双下肢静脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 286, N'纹理增多', N'两肺纹理稍增多，肺门结构稍乱，胸廓对称，气管居中，心膈无殊。', N'肺纹理稍增多。Increased lung markings.', 100, 0, N'TJ', N'胸正位', 1, N'b01245d2cf9442a1afc94796abdf9a26');
