INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 288, N'肺纹理稍增多 阳性', N'两肺纹理稍增多，肺内未见明显活动性病灶。胸廓两侧对称，气管居中。侧位显示心前心后间隙清晰，心膈无殊。', N'肺纹理稍增多。', 100, 0, N'XA', N'腹腔干动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 288, N'胃癌灌注化疗', N'患者仰卧，常规消毒铺巾，以右股动脉位穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的RH导管置于腹腔干造影，见肝总动脉、脾动脉和胃左动脉共干，胃左动脉明显增粗。先后将导管置于胃左动脉和腹腔干，注入艾恒150mg＋丝列霉素10mg+5-FU1000mg术程顺利，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', N'贲门癌插管灌注化疗。', 100, 0, N'XA', N'腹腔干动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 289, N'左肾癌', N'，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻。刺入18G穿刺针，置入6F导管鞘。将5F的SIM I导管分别置于两侧肾动脉和右副肾动脉造影，见左肾下极血管受压移位，呈抱球状改变，病变血供呈快进快出表现，病灶内见不规则的肿瘤血管。右肾未见明显异常。术程顺利，术后拔出导管鞘压迫止血。观察病情稳定后将病人送返病房。', N'左肾下极占位性病灶，肿瘤可能性大，必要时穿刺活检。', 100, 0, N'XA', N'血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'脑膜动静脉瘘', N'左侧额叶血管异常，动静脉瘘考虑（AVF，畸形血管巢不明显）。', N'患者仰卧，常规消毒铺巾，2％利多卡因5ml局麻，穿刺右股动脉，经短导丝、6F扩张器引导，置入导管鞘，5F的H1导管分别置于两侧颈内动脉和左侧椎动脉造影，见左额叶一稍粗的引流静脉提前显影，向顶部汇入上矢状窦，左侧大脑前动脉一小分支与之相连（似为额极动脉分支），但局部未见明显畸形血管巢，延续处未见明显染色等，余各血管分布、管径等无殊，术程顺利，病人无明显不适，术后拔出导管鞘压迫止血，局部包扎，观察生命体征稳定，将病人送返病房。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'脑血管AVM栓塞术', N'患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的H1导管分别置于左颈内动脉和左侧椎动脉造影。见左椎动脉明显增粗，左枕叶大片畸形血管团，并见粗大的引流静脉。造影后经交换导丝将导引导管置于左侧颈内动脉，通过导引导管将漂浮导管超选至角回动脉，注入NBCA：超液化碘油约为0.5ml:1ml的混合物约1ml，术后再次行左侧颈内动脉造影，见畸形血管团明显缩小。术程顺利，病人无明显不适，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', N'脑血管AVM栓塞术。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'动静脉畸形', N'右侧枕叶由右侧大脑后动脉供血动静脉畸形。AVM in right occipital lobe supplied by right posterior cerebral artery.', N'患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的H1导管分别置于两侧颈内外动脉和左侧椎动脉造影。见左椎动脉和基底动脉增粗，右侧大脑后动脉明显增粗，右侧枕叶大片畸形血管团，血流速度较块，见粗大的引流静脉，并有瘤样扩张，部分向皮层引流。右侧颈内动脉造影显示经后交通动脉畸形血管有显影，颈外动脉和左侧颈内动脉造影未见明显异常。术程顺利，病人无明显不适，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'前交通动脉瘤', N'患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的H1导管分别置于两侧颈内动脉和左侧椎动脉造影。前交通动脉似见局部囊状扩张，余动脉未见异常扩张或狭窄。术程顺利，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', N'前交通动脉瘤可能，建议2周后CTA或DSA复查。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'脑烟雾病', N'全脑血管造影示左侧颈内动脉闭塞，脑底侧支血管网显示，左侧大脑半球由右侧颈内动脉系统及左侧椎动脉分支供血，综合上述考虑MYAMYA病。', N'患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的H1导管分别置于两侧颈内动脉和左侧椎动脉造影，示左侧颈内动脉于C2水平闭塞呈盲端样改变，左侧颈外动脉显影可，并见部分分支与颅内交通供应左侧额叶区域，右侧颈内动脉造影见脑底区大量迂曲走行侧支血管影，并与左侧大脑前动脉及大脑中动脉交通供血，左侧椎动脉造影见有分支与右侧大脑前动脉及中动脉交通供应右侧大脑半球，并见分支供应左侧大脑中动脉区域。术程顺利，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'正常脑血管', N'患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的H1导管分别置于两侧颈内动脉和左侧椎动脉造影。脑血管各分支走行自然，未见异常扩张或狭窄。术程顺利，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', N'脑血管造影未见明显异常。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'下肢静脉曲张', N'在左踝扎止血带后，经左足背静脉注入稀释对比剂，逐段摄片观察，见左小腿部多量浅静脉显示扭曲扩张，大隐静脉显影，深静脉走行自然，管腔略粗呈直桶状，静脉瓣竹节样正常形态丧失，左股髂静脉通畅。', N'左下肢静脉曲张，深静脉瓣膜功能不全。', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 292, N'动脉硬化', N'于右侧股动脉穿刺，置导管于腹主动脉下段造影，示两侧髂总、两侧髂内动脉管壁毛糙，局部多处管腔变窄，两侧髂外动脉管壁尚光整，股动脉管腔明显变细，呈麻花辫样改变，下段局部中断，其远端动脉通过交通支血管显影，左侧胫后动脉显示，管径粗细不一。 右侧小腿动脉显示差。', N'下肢动脉动脉粥样硬化改变伴两侧股动脉下段局部中断及小腿动脉显示差。', 100, 0, N'XA', N'下肢动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'脑膜瘤', N'额部巨大肿瘤染色，考虑脑膜瘤，有多支血管参与供血。', N'患者仰卧，常规消毒铺巾，以右股动脉为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入5F导管鞘。经导管鞘将5F的H1导管分别置于两侧颈内动脉、两侧颈外动脉和右侧椎动脉造影。见额部巨大肿瘤染色，两侧颈内动脉及两侧颈外动脉共同参与供血，以颈内动脉为主。术程顺利，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 290, N'鼻咽部纤维血管瘤栓塞术 阳性', N'患者平卧，常规消毒铺巾，5ml利多卡因局麻，穿刺左侧股动脉，经短导丝及扩张器引导，置入导管鞘，以5F-H1导管经长导丝引导，置管于右侧颈内、右侧颈外动脉、左侧颈外动脉造影，可见鼻咽部团状染色，右侧颈外动脉的上颌动脉及咽升动脉为主供血，左侧少量供血；右位主动脉弓。经过长导丝引导，分别超选至右侧上颌动脉及咽升动脉，注入150～300um大小的明胶海绵颗粒约半瓶，术毕退管至右侧颈外动脉造影，鼻咽部染色已基本未见。撤管后穿刺点压迫止血20分钟，包扎送返病房。', N'鼻咽部纤维血管瘤栓塞术。', 100, 0, N'XA', N'脑血管造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'右肝癌，TACE治疗', N'右肝癌，TACE治疗', N'常规消毒、铺巾。局麻下，行右侧股动脉Seldiner法穿刺，依次进入导丝、扩张管、导管鞘，以5F YASHIRU导管行腹腔干造影，仅左肝动脉及脾动脉显示，未见明显肿瘤染色团。选用5F SIM-1 行肠系膜上动脉造影，可见右肝动脉发自肠系膜上动脉，右肝血管增粗，右肝区见巨大肿瘤染色团，血管紊乱，管腔粗细不规则，部分区域可见细小门静脉早显。再用3F SP导管超选到右肝动脉。沿导管注入欧贝8mg,THP50mg+MMC10mg+碘油30ml的混合乳剂，间隔灌注水化艾恒150mg。术程顺利，患者尚可耐受。拔管后行穿刺点压迫止血及加压包扎，患者生命体征稳定，安返病房。', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'肝癌TACE术后。 阳性', N'患者取仰卧位，常规消毒、铺巾、2%利多卡因局麻后，采用改良seldinger法，使用18G穿刺针经右股动脉穿刺，置入5F导管鞘，使用5F Yashiro导管超选至肝右动脉，共静脉注入枢丹8mg，MMC 10mg＋THP 50mg＋碘化油15ml混合乳剂，并间隔灌注水化艾恒150mg。术中顺利，患者尚可耐受。术后拔出导管及导管鞘，穿刺部位压迫止血20分钟，无出血及血肿，加压包扎后送返病房。', N'肝癌TACE术后。', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'TACE', N'常规消毒、铺巾，局麻下，行右侧股动脉Seldinger法穿刺，依次进入导丝、扩张管、导管鞘，以RH导管插入腹腔干造影显示右肝血管增粗，紊乱，并见巨大肿瘤染色团。超选至肝固有动脉，沿导管注入欧贝8mg，THP50mg＋MMC10mg＋超液化碘油的混合乳剂，间隔灌注水化艾恒150mg，患者诉右上腹胀痛，无其它不适。拔管后行穿刺点压迫止血及加压包扎，患者生命体征稳定，安返病房。', N'TACE', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'肝癌行TACE术。 阳性', N'患者系肝癌。常规消毒、铺巾。局麻下，行右侧股动脉Seldiner法穿刺，依次进入导丝、扩张管、导管鞘，以5F的Yashiyo导管插入腹腔干造影，见右肝区类圆形团状色，右肝顶小片动静脉瘘。肝动脉分支迂曲毛躁。经长导丝引导，超选插管至右肝动脉及肝固有动脉。沿导管注入格拉司琼4mg后，导管内间隔注入THP50mg+MMC10mg+超液化碘油16ml的混合乳剂及水化艾恒150mg。术程顺利，患者无不适主诉。拔管后行穿刺点压迫止血及加压包扎，患者生命体征稳定，安返病房。', N'肝癌行TACE术。', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'portal embolization', N'常规准备后，在B超引导下，以PTCD穿刺引导系统的22G穿刺针穿刺右侧门静脉分支成功，扩张针道，置入6F导管鞘，以5F的Siemens－2导管选择性插管到右侧门静脉分支内，反复造影明确位置后，植入8mm－15mm大小不同长度的带毛弹簧钢圈9个，造影显示右侧门静脉分支已经堵塞，拔管局部压迫。术毕穿刺腹水显示有血性腹水，考虑可能为针道出血，但是患者生命体征尚稳定。术毕监测血压等生命体征，告知患者家属可能的并发症。', N'经皮穿刺右侧门静脉栓塞术以及手术后改变。', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'TACE', N'患者系肝癌。常规消毒、铺巾。局麻下，行右侧股动脉Seldiner法穿刺，依次进入导丝、扩张管、导管鞘，以5F的RH导管插入腹腔干造影，左、右肝见到肿瘤染色团。再用SP导管超选到肝固有动脉。沿导管注入欧贝8mg,THP50mg+MMC10mg+超液化碘油10ml的混合乳剂，间隔灌注水化艾恒150mg。术程顺利，患者无不适主诉。拔管后行穿刺点压迫止血及加压包扎，患者生命体征稳定，安返病房。', N'肝癌行TACE术', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 291, N'肝癌行TACE术。 阳性', N'患者系肝癌。常规消毒、铺巾。局麻下，行右侧股动脉Seldiner法穿刺，依次进入导丝、扩张管、导管鞘，以5F的Yashiyo导管插入腹腔干造影，见右肝区类圆形团状色，右肝顶小片动静脉瘘。肝动脉分支迂曲毛躁。经长导丝引导，超选插管至右肝动脉及肝固有动脉。沿导管注入格拉司琼4mg后，导管内间隔注入THP50mg+MMC10mg+超液化碘油16ml的混合乳剂及水化艾恒150mg。术程顺利，患者无不适主诉。拔管后行穿刺点压迫止血及加压包扎，患者生命体征稳定，安返病房。', N'肝癌行TACE术。', 100, 0, N'XA', N'肝动脉栓塞化疗', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 292, N'动脉硬化', N'于左侧股动脉穿刺，置导管于腹主动脉下段造影，示右侧腔内动脉管壁毛糙，局部多处管腔变窄，两侧髂外动脉管壁上光整，股动脉下段管壁逐渐变毛糙，管腔不规整，其中右侧股动脉下段局部中断，长度约6CM左右，其远端动脉通过交通支血管显影，胫前、胫后及腓动脉显示，管径粗细不一。', N'右侧髂内动脉、两侧股动脉及下支动脉动脉粥样硬化改变伴右侧股动脉下段局部中断。', 100, 0, N'XA', N'下肢动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 293, N'经皮左锁骨下动脉途径肝动脉内置管＋皮下药盒植入术', N'取仰卧位，左锁骨下区为中心消毒、铺巾，2%利多卡因局麻下行左锁骨下动脉穿刺，引入“J”形导丝至降主动脉，沿导丝送入5F扩张管扩张针道，沿导丝送入5F Cobra导管至腹腔动脉－肝总动脉－肝固有动脉，造影证实并显示肝内肝动脉－门静脉瘘明显，交换导管将留置管植入肝动脉内，导管末端位于肝固有动脉远端，皮肤端与药盒连接，将药盒植入左锁骨下区皮下，置橡皮引流条1条，缝合皮肤，包扎后返病房。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 294, N'支气管动脉栓塞', N'两侧支气管动脉造影和右侧支气管动脉栓塞治疗术。right bronchial artery emblization', N'患者仰卧，常规消毒铺巾，以右股动脉作为穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘，经导管鞘将5F的simons1导管置于左右支气管动脉造影：见左侧支气管动脉显影正常，右侧支气管动脉增粗不明显，但可见可见多处造影剂外溢征象，然后采用sp导管超选转插入右侧支气管动脉分支，遂予500～700umPVA颗粒栓塞，栓塞完毕再次造影原造影剂外渗现象消失。术程顺利，患者未见明显不适，术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', 100, 0, N'XA', N'支气管动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 294, N'支气管动脉栓塞术', N'支气管动脉栓塞术。', N'患者仰卧，常规消毒铺巾，以右股动脉位穿刺点，2％利多卡因5ml局麻，置入6F导管鞘。经导管鞘将5F导管置于支气管动脉造影，示右肺及左下肺由该支动脉供血，其中见右上肺血管增粗扭曲，经导管注入300～500um的PVA颗粒，后造影见该支气管动脉分支已阻断，主干存在。术中患者无不适主诉。拔管后行穿刺点压迫止血及加压包扎，患者生命体征稳定，安返病房。', 100, 0, N'XA', N'支气管动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 295, N'颅底MR平扫未见明显异常征象 阴性', N'颅底平扫所示脑实质无明显异常信号，灰白质分界清楚，脑干及小脑亦未见明显异常信号灶。脑室、脑池、脑沟大小、形态与年龄相符，颅底结构未见明显异常改变，双侧桥脑小脑角区未见占位病灶，脑中线结构居中。', N'颅底MR平扫未见明显异常征象。', 100, 0, N'XA', N'肠系膜上动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 295, N'双侧三叉神经未见明显异常 阴性', N'双侧三叉神经清楚显示，神经周围可见微小血管，未见明显神经-血管交互压迫征象。桥前池和双侧桥脑小脑角未见占位病灶。扫描区域脑实质未见异常信号影。', N'双侧三叉神经未见明显异常。', 100, 0, N'XA', N'肠系膜上动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 295, N'正常 阴性', N'平扫骨窗显示双侧乳突气化良好，密度无增高，小房间隙清晰，双侧内听道对称无扩大，中耳骨质结构完整，鼓室无增大，听小骨未见破坏。', N'两侧颞骨内听道未见明显异常。', 100, 0, N'XA', N'肠系膜上动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 295, N'乳突炎，胆脂瘤 阳性', N'左侧乳突气化较差，左侧乳突气房、鼓室上鼓室及鼓窦内软组织密度影充填，右侧上述结构充气良好，两侧听小骨形态良好。双侧内听道对称无扩大，耳蜗半规管存在。两侧外耳道通畅。
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 295, N'小肠间质瘤', N'盆腔内约第六组小肠处一血供丰富的肿块，考虑小肠间质瘤。', N'患者取仰卧位，常规消毒、铺巾、2%利多卡因5ml局麻后，采用改良seldinger法，使用18G穿刺针穿刺右股动脉，置入6F导管鞘， 使用SIEMMENSI导管超选择插管至肠系膜上动脉及肠系膜下动脉造影，盆腔内约第六组小肠处可见一团肿瘤血管，及肿瘤染色，肿块边界清边界清楚，供血动脉较粗。肿块由肠系膜上动脉供血。肠系膜下动脉显示较清，术程顺利，患者无明显不适。术后拔出导管及导管鞘，穿刺部位压迫止血20分钟，无出血及血肿，加压包扎后送返病房。', 100, 0, N'XA', N'肠系膜上动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 295, N'正常SMA', N'腹腔干及肠系膜上动脉造影未见明显异常。', N'患者仰卧，常规消毒铺巾，以右股动脉位穿刺点，2％利多卡因5ml局麻，刺入18G穿刺针，置入6F导管鞘。经导管鞘将5F的SMI1导管分别置于腹腔干及肠系膜上动脉造影。消化道未见明显出血,未见明显肿块及血管改变。肠系膜下动脉手术后闭塞。术后拔出导管鞘压迫止血，观察病情稳定后将病人送返病房。', 100, 0, N'XA', N'肠系膜上动脉造影', 1, N'b01245d2cf9442a1afc94796abdf9a26');
INSERT INTO DiagnosticTemplate ( CatalogId, TemplateName, Conclusionlook, Diagnoselook, SortNO, NegativePositive, ExamType, ExamBodyPart, IsPublic, CreateUID) VALUES ( 296, N'子宫动脉栓塞', N'左侧子宫动脉出血，左侧子宫动脉及右侧髂内动脉栓塞术。', N'患者仰卧，常规消毒铺巾，以右股动脉位穿刺点，2％利多卡因5ml局麻，采用18G穿刺针Seldinger技术，置入6F导管鞘及5F的Cobra导管，置于左髂内动脉造影，可见左侧子宫动脉明显增粗，局部呈瘤样扩张，可见较多对比剂溢出血管外，进入子宫腔内，见导管超选到左侧子宫动脉，予明胶海绵半块粉末及凯福隆1g灌注，再次造影可见左子宫动脉主干显示，血流明显减慢，其分支已阻塞，未见明确对比剂溢出血管腔外，行右侧髂外血管造影可见右侧子宫动脉迂曲，子宫染色较明显，未见异常血管。右股动脉位穿刺点，2％利多卡因5ml局麻，采用18G穿刺针Seldinger技术，置入6F导管鞘及5F的Cobra导管，置于右髂内动脉造影，因右侧子宫动脉迂曲，无法将导管超选到右侧子宫动脉，行右侧髂内动脉栓塞治疗，予明胶海绵条块半块及凯福隆1g灌注，重复造影可见右髂内动脉主干显示，其分支已阻塞。
